INSERT INTO `ps_product_lang` VALUES (60,1,1,'<h2><strong>Włóczka Tibetan Pascuali</strong></h2><p>Tibetan Pascuali to włóczka, która powstała z ultracienkich włókien wełny merynosów, a także wełny jaka. Wełna merynosów jest oczywiście wolna od mulesingu i pochodzi z Argentyny i Patagonii. Tibetan to przędza wykonana z cienkiego włókna merynosów o grubości 17,5 mikrona oraz wełny jaka o grubości ok. 16 mikronów. Posiada certyfikat GOTS, co oznacza, że ​​proces uprawy jest organiczny i do jego produkcji nie używa się toksycznych wybielaczy, barwników i innych środków chemicznych.</p><p>Podsumowując Tibetan to luksusowa przędza, która jest niezwykle lekka, miękka, delikatna dla skóry i bardzo oddychająca. Jest to włóczka, która z pewnością zainspiruje Cię do zrobienia na drutach najróżniejszych ubrań i akcesoriów, od miękkich i przytulnych czapek, ocieplaczy na ręce, poncza i szalików po kardigany i swetry. Rozbudowana paleta kolorystyczna daje nieograniczone możliwości twórczego dzi...</p>','\n                <p>Luksusowa przędza z wełny dziewiczej i jaka.</p><p>50 g / 125 m, druty 4,0 – 4,5 mm</p><p>70% wełna dziewicza, 30% wełna jaka</p>\n            ','tibetan-pascuali','','','','Tibetan Pascuali','','','',''),(61,1,1,'<h2>Pinta Pascuali ręcznie barwiona roślinami włóczka wełniana 50 g</h2><p>Pinta ręcznie farbowana roślinami włóczka to wyjątkowa propozycja w sklepie Między Drutami. Jako kompozycja naturalnych składników to nie tylko przędza najwyższej jakości, lecz także nić, która dostarczy Ci wspaniałych wrażeń estetycznych. Zarówno w trakcie dziergania, jak i noszenia gotowej dzianiny.</p><p>Ta wyjątkowa włóczka o wszechstronnym zastosowaniu już teraz dostępna jest w naszym sklepie w nowej odsłonie kolorystycznej! Pokolorowana naturą przez polską barwiarkę, która stworzyła markę <a href=\"https://www.instagram.com/meadow.art.yarn/\" target=\"_blank\" rel=\"noreferrer noopener\"><em><strong>Meadow Art Yarn</strong></em></a>. Do naturalnego barwienia przędzy roślinami zostały użyte m.in. następujące rośliny: <strong><span style=\"color:#cd94e0;\">modrzejec kempechiański</span></strong> dający fioletowy lub niebieski odcień, <strong><span style=\"color:#f27474;\">brezy...</span></strong></p>','\n                <p>Włóczka wełniana z dodatkiem jedwabiu i ramii – ręcznie barwiona roślinami.</p><p>50 g / 212 m, druty 3,0 mm</p><p>skład: 60% wełna merino, 20% jedwab, 20% ramia</p>\n            ','pascuali-pinta-recznie-farbowana-roslinami-50-g','','','','Pascuali Pinta ręcznie farbowana roślinami 50 g','','','',''),(62,1,1,'<h2>Cashmere Charis Pascuali włóczka wełniana z kaszmirem</h2><p>Cashmere Charis został nazwany na cześć Gracji z mitologii greckiej, uosabiającej urok, piękno i kreatywność. Dzięki skrupulatnej dbałości o szczegóły, mieszanka 70% ultracienkiej wełny merynosów i 30% luksusowego kaszmiru zapewnia niezrównane doświadczenie jakości i komfortu.</p><p>Pozyskiwana z australijskich owiec w gospodarstwach Mulesing-Free i certyfikowana przez Responsible Wool Standard (RWS), wełna merynosów ma imponującą grubość 17,5 mikronów, oferując miękkość i trwałość. To naturalne włókno zapewnia oddychalność, regulację temperatury i właściwości hipoalergiczne, dzięki czemu doskonale nadaje się do różnych ubrań. Dodatkowo luksusowy kaszmir pochodzący z Mongolii, którego grubość włókien wynosi zaledwie 15,5 mikrona, dodaje niezrównanego wyrafinowania i komfortu.</p><p>Przędza jest produkowana we Włoszech przez doświadczonych rzemieślników. Cashmere Charis prz...</p>','\n                <p>Niezwykłej miękkości mieszanka wełny dziewiczej oraz kaszmiru.</p><p>50 g / 112 m, druty: 5,0 mm</p><p>skład: 70% wełna dziewiczej (Organic Merino Ultrafine), 30% kaszmir</p>\n            ','cashmere-charis-pascuali','','','','Cashmere Charis Pascuali','','','',''),(63,1,1,'<h2>Sayama Pascuali włóczka wełniana z włosiem lamy</h2><p>Sayama to najnowsza propozycja marki Pascuali. Inspiracją do stworzenia tej miękkiej wełny była majestatyczna góra Sajama (najwyższy szczyt Boliwii). Przędza Sayama nie tylko oddaje istotę zapierającego dech w piersiach krajobrazu górskiego i żyjących tam lam, lecz także ucieleśnia bogate dziedzictwo kulturowe ludu Ajmara. Ajmarowie znani są z głębokiej duchowej więzi z naturą.</p><p>Dzięki połączeniu luksusowej wełny lamy i wełny górskiej Pascuali uzyskało włóczkę, która idealnie łączy w sobie lekkość i wytrzymałość, bez uszczerbku dla jakości i wygody. Jest ona specjalnie dostosowana do dziergania wielokolorowych wzorów, również w stylu skandynawskim.</p><p>Intensywna paleta barw Sayama odzwierciedla różnorodność kolorystyczną góry Sajama – od soczystej zieleni po głęboki błękit i żywe kolory polnych kwiatów. Każdy odcień opowiada historię przepięknych krajobrazów tej góry.</p>','\n                <p>Miękka, przyjemna w dotyku włóczka wełniana z włosiem lamy. Idealna na projekty żakardowe w stylu skandynawskim.</p><p>50 g / 112 m, druty: 4,0 mm</p><p>skład: 50% wełna dziewicza, 50% wełna lamy (baby lama)</p>\n            ','sayama-pascuali','','','','Sayama Pascuali','','','',''),(64,1,1,'<h2>Velvet Lace włóczka z wełną i jedwabiem ręcznie farbowana</h2><p>Velvet Lace to wyjątkowa włóczka skręcona z nici z wełny merynosów i jedwabiu morwowego. Farbowana w Polsce na specjalne życzenie sklepu Między Drutami, tak aby móc łączyć ją z jedwabnym <a href=\"https://miedzydrutami.pl/mohair-bliss-pascuali/\" target=\"_blank\" rel=\"noreferrer noopener\"><em><strong>moherem Bliss</strong></em></a> marki <a href=\"https://www.pascuali.de/en\" target=\"_blank\" rel=\"noreferrer noopener\"><em><strong>Pascuali</strong></em></a>. Włóczka ta jest dostępna w 100 g preclach o długości 600 metrów, co czyni ją idealną do tworzenia delikatnych, luksusowych dzianin na drutach. Dodatek jedwabiu nadaje włóczce subtelny połysk i niezwykłą miękkość, podkreślając jej wyjątkowy charakter. W połączeniu z moherem Bliss marki Pascuali, Velvet tworzy idealną kompozycję pod względem jakości, a także połączenia kolorystycznego. Z tej włóczki wydziergasz eleganckie, ponadczasowe dzianiny,...</p>','\n                <p>Ręcznie farbowana włóczka wełniana z jedwabiem. Idealna do łączenia z najwyższej jakości moherem Bliss marki Pascuali.</p><p>100 g / 600 m</p><p>skład: 50% wełna merino, 50% jedwab</p><hr /><p><span style=\"color:#339966;\">Nazwy kolorów włóczki Velvet Lace to numery kolorów <a style=\"color:#339966;\" href=\"https://miedzydrutami.pl/mohair-bliss-pascuali/\" target=\"_blank\" rel=\"noreferrer noopener\"><em><strong>Mohair Bliss</strong></em></a> marki Pascuali. Dzięki temu nie musisz się zastanawiać, który kolor moheru Bliss dopasować do włóczki Vevet tak, aby kolor był jak najbardziej jednolity.</span></p>\n            ','velvet-lace','','','','VELVET Lace','','','',''),(65,1,1,'<h2>Short Rainbow Sock skarpetkowa włóczka ręcznie farbowana</h2><p>Short Rainbow Sock to wyjątkowe farbowanie na jednolitej bazie w kolorze granatowym, a także jasnym szarym. Krótkie, neonowe i wyraziste przejścia kolorystyczne gwarantują wspaniałą zabawę podczas tworzenia dzianiny. Dzięki tej włóczce stworzysz unikalny i niepowtarzalny wzór na skarpetkach. Aby uzyskać efekt krótkich przejść kolorystycznych nasze włóczki zostały zafarbowane znaną w świecie barwiarskim techniką <em>krótkiego gradientu</em>.</p><p><em>Krótki gradient</em> to technika farbowania włóczki, w której kolory zmieniają się szybko i płynnie na krótkich odcinkach nitki. Efekt ten jest bardzo popularny w społeczności dziewiarskiej, ponieważ pozwala na tworzenie unikalnych i żywych wzorów w gotowych dzianinach. Dlatego głównym atutem włóczek farbowanych ręcznie jest ich piękno i niepowtarzalność.</p><p>Ze względu na swój wyjątkowy skład włóczka Short Rainbow Sock t...</p>','\n                <p>Włóczka skarpetkowa farbowana techniką krótkiego gradientu, która zaskoczy Cię neonowymi przejściami kolorystycznymi.</p><p>50 g / 200 m</p><p>druty: 2,5 – 3,5 mm</p><p>skład: 75% wełna merino, 25% nylon</p>\n            ','short-rainbow-sock','','','','SHORT Rainbow Sock','','','',''),(66,1,1,'<h2>Włóczka ręcznie farbowana Żonkile Sock 100 od Woollala</h2><p>To przyjemna w odbiorze włóczka z wełny merynosów z dodatkiem nylonu w autorskim farbowaniu Żonkile Sock 100 od Woollala. Wielowymiarowy kolor soczyście żółtych kwiatów, farbowanie jednokolorowe, bez przetarć i kropkowań.</p><p>Sock Merino, to włóczka z wełny merynosów z dodatkiem nylonu który sprawia, że nitka jest wytrzymalsza i trudniej ją zerwać, przy czym jednocześnie włóczka nie traci na swojej miękkości. Jest to doskonała propozycja na skarpetki, ale nie tylko. Z tej włóczki stworzysz zwiewne szale, mocne rękawiczki, wytrzymalsze sweterki.</p><h3>Parametry włóczki Żonkile:</h3><ul><li>Skład: 75% wełna merino superwash, 25% Nylon</li><li>Waga: 100 g</li><li>Długość: 425 m</li><li>Sugerowane druty: 2,5 – 3,75 mm – zobacz nasze <em><strong><a href=\"https://miedzydrutami.pl/druty/\">DRUTY</a></strong></em></li><li>Próbka ściegiem gładkim: 10 cm = 24 oczka</li><li>Zużyci...</li></ul>','\n                <p>Wielowymiarowy kolor soczyście żółtych kwiatów, farbowanie jednokolorowe, bez przetarć i kropkowań.</p><p>100 g / 420 m</p><p>skład: 75% merino, 25% nylon</p>\n            ','zonkile-woollala-sock-100','','','','Żonkile Woollala Sock 100','','','',''),(67,1,1,'<h2>Rakuda ITO włóczka wełniana z włosiem wielbłąda</h2><p>ITO Rakuda to połączenie delikatności i subtelności – wyjątkowo cienka i niesamowicie miękka włóczka z wysokiej jakości wełny, a także włosia wielbłąda. Doskonale nadaje się jako włóczka uzupełniająca do innych włóczek ITO np. jedwabnego moheru <a href=\"https://miedzydrutami.pl/ito-sensai/\" target=\"_blank\" rel=\"noreferrer noopener\"><em><strong>Sensai</strong></em></a> lub dziergania w kilka nici. Stworzysz z niej eleganckie i delikatne ubrania.</p><p>Miękkie podszycie wielbłąda ceni się za jego wyjątkową miękkość, lekkość i delikatność. Połączenie wełny z nicią z włosia wielbłąda sprawia, że włóczka Rakuda ma również elastyczną strukturę, która sprawia, że dzianina jest bardzo wygodna w noszeniu.</p><p>ITO Rakuda zachwyca nie tylko swoją miękkością, ale także wyjątkowymi właściwościami cieplnymi. Przędza rozwija swoją pełną objętość już od pierwszego prania ręcznego, dlatego zalecamy wypra...</p>','\n                <p>Cienka włóczka z jakościowej wełny i włosiem wielbłąda.</p><p>40 g / 212 m, druty 3,25 mm</p><p>skład: 70% wełny, 30% wielbłąda</p><p> </p>\n            ','rakuda-ito','','','','Rakuda ITO','','','',''),(68,1,1,'<h2>Włóczka skarpetkowa Perfect Sandnes Garn</h2><p>Miękka włóczka wełniana, wzmocniona dodatkiem nylonu. Skład włóczki Perfect Sandnes Garn jednoznacznie wskazuje na użycie w skarpetkach, jednak nic nie stoi na przeszkodzie aby tę bazową wełnianą włóczkę użyć np. w swetrach. W Norwegii jest to włóczka wykorzystywana w wielu dzianinach.</p><h3>Parametry włóczki Perfect Sandnes Garn:</h3><ul><li>Skład: 80% wełna, 20% nylon</li><li>Waga: 50 g</li><li>Długość: 100 m</li><li>Zalecane druty: 3,5 mm zobacz polecane druty <em><strong><a href=\"https://miedzydrutami.pl/druty-do-dziergania/\" target=\"_blank\" rel=\"noreferrer noopener\">TUTAJ</a></strong></em></li></ul><p>Próbka producenta ściegiem gładkim: 10 cm = 22 oczka. <span>Dla ustalenia własnej ilości oczek należy pamiętać o wykonaniu indywidualnej próbki w wybranym wzorze.</span></p><p>W zależności od indywidualnych ustawi...</p>','\n                <p>Bazowa włóczka skarpetkowa, świetna też na swetry żakardowe.</p><p>50 g / 100 m, druty 3,50 mm</p><p>80% wełna, 20% nylon</p>\n            ','perfect-sandnes-garn','','','','Perfect Sandnes Garn','','','',''),(69,1,1,'<h2>Fantazyjna włóczka ręcznie farbowana FANCY</h2><p>FANCY Wool to przyjemna w odbiorze włóczka z wełny merynosów z dodatkiem nylonu w autorskim farbowaniu od Woollala tylko dla Między Drutami. Ta wyjątkowa włóczka dostępna jest w wielu kolorach tylko i wyłącznie w naszym sklepie.</p><p>FANCY Wool, to włóczka z wełny merynosów z dodatkiem nylonu który sprawia, że nitka jest wytrzymalsza i trudniej ją zerwać, przy czym jednocześnie włóczka nie traci na swojej miękkości. Fantazyjność włóczki to przede wszystkim nietypowa struktura: cieńszy lub grubszy skręt, ozdobne nopki, miejscami przypomina przędzę boucle. Dodatkowo wyjątkowe, autorskie farbowanie. Włóczkę możesz wykorzystać jako dodatek do dzianiny, np. by stworzyć ozdobny detal na dzianinie. Świetnie sprawdzi się także jako pojedyncza nić, z której możesz wykonać sweter, szal lub chustę.</p><h3>Parametry włóczki Fancy:</h3><ul><li>Skład: 90% wełna merino superwash, 10% Nylon</li></ul>','\n                <p>Merynosowa włóczka fantazyjna o nieregularnej strukturze, dzięki której urozmaicisz swój projekt dziewiarski.</p><p>100 g / 400 m</p><p>skład: 90% merino, 10% nylon</p>\n            ','fancy-wool-wloczka-fantazyjna','','','','FANCY Wool włóczka fantazyjna','','','',''),(70,1,1,'<h2>Shio ITO włóczka wełniana</h2><p>ITO Shio to połączenie delikatności i subtelności – wyjątkowo cienka i niesamowicie miękka włóczka merynosowa, która doskonale nadaje się jako włóczka uzupełniająca do innych włóczek ITO np. jedwabnego moheru <a href=\"https://miedzydrutami.pl/ito-sensai/\" target=\"_blank\" rel=\"noreferrer noopener\"><em><strong>Sensai</strong></em></a> lub dziergania w kilka nici. Stworzysz z niej eleganckie i delikatne ubrania, które można nosić niezależnie od pory roku.</p><p>Dzięki wyjątkowej miękkości Shio ITO jest polecana dla osób o szczególnie wrażliwej skórze. Dodatkowo dzięki tej włóczce dodasz do swoich projektów na drutach lub na szydełku odrobiny luksusu.</p><h3>Parametry Shio:</h3><ul><li>Skład: 100% wełna merino</li><li>Waga: 40 g</li><li>Długość: 480 m</li><li>Zalecane druty: do dziergania w dwie nitki wybierz druty od 2,0 do 2,5 mm – zobacz nasze <em><strong><a href=\"https://miedzydrutami.pl/druty/\" target=\"_blank\" rel=\"noreferrer noopener\"></a></strong></em></li></ul>','\n                <p>Cienka włóczka z wełny merynosa.</p><p>40 g / 480 m, druty 2,0 – 2,5 mm dla podwójnej nici</p><p>100% wełna</p><p> </p>\n            ','shio-ito','','','','Shio ITO','','','',''),(71,1,1,'<h2>Pinta Pascuali ręcznie barwiona roślinami włóczka wełniana</h2><p>Pinta ręcznie farbowana roślinami włóczka to wyjątkowa propozycja w sklepie Między Drutami. Jako kompozycja naturalnych składników to nie tylko przędza najwyższej jakości, lecz także nić, która dostarczy Ci wspaniałych wrażeń estetycznych. Zarówno w trakcie dziergania, jak i noszenia gotowej dzianiny.</p><p>Ta wyjątkowa włóczka o wszechstronnym zastosowaniu już teraz dostępna jest w naszym sklepie w nowej odsłonie kolorystycznej! Pokolorowana naturą przez polską barwiarkę, która stworzyła markę <a href=\"https://www.instagram.com/meadow.art.yarn/\" target=\"_blank\" rel=\"noreferrer noopener\"><em><strong>Meadow Art Yarn</strong></em></a>. Do naturalnego barwienia przędzy roślinami zostały użyte m.in. następujące rośliny: <strong><span style=\"color:#cd94e0;\">modrzejec kempechiański</span></strong> dający fioletowy lub niebieski odcień, <strong><span style=\"color:#f27474;\">brezylka s...</span></strong></p>','\n                <p>Włóczka wełniana z dodatkiem jedwabiu i ramii – ręcznie barwiona roślinami.</p><p>100 g / 425 m, druty 3,0 mm</p><p>s<span>kład: 60% wełna merino, 20% jedwab, 20% ramia</span></p>\n            ','pascuali-pinta-recznie-farbowana-roslinami','','','','Pascuali Pinta ręcznie farbowana roślinami','','','',''),(72,1,1,'<h2>Włóczka ręcznie farbowana Marcepan Sock 100 od Woollala</h2><p>To przyjemna w odbiorze włóczka z wełny merynosów z dodatkiem nylonu w autorskim farbowaniu Marcepan Sock 100 od Woollala. Wielowymiarowy kolor marcepanu, lekki odcień o ciepłych tonach, farbowanie jednokolorowe, bez przetarć i kropkowań.</p><p>Sock Merino, to włóczka z wełny merynosów z dodatkiem nylonu który sprawia, że nitka jest wytrzymalsza i trudniej ją zerwać, przy czym jednocześnie włóczka nie traci na swojej miękkości. Jest