','Deep Orchid Woollala Sock 100','','','',''),(74,1,1,'<h2>Włóczka ręcznie farbowana Złocista Gruszka Sock 100 od Woollala</h2><p>To przyjemna w odbiorze włóczka z wełny merynosów z dodatkiem nylonu w autorskim farbowaniu Złocista Gruszka Sock 100 od Woollala. Wielowymiarowy kolor dojrzałej gruszki, z nutą ciepłego, złotego odcienia dojrzewającej żółci oraz zieleni, farbowanie jednokolorowe, bez przetarć i kropkowań.</p><p>Sock Merino, to włóczka z wełny merynosów z dodatkiem nylonu który sprawia, że nitka jest wytrzymalsza i trudniej ją zerwać, przy czym jednocześnie włóczka nie traci na swojej miękkości. Jest to doskonała propozycja na skarpetki, ale nie tylko. Z tej włóczki stworzysz zwiewne szale, mocne rękawiczki, wytrzymalsze sweterki.</p><h3>Parametry włóczki Złocista Gruszka:</h3><ul><li>Skład: 75% wełna merino superwash, 25% Nylon</li><li>Waga: 100 g</li><li>Długość: 425 m</li><li>Sugerowane druty: 2,5 – 3,75 mm – zobacz nasze <em><strong><a href=\"https://miedzydrutami.pl/druty/\">D...</a></strong></em></li></ul>','\n                <p>Wielowymiarowy kolor dojrzałej gruszki, z nutą ciepłego, złotego odcienia dojrzewającej żółci oraz zieleni, farbowanie jednokolorowe, bez przetarć i kropkowań.</p><p>100 g / 420 m</p><p>skład: 75% merino, 25% nylon</p>\n            ','zlocista-gruszka-woollala-sock-100','','','','Złocista Gruszka Woollala Sock 100','','','',''),(75,1,1,'<h2>Short Rainbow Comfy Merino włóczka ręcznie farbowana</h2><p>Short Rainbow Comfy Merino to wyjątkowe farbowanie na jednolitej bazie w kolorze granatowym, szmaragdowym, antracytowym, a także jasnym szarym. Krótkie, neonowe i wyraziste przejścia kolorystyczne gwarantują wspaniałą zabawę podczas tworzenia dzianiny. Dzięki tej włóczce stworzysz unikalny i niepowtarzalny wzór na swoim swetrze lub chuście. Aby uzyskać efekt krótkich przejść kolorystycznych nasze włóczki zostały zafarbowane znaną w świecie barwiarskim techniką <em>krótkiego gradientu</em>.</p><p><em>Krótki gradient</em> to technika farbowania włóczki, w której kolory zmieniają się szybko i płynnie na krótkich odcinkach nitki. Efekt ten jest bardzo popularny w społeczności dziewiarskiej, ponieważ pozwala na tworzenie unikalnych i żywych wzorów w gotowych dzianinach. Dlatego głównym atutem włóczek farbowanych ręcznie jest ich piękno i niepowtarzalność.</p><p>Ze względu na swó...</p>','\n                <p>Włóczka farbowana techniką krótkiego gradientu, która zaskoczy Cię neonowymi przejściami kolorystycznymi.</p><p>100 g / 400 m</p><p>druty: 2,5 – 3,5 mm</p><p>skład: 100% wełna merino SW</p>\n            ','short-rainbow-comfy-merino','','','','Short Rainbow Comfy Merino','','','',''),(76,1,1,'<div class=\"elementor-element elementor-element-b0f3e07 elementor-widget elementor-widget-heading\"><div class=\"elementor-widget-container\"><h2>Włóczka skarpetkowa Woolly Hugs Paint Socks</h2><p><span>Woolly Hugs Paint Socks to pięknie barwiona włóczka skarpetkowa. Jasne wariacje kolorów w połączeniu z neutralną bazą w trakcie dziergania ułożą się w kolorowe paski, które przyciągają wzrok. Z jednego motka (100 g) wykonasz parę skarpet w rozmiarze do 46. Paint Socks to przyjemna w odbiorze, oddychająca i trwała przędza skarpetkowa, której walory estetyczne oraz właściwości można wykorzystać na wiele sposobów w przeróżnych dzianinach. Daj się ponieść kolorom i uwolnij swoją kreatywność, nawet bez skomplikowanych wzorów dziewiarskich możesz tworzyć nie tylko skarpetki, ale także czapki, swetry żakardowe oraz kardigany.</span></p><h2>Parametry włóczki Pa...</h2></div></div>','\n                <p><span>Włóczka skarpetkowa, która w trakcie dziergania tworzy kolorowe paski.</span></p><p>100 g / 420 m, druty 2,5 – 3,0 mm</p><p>75% wełna,  25% nylon</p>\n            ','woolly-hugs-paint-socks','','','','Woolly Hugs Paint Socks','','','',''),(77,1,1,'<h2>Włóczka Alpaca 2 Isager</h2><p>Alpaca 2 Isager to cienka, podwójnie skręcona przędza. Główną cechą tej włóczki jest miękkość dlatego świetnie sprawdzi się w dzianinach dla dzieci i osób, których skóra jest wrażliwa. Miękkość i delikatność tej włóczki wykorzystasz w projektach takich jak szaliki a także chusty. Jeśli chcesz wydziergać sweter lub kardigan to pamiętaj, że jest to wyjątkowo delikatna włóczka i w wersji solo będzie podatna na nadmierne użytkowanie. Dlatego najlepszym rozwiązaniem będzie połączenie tej wyjątkowej przędzy z inną włóczka.</p><p><span>Dobierając włóczkę towarzyszącą z oferty marki Isager będziesz mieć łatwiejszy wybór właściwego tonu kolorystycznego. Kieruj się przy wyborze numerem koloru.</span></p><p>W zależności od indywidualnych ustawień monitora, kolory mogą się nieznacznie różnić.</p><p>Więcej o tej włóczce dowiesz się <a></a></p>','\n                <p>Delikatna i wyjątkowo miękka włóczka z połączenia alpaki i wełny.</p><p>50 g / 250 m, druty 3,0 mm</p><p>50% alpaka, 50% wełna</p>\n            ','alpaca-2-isager','','','','Alpaca 2 Isager','','','',''),(78,1,1,'<h2>Włóczka ręcznie farbowana Byzantine Sock 100 od Woollala</h2><p>To przyjemna w odbiorze włóczka z wełny merynosów z dodatkiem nylonu w autorskim farbowaniu Byzantine Sock 100 od Woollala. Wielowymiarowy kolor oberżyny, z nutą purpury, farbowanie jednokolorowe, bez przetarć i kropkowań.</p><p>Sock Merino, to włóczka z wełny merynosów z dodatkiem nylonu który sprawia, że nitka jest wytrzymalsza i trudniej ją zerwać, przy czym jednocześnie włóczka nie traci na swojej miękkości. Jest to doskonała propozycja na skarpetki, ale nie tylko. Z tej włóczki stworzysz zwiewne szale, mocne rękawiczki, wytrzymalsze sweterki.</p><h3>Parametry włóczki Byzantine:</h3><ul><li>Skład: 75% wełna merino superwash, 25% Nylon</li><li>Waga: 100 g</li><li>Długość: 425 m</li><li>Sugerowane druty: 2,5 – 3,75 mm – zobacz nasze <em><strong><a href=\"https://miedzydrutami.pl/druty/\">DRUTY</a></strong></em></li><li>Próbka ściegiem gładkim: 10 cm = 24 oczka</li><li>Z...</li></ul>','\n                <p>Wielowymiarowy kolor oberżyny, z nutą jasnego fioletu, farbowanie jednokolorowe, bez przetarć i kropkowań.</p><p>100 g / 420 m</p><p>skład: 75% merino, 25% nylon</p>\n            ','byzantine-woollala-sock-100','','','','Byzantine Woollala Sock 100','','','',''),(79,1,1,'<h2>Włóczka ręcznie farbowana Moon Sand Speckled Sock 100 od Woollala</h2><p>To przyjemna w odbiorze włóczka z wełny merynosów z dodatkiem nylonu w autorskim farbowaniu Moon Sand Speckled Sock 100 od Woollala. Całość utrzymana w odcieniu złamanej bieli z bardzo delikatnym nakrapianiem w intensywniejszym kolorze różowego brązu.</p><p>Sock Merino, to włóczka z wełny merynosów z dodatkiem nylonu który sprawia, że nitka jest wytrzymalsza i trudniej ją zerwać, przy czym jednocześnie włóczka nie traci na swojej miękkości. Jest to doskonała propozycja na skarpetki, ale nie tylko. Z tej włóczki stworzysz zwiewne szale, mocne rękawiczki, wytrzymalsze sweterki.</p><h3>Parametry włóczki Moon Sand Speckled:</h3><ul><li>Skład: 75% wełna merino superwash, 25% Nylon</li><li>Waga: 100 g</li><li>Długość: 425 m</li><li>Sugerowane druty: 2,5 – 3,75 mm – zobacz nasze <em><strong><a href=\"https://miedzydrutami.pl/druty/\">DRUTY</a></strong></em></li><li>Prób...</li></ul>','\n                <p>Odcień złamanej bieli z bardzo delikatnym nakrapianiem w intensywniejszym kolorze różowego brązu.</p><p>100 g / 420 m</p><p>skład: 75% merino, 25% nylon</p>\n            ','moon-sand-speckled-woollala-sock-100','','','','Moon Sand Speckled Woollala Sock 100','','','',''),(80,1,1,'<h2>Włóczka ręcznie farbowana Secret Sock 100 od Woollala</h2><p>To przyjemna w odbiorze włóczka z wełny merynosów z dodatkiem nylonu w autorskim farbowaniu Secret Sock 100 od Woollala. Całość utrzymana w odcieniu intensywnej i soczystej maliny z dodatkiem delikatnych przetarć w jaśniejszym kolorze różu oraz kontrastowych kreskach w kolorze różu, fuksji, czerwieni. Widoczne także fioletowe nakrapianie.</p><p>Sock Merino, to włóczka z wełny merynosów z dodatkiem nylonu który sprawia, że nitka jest wytrzymalsza i trudniej ją zerwać, przy czym jednocześnie włóczka nie traci na swojej miękkości. Jest to doskonała propozycja na skarpetki, ale nie tylko. Z tej włóczki stworzysz zwiewne szale, mocne rękawiczki, wytrzymalsze sweterki.</p><h3>Parametry włóczki Secret:</h3><ul><li>Skład: 75% wełna merino superwash, 25% Nylon</li><li>Waga: 100 g</li><li>Długość: 425 m</li><li>Sugerowane druty: 2,5 – 3,75 mm – zobacz nasze <em><strong><a href=\"http...\"></a></strong></em></li></ul>','\n                <p>Soczysty malinowy kolor z dodatkiem delikatnych przetarć w jaśniejszych kolorach różu oraz kontrastowych kreskach w kolorze intensywnego różu, fuksji oraz czerwieni. Widoczne także fioletowe nakrapianie.</p><p>100 g / 420 m</p><p>skład: 75% merino, 25% nylon</p>\n            ','secret-woollala-sock-100','','','','Secret Woollala Sock 100','','','',''),(81,1,1,'<h2>Włóczka ręcznie farbowana Georgina Speckled Sock 100 od Woollala</h2><p>To przyjemna w odbiorze włóczka z wełny merynosów z dodatkiem nylonu w autorskim farbowaniu Georgina Speckled Sock 100 od Woollala. Całość utrzymana w odcieniu jasnej, różowej brzoskwini z delikatnymi przetarciami w jasnym kolorze oraz subtelnym kropkowaniem w jasnych odcieniach pomarańczy i żółtego.</p><p>Sock Merino, to włóczka z wełny merynosów z dodatkiem nylonu który sprawia, że nitka jest wytrzymalsza i trudniej ją zerwać, przy czym jednocześnie włóczka nie traci na swojej miękkości. Jest to doskonała propozycja na skarpetki, ale nie tylko. Z tej włóczki stworzysz zwiewne szale, mocne rękawiczki, wytrzymalsze sweterki.</p><h3>Parametry włóczki Georgina Speckled:</h3><ul><li>Skład: 75% wełna merino superwash, 25% Nylon</li><li>Waga: 100 g</li><li>Długość: 425 m</li><li>Sugerowane druty: 2,5 – 3,75 mm – zobacz nasze <em><strong><a></a></strong></em></li></ul>','\n                <p>Przepiękny odcień jasnej brzoskwini z delikatnymi przetarciami i subtelnym kropkowaniem w jasnych odcieniach pomarańczy i żółtego.</p><p>100 g / 420 m</p><p>skład: 75% merino, 25% nylon</p>\n            ','georgina-speckled-woollala-sock-100','','','','Georgina Speckled Woollala Sock 100','','','',''),(82,1,1,'<h2>Włóczka ręcznie farbowana Pale Pink Sock 100 od Woollala</h2><p>To przyjemna w odbiorze włóczka z wełny merynosów z dodatkiem nylonu w autorskim farbowaniu Pale Pink Sock 100 od Woollala. Wielowymiarowy kolor zgaszonego różu z pięknym opalizującym efektem, farbowanie jednokolorowe, bez przetarć i kropkowań.</p><p>Sock Merino, to włóczka z wełny merynosów z dodatkiem nylonu który sprawia, że nitka jest wytrzymalsza i trudniej ją zerwać, przy czym jednocześnie włóczka nie traci na swojej miękkości. Jest to doskonała propozycja na skarpetki, ale nie tylko. Z tej włóczki stworzysz zwiewne szale, mocne rękawiczki, wytrzymalsze sweterki.</p><h3>Parametry włóczki Pale Pink:</h3><ul><li>Skład: 75% wełna merino superwash, 25% Nylon</li><li>Waga: 100 g</li><li>Długość: 425 m</li><li>Sugerowane druty: 2,5 – 3,75 mm – zobacz nasze <em><strong><a href=\"https://miedzydrutami.pl/druty/\">DRUTY</a></strong></em></li><li>Próbka ściegiem gładkim: 10 c...</li></ul>','\n                <p>Wielowymiarowy kolor zgaszonego różu z pięknym opalizującym efektem, farbowanie jednokolorowe, bez przetarć i kropkowań.</p><p>100 g / 420 m</p><p>skład: 75% merino, 25% nylon</p>\n            ','pale-pink-woollala-sock-100','','','','Pale Pink Woollala Sock 100','','','',''),(83,1,1,'<h2>Włóczka ręcznie farbowana Donegal DK Woollala</h2><p>Donegal DK Woollala to bardzo miękka i przyjemna w odbiorze włóczka z wełny merynosów w tweedowej odsłonie</p><p>Farbowana w jednolitej wersji aby tweed był dobrze widoczny, jakby na pierwszym planie. Świetna propozycja na czapki, kominy czy szale jak np <em><strong><a href=\"https://miedzydrutami.pl/petiteknit-wzory-sophie-shawl/\" target=\"_blank\" rel=\"noreferrer noopener\">Sophie Shawl</a></strong></em>. Ale świetnie będzie wyglądać również w większych dzianinach jak swetry. Donegal DK możesz użyć również do elementów w dzianinie, paskach czy intarsji</p><h3>Parametry włóczki Donegal:</h3><ul><li>Skład : 85% wełna merino superwash, 15% donegal</li><li>Waga : 100g</li><li>Długość : 212m</li><li>Sugerowane druty : 3,5 – 4,5 mm – zobacz nasze <em><strong><a href=\"https://miedzydrutami.pl/druty/\">DRUTY</a></strong></em></li><li>Próbka ściegiem gładkim 10cm = 20/21 oczka</li><li>Zużycie : czapka 1...</li></ul>','\n                <p>Wełna merino w tweedowej odsłonie</p><p>skład : 85% merino SW, 15% donegal</p><p>100g / 212 , druty : 3,5 – 4,5 mm</p>\n            ','donegal-dk-woollala','','','','Donegal DK Woollala','','','',''),(84,1,1,'<h2>Bilum Yarns Loli włóczka gradientowa</h2><p>Motki włóczki Bilum Yarns Loli gradient barwione są w taki sposób aby uzyskać gradientowe przejście koloru. Bazą w tej włóczce jest 100% wełna merino, która jest niezwykle miękka i przyjemna w dotyku. W 150g motku mamy aż 750m włóczki !</p><p>Włóczka barwiona gradientowo będzie pięknie wyglądać zwłaszcza w chustach i szalach, jak np w projekcie <strong>Stephen West Honeycombs Shawl, </strong>który znajdziecie w książce <strong><a href=\"https://miedzydrutami.pl/westknits-painting-shawls/\" target=\"_blank\" rel=\"noreferrer noopener\"><em>Paiting Shawls</em></a></strong><br />\nWzór do nabycia również na Raverty <strong><em><a href=\"https://www.ravelry.com/patterns/library/painting-honeycombs-shawl---big-honeycombs\" target=\"_blank\" rel=\"noreferrer noopener\">TUTAJ</a></em></strong></p><p>Komplet włóczek tej chusty to<strong> Bilum Yarns Loli gradinet i Bilum Loli precel</strong>. Dla dużej chusty należy przyjąć 150 g lub...</p>','\n                <p>Niesamowita włóczka gradientowa z płynnym przejściem kolorów</p><p>150g / 750m , skład : 100% wełna merino, ręczne barwienie gradientowe</p><p> </p>\n            ','bilum-yarns-loli-gradient-150g','','','','Bilum Yarns Loli gradient 150g','','','',''),(85,1,1,'<h2>Włóczka Amitola Louisa Harding</h2><p>Ta piękna włóczka włóczka Amitola której kolorystyka została stworzona przez Louisa Harding, znaną projektantkę. Charakterystyczne farbowanie, które układa na dzianinie wielobarwne pasy. Na zdjęciu pokazane są dwa motki obrazujące całe przejście koloru</p><p>Mieszanka miękkiej wełny i jedwabiu to idealna kombinacja na szale czy chusty.</p><p>Parametry włóczki Amitola:</p><ul><li>Skład : 80% wełna, 20% jedwab morwowy</li><li>Waga : 50g</li><li>Długość : 250m</li><li>Zalecane druty :5,5mm</li></ul>','\n                <p>Luksusowe połączenie wełny i jedwabiu</p>\n            ','louisa-harding-amitola','','','','Louisa Harding Amitola','','','',''),(86,1,1,'<h2>Tweed Isager połączenie wełny i moheru</h2><p><span class=\"TextRun SCXW56033993 BCX0\" lang=\"da-dk\" xml:lang=\"da-dk\"><span class=\"NormalTextRun SCXW56033993 BCX0\">Jednonitkowa włóczka Tweed Isager </span></span><span class=\"TextRun SCXW56033993 BCX0\" lang=\"da-dk\" xml:lang=\"da-dk\"><span class=\"NormalTextRun SCXW56033993 BCX0\">to rzadko spotykana kompozycja wełny i moheru.</span></span><span class=\"TextRun SCXW56033993 BCX0\" lang=\"da-dk\" xml:lang=\"da-dk\"><span class=\"NormalTextRun SCXW56033993 BCX0\"> Włókno moheru nadaje tej włóczce niezwykłą <span class=\"SpellingError SCXW56033993 BCX0\">miękkość </span>i <span class=\"SpellingError SCXW56033993 BCX0\">piękny </span><span class=\"SpellingError SCXW56033993 BCX0\">połysk.</span></span></span></p><p><span class=\"TextRun SCXW56033993 BCX0\" lang=\"da-dk\" xml:lang=\"da-dk\"><span class=\"SpellingError SCXW56033993 B...&lt;/div&gt;&lt;/body&gt;&lt;/html&gt;\"></span></span></p>','\n                <p>połączenie wełny i moheru w teedowej odsłonie</p><p>50g / 200m, druty 3,0mm</p><p>70% wełna, 30% moher</p>\n            ','tweed-isager','','','','Tweed Isager','','','',''),(87,1,1,'<h2>Diamonds Woollala luksusowa włóczka</h2><p>Niezwykła włóczka Diamonds Woollala  błyszczy w świetle jak prawdziwy diament. Subtelne skrzenie jakie będzie miała dzianina uzyskane jest poprzez dodanie cienkiej steliny do włóczki. Błysk jest delikatny i uzależniony od ilości światła jakie pada na włóczkę. Dzięki niej będziesz czuć się bardzo kobieco i elegancko, choć nie jest to włóczka tylko na wieczorowe dzianiny. Z powodzeniem można ją używać do codziennych stylizacji.</p><p>Włóczka Diamonds Lux Lace jest farbowana ręcznie przez markę Woollala.</p><p>Włóczka przeznaczona na wszelkie dzianiny – czapki, swetry, bluzki, chusty, czapki czy skarpetki.</p><p>Może być przerabiana również z dodatkiem włóczki moherowej, delikatnej jak <em><strong><a href=\"https://miedzydrutami.pl/mohair-bliss-pascuali/\" target=\"_blank\" rel=\"noreferrer noopener\">Mohair Bliss Pascuali</a></strong></em> czy <em><strong><a href=\"https://miedzydrutami.pl/isager-silk-mohair/\"></a></strong></em></p>','\n                <p>Pięknie błyszcząca włóczka, niczym diament – szyk, błysk i elegancja</p><p>100g / 400m, druty 2,25 – 3,75mm<br />\nskład : 75% wełna merino , 20% nylon, 5% stelina</p>\n            ','diamonds-woollala','','','','Diamonds Woollala','','','',''),(88,1,1,'<h2>Gruba włóczka Maximo Pascuali z BIO merino</h2><p>Maximo Pascuali zaliczane jest do przędzy „grubej”, co nawiązuje do zwiększonej grubości pasma. I właśnie to sprawia, że ​​Maximo jest tak wyjątkowy, ponieważ rzadko można znaleźć tak grubą wełnę merynosów. Nic nie może się równać z radością z grubego, szybkiego projektu! Tym bardziej, gdy to, co robisz na drutach, jest bardzo miłe i nosi się je jak marzenie!</p><p>Wełna merynosów to jedno z najlepszych włókien, charakteryzujące się wyjątkowym połyskiem i miękkością. Wysoka elastyczność pozwala na swobodne poruszanie się ciała, jest odporna na marszczenie i zwiotczenie. Ze względu na delikatność włókna nie powoduje podrażnienia przy noszeniu bezpośrednio na skórze, co czyni go idealnym wyborem nawet dla najbardziej wrażliwej skóry.</p><p>Wełna merino charakteryzuje się wysoką oddychalnością i doskonałymi właściwościami termoregulacyjnymi. Ponadto pochłania wilgoć do jednej trzeciej s...</p>','\n                <p>Gruba, organiczna włóczka merino z Argentyny</p><p>100g / 80m, druty 9mm<br />\nskład : 100% wełna merino organiczna z certyfikatem GOTS</p>\n            ','maximo-pascuali','','','','Maximo Pascuali','','','',''),(89,1,1,'<h2>Włóczka Fritidsgarn Sandnes Garn</h2><p>Fritidsgarn Sandnes Garn to gruba włóczka składająca się w 100% z norweskiej wełny owczej.</p><p>Odzież wykonana z norweskiej wełny jest lekka, ciepła i staje się coraz bardziej miękka za każdym razem, gdy ją nosisz. Wełna norweska jest trwała i odporna na mechacenie, a jej doskonała sprężystość sprawia, że ​​ubrania zachowują swój kształt przez długi czas.</p><p>Wełna jest oddychająca i rzadko wymaga prania. Zamiast tego zalecamy wietrzenie odzieży wełnianej. Odzież wykonana z norweskiej wełny charakteryzuje się długą żywotnością i może pozostać równie piękna przez kilka pokoleń. W rezultacie wełna norweska może przyczynić się do bardziej zrównoważonej konsumpcji. Przędza wełniana doskonale nadaje się do filcowania. Doskonała na różne akcesoria, jak torebki, rękawiczki, kapcie czy ozdoby.</p><p><span style=\"font-size:32px;\"></span></p>','\n                <p>100% wełna norweska</p><p>50g / 70m</p><p>druty nr 5,5mm</p>\n            ','fritidsgarn-sandnes-garn','','','','Fritidsgarn Sandnes Garn','','','',''),(90,1,1,'<h2>Włóczka ręcznie farbowana Niezapominajki KidSilk Lace od Woollala</h2><p>Niezwykle delikatna, puszysta i bardzo przyjemna w odbiorze włóczka moherowa z jedwabiem w autorskim farbowaniu Niezapominajki KidSilk Lace od Woollala. Stonowany, wielowymiarowy błękitny kolor, który przenika odcieniami głebokiej, niebieskiej wody.</p><p>Luksusowy skład włóczki – 72% Fine Kid Mohair i 28% jedwab – sprawia, że jest ona lekka niczym piórko. Idealnie sprawdzi się w dzierganiu wszelkiego rodzaju szali a także chust. Gdy dołączysz ją do drugiej włóczki, np. wełny merino otrzymasz puszystą, bardzo ciepłą dzianinę, niezwykle miękką i delikatną. Tak powstają puszyste sweterki, ciepłe czapki oraz rękawiczki. Dla uzyskanie grubszej wersji można również przerabiać dzianinę podwójną nitką moherową.</p><p>Dodatek jedwabiu sprawia, że nitka pięknie błyszczy a odcienie kolorystyczne są wielowymiarowe.</p><p>W 50 gramowych motkach znajdziecie aż 420 m niezwyk...</p>','\n                <p>Stonowany, wielowymiarowy kolor głębokiej wody.</p><p>50 g / 420 m</p><p>skład: 72% Fine Kid Mohair, 28% jedwab</p>\n            ','niezapominajki-woollala-kidsilk-lace','','','','Niezapominajki Woollala KidSilk Lace','','','',''),(91,1,1,'<h2>Włóczka Ballerina Chunky Sandnes Garn</h2><p>Włóczka Ballerina Chunky Sandnes Garn to gruba włóczka moherowa z dodatkiem wełny. To zupełna nowość wśród włóczek tej marki, która pozwoli na tworzenie dzianin z użyciem grubych drutów przy użyciu jednej nitki włóczki. Ballerina Chunky wypełnia dotychczasową lukę, kiedy do stworzenia grubszej, moherowej dzianiny konieczne było używanie dwóch lub trzech nitek cienkiej włóczki moherowej.</p><p>Uwaga, motki Ballerina Chunky są 50 gramowe, czyli to dwa razy więcej niż w klasycznej włóczce moherowej. Dodatkowo w Ballerina Chunky do scalenia włókna użyty jest poliamid, a nie włókno jedwabne.</p><h3>Parametry włóczki Ballerina Chunky :</h3><ul><li>Skład : 77% mohair 18% wełna, 5% poliamid</li><li>Waga : 50g</li><li>Długość : 135m</li><li>Zalecane druty : 5 – 7 mm, zobacz nasze <em><strong><a href=\"https://miedzydrutami.pl/druty/\">druty</a></strong></em></li><li>Zużycie bluzka rozmiar M długi rę...</li></ul>','\n                <p>PROMOCJA TYLKO DO WYCZERPANIA ZAPASU!</p><p>Gruba włóczka moherowa do tworzenia lekkich dzianin na grubych drutach</p><p>50g / 135m , druty 5 – 7mm</p><p>Skład : 77% mohair 18% wełna, 5% poliamid</p><p> </p>\n            ','ballerina-chunky-sandnes-garn','','','','Ballerina Chunky Sandnes Garn','','','',''),(92,1,1,'<h2>Luksusowa włóczka moherowa Mohair Bliss Pascuali</h2><p>Mohair Bliss Pascuali to najwyższej jakości włóczka moherowa. Wykonana z luksusowej mieszanki 60% moheru Super Kid i 40% jedwabiu morwowego.</p><p>Jest delikatna i bardzo miękka, można dziergać nią pojedynczo lub podwójnie. Można ją również łączyć z innymi włóczkami, aby stworzyć zmysłowe, lekkie jak piórko, przewiewne dzianiny. Które dzięki jedwabiowi będą miały niezwykły, subtelny połysk.</p><p>Paleta kolorów Mohair Bliss obejmuje 30 żywych i wyrafinowanych odcieni, które można mieszać i dopasowywać do włóczek marki Pascuali takich jak:<em><strong><a href=\"https://miedzydrutami.pl/pascuali-wloczka-balayage/\" target=\"_blank\" rel=\"noreferrer noopener\">Balayage</a></strong></em>,<em><strong><a href=\"https://miedzydrutami.pl/pinta-pascuali-wloczka-welniana/\" target=\"_blank\" rel=\"noreferrer noopener\">Pinta</a></strong></em>,<em><strong><a href=\"https://miedzydrutami.pl/pascuali-wloczka-puno/\"></a></strong></em></p>','\n                <p>Luksusowa włóczka moherowa</p><p>25g / 300m, druty 2,5 – 5mm<br />\nskład : 60% mohair SuperKid, 40% jedwab morwowy</p>\n            ','mohair-bliss-pascuali','','','','Mohair Bliss Pascuali','','','',''),(93,1,1,'<h2>Włóczka Silk Mohair Isager</h2><p>Włóczka Silk Mohair Isager to kompozycja moheru superkid  i jedwabiu. W odczuciu miękka i delikatna o błyszczącym wykończeniu. <span>Używamy </span><span> jej  </span><span>przede wszystkim </span><span>w </span><span>połączeniu</span><span> z </span><span>innymi </span><span>włóczkami</span><span>, ale </span><span>pięknie </span><span>prezentuje się </span><span>także </span><span>pojedynczo</span><span>, </span><span>zwłaszcza </span><span>w </span><span>prostych wzorach czy gładkim jerseyu. </span></p><p>Włóczka Silk Mohair to gwarancja eleganck...</p>','\n                <p>Miękka i delikatna włóczka moherowa</p><p>25g / 212m, druty 3,0 – 5,0mm</p><p>75% moher, 25% jedwab</p>\n            ','silk-mohair-isager','','','','Silk Mohair Isager','','','',''),(94,1,1,'<h2>Delikatna włóczka moherowa ITO Sensai</h2><p>Sensai ITO to delikatna i lekka jak piórko włóczka moherowa z dużym dodatkiem jedwabiu. Słowo <em>sensai </em>w języku japońskim oznacza <em>wróżkę</em> – w przędza jest lekka, delikatna i eteryczna dlatego to określenie bardzo odzwierciedla charakter dzianiny, która powstaje z tej włóczki. Osoby wrażliwe, które odczuwają dyskomfort w kontakcie ciała z moherem koniecznie powinny wypróbować na sobie tę delikatność. Dodatkowo Sensai jest cieńszy niż popularne włóczki typu Kid-Silk, co znacząco podnosi wydajność w zużyciu.</p><p>Włóczkę Sensai możemy przerabiać pojedynczą lub podwójną nitką tworząc koronkowe dzianiny.</p><ul><li>Dodaj włóczkę <a href=\"https://miedzydrutami.pl/ito-asa/\" target=\"_blank\" rel=\"noreferrer noopener\"><em><strong>Asa </strong></em></a>lub <em><strong>Shio</strong></em> do moheru Sensai aby nadać dzianinie stabilności.</li><li>Połącz włóczkę <a href=\"https://miedzydrutami.pl/ki...\"></a></li></ul>','\n                <p>Niezwykle delikatne i lekkie połączenie moheru z jedwabiem.</p><p>20 g / 240 m, druty 2,0 – 5,0 mm</p><p>60% moher, 40% jedwab</p><p> </p>\n            ','sensai-ito','','','','Sensai ITO','','','',''),(95,1,1,'<h2>Włóczka ręcznie farbowana Elinor KidSilk Lace od Woollala</h2><p>Niezwykle delikatna, puszysta i bardzo przyjemna w odbiorze włóczka moherowa z jedwabiem w autorskim farbowaniu Elinor KidSilk Lace od Woollala. Szare tło ocieplone dodatkiem różu i fioletu z nutą granatu</p><p>Włóczka jest lekka jak piórko o luksusowym składzie – 72% Fine Kid Mohair i 28% jedwabiu. Idealnie nadaje się na wszelkiego rodzaju szale i chusty. Gdy dołączysz ją do drugiej włóczki, np wełny merino otrzymasz puszystą, bardzo ciepłą dzianinę, niezwykle miękka i delikatną. Tak powstają puszyste sweterki i ciepłe czapki, czy rękawiczki. Dla uzyskanie grubszej wersji można również przerabiać dzianinę podwójną nitką moherową.</p><p>Dodatek jedwabiu sprawia, że nitka pięknie błyszczy, a odcienie kolorystyczne są wielowymiarowe.</p><p>W 50 gramowych motkach znajdziecie aż 420 m niezwykle luksusowej nitki.</p><h3>Parametry włóczki Elinor :</h3><ul><li>Skład : 28% Jed...</li></ul>','\n                <p>Szare tło ocieplone dodatkiem różu i fioletu z nutą granatu</p><p>50g / 420m , skład : 72% fine Kid Mohair, 28% jedwab</p>\n            ','elinor-woollala-kidsilk-lace','','','','Elinor Woollala KidSilk Lace','','','',''),(96,1,1,'<h2>Włóczka ręcznie farbowana Szałwia KidSilk Lace od Woollala</h2><p>Niezwykle delikatna, puszysta i bardzo przyjemna w odbiorze włóczka moherowa z jedwabiem w autorskim farbowaniu Szałwia KidSilk Lace od Woollala. Stonowany, wielowymiarowy szałwiowy kolor, który przenika odcieniami zieleni.</p><p>Luksusowy skład włóczki – 72% Fine Kid Mohair i 28% jedwab – sprawia, że jest ona lekka niczym piórko. Idealnie sprawdzi się w dzierganiu wszelkiego rodzaju szali a także chust. Gdy dołączysz ją do drugiej włóczki, np. wełny merino otrzymasz puszystą, bardzo ciepłą dzianinę, niezwykle miękką i delikatną. Tak powstają puszyste sweterki, ciepłe czapki oraz rękawiczki. Dla uzyskanie grubszej wersji można również przerabiać dzianinę podwójną nitką moherową.</p><p>Dodatek jedwabiu sprawia, że nitka pięknie błyszczy a odcienie kolorystyczne są wielowymiarowe.</p><p>W 50 gramowych motkach znajdziecie aż 420 m niezwykle luksusowej nitki.</p><h3>Param...</h3>','\n                <p>Wielowymiarowy szałwiowy kolor, który przenika odcieniami zieleni.</p><p>50 g / 420 m</p><p>skład: 72% Fine Kid Mohair, 28% jedwab</p>\n            ','szalwia-woollala-kidsilk-lace','','','','Szałwia Woollala KidSilk Lace','','','',''),(97,1,1,'<h2>Włóczka ręcznie farbowana Patina Speckled KidSilk Lace Woollala</h2><p>Niezwykle delikatna, puszysta i bardzo przyjemna w odbiorze włóczka moherowa z jedwabiem w autorskim farbowaniu Patina Speckled KidSilk Lace od Woollala. Żywy, wielowymiarowy zielono-morski kolor, który przenika odcieniami zieleni, z wyraźnymi zielono-niebieskimi przetarciami.</p><p>Luksusowy skład włóczki – 72% Fine Kid Mohair i 28% jedwab – sprawia, że jest ona lekka niczym piórko. Idealnie sprawdzi się w dzierganiu wszelkiego rodzaju szali a także chust. Gdy dołączysz ją do drugiej włóczki, np. wełny merino otrzymasz puszystą, bardzo ciepłą dzianinę, niezwykle miękką i delikatną. Tak powstają puszyste sweterki, ciepłe czapki oraz rękawiczki. Dla uzyskanie grubszej wersji można również przerabiać dzianinę podwójną nitką moherową.</p><p>Dodatek jedwabiu sprawia, że nitka pięknie błyszczy a odcienie kolorystyczne są wielowymiarowe.</p><p>W 50 gramowych motkach zn...</p>','\n                <p>Wielowymiarowa patyna ozdobiona drobnymi kropkami i przetarciami w odcieniach zieleni i błekitu.</p><p>50 g / 420 m</p><p>skład: 72% Fine Kid Mohair, 28% jedwab</p>\n            ','patina-speckled-woollala-kidsilk-lace','','','','Patina Speckled Woollala KidSilk Lace','','','',''),(98,1,1,'<h2>Manada Pascuali luksusowa włóczka moherowa z jedwabiem</h2><p>Włóczka Manada łączy puszysty koźlęcy moher z kóz angorskich, lśniący jedwab morwowy, cenną wełnę yaka i certyfikowaną, organiczną wełnę merynosów w cienką przędzę z mocno skręconymi nitkami. Manada Pascuali posiada również wyważoną ilość włosa, który nie jest zbyt długi.</p><p>Ta wyjątkowa, luksusowa przędza jest przede wszystkim niezwykle miła w dotyku, delikatna niczym piórko. Manada jest idealnym wyborem, jeśli popularne włóczki typu kid-silk podrażniają Twoją skórę, to koniecznie musisz poczuć jej niezwykły jedwabisto – kaszmirowy dotyk.</p><p>Manada to bardzo uniwersalna, o szerokim zastosowaniu włóczka. Można ją przerabiać samodzielnie i w zależności od rozmiaru drutów uzyskać gęsty, ciepły lub lekki, zwiewny wzór ściegu. Można ją połączyć z inną włóczką marki Pascuali, jak <em><strong><a href=\"https://miedzydrutami.pl/pinta-pascuali-wloczka-welniana/\"></a></strong></em></p>','\n                <p>Luksusowe, miękkie jak piórko połączenie moheru, jedwabiu, wełny merino i yaka</p><p>25g / 200m, druty 2,5 – 4mm<br />\nSkład: 45% moher superkid, 25% jedwab morwowy, 15% organiczne merino, 15% yak</p>\n            ','manada-pascuali','','','','Manada Pascuali','','','',''),(99,1,1,'<h2>Zestaw włóczek na sweter</h2><p>Komplet zawiera włóczkę moherową z jedwabiem <em><strong><a href=\"https://miedzydrutami.pl/wloczka-tynn-silk-mohair/\" target=\"_blank\" rel=\"noreferrer noopener\">Tynn Silk Mohair</a></strong></em> marki <em><strong><a href=\"https://www.sandnes-garn.com/yarn\">Sandnes Garn</a></strong></em> i wełnę merino <a href=\"https://miedzydrutami.pl/harmony-lana-gatto-cienka-welna-merino/\" target=\"_blank\" rel=\"noreferrer noopener\"><em><strong>Harmony</strong></em></a> marki Lana Gatto w pasujących do siebie kolorach, przy czym zaznaczam że nie są one identyczne. Zestaw włóczek na sweter powstał z myślą ułatwienia doboru współgrających do siebie kolorów. Obie nitki łączymy i przerabiamy jednocześnie. Mieszanie moheru, jedwabiu i wełny tworzy delikatną, puszystą dzianinę. Takie połączenie gwarantuje <span>lekkość</span><span></span></p>','\n                <p>Zestaw włóczek do stworzenia delikatnego i lekkiego sweterka.</p><p>Zestaw zawiera 4 motki moheru z jedwabiem oraz 1 motek cieniutkiej wełny merino.</p>\n            ','tynn-silk-mohair-zestaw-wloczek-na-sweter','','','','Tynn Silk Mohair Zestaw włóczek na sweter','','','',''),(100,1,1,'<h2>Włóczka Tynn Silk Mohair Sandnes Garn</h2><p>Włóczka Tynn Silk Mohair to cienka włóczka moherowa z jedwabiem wzbogacona dodatkiem wełny. Taka mieszanka gwarantuje przede wszystkim lekkość, połysk i ciepło jednocześnie. Obniżona zawartość moheru w Tynn Silk Mohair daje nitkę z krótszym włosem, wskutek czego nie pozostawia tak dużej ilości „kłaczków” jak typowe kid-silk.</p><h2>Włóczka moherowa z jedwabiem</h2><p>Jest delikatna, lekka oraz przyjemna w dotyku. Idealna na przykład na lekkie puszyste sweterki, chusty czy szale. Ponadto świetnie sprawdza się jako dodatek do innej nitki, np cienkiej wełny czy jedwabiu. Dzięki wysokiej wydajności na sweterek w rozmiarze S/M zużyjemy tylko 4 motki, w rezultacie uzyskując lekką dzianinę o wadze zaledwie 100g.</p><p>Dla obszerniejszej wersji swetra, należy przyjąć dla rozmiaru M – 5 motków, a dla każdego kolejnego rozmiaru powiększyć ilość o 1 sztukę. Aby uzyskać grubszą dzianinę można przerab...</p>','\n                <p>Włóczka moherowa z jedwabiem z dodatkiem wełny.</p><p>25 g / 212 m, druty: 3,0 – 5,0 mm</p><p>skład: mohair 57%, jedwab 28%, wełna 15%</p>\n            ','wloczka-tynn-silk-mohair-sandnes-garn','','','','Włóczka Tynn Silk Mohair Sandnes Garn','','','',''),(101,1,1,'<h2>Włóczka Alpakka Silke</h2><p>Alpakka Silke Sandnes Garn to delikatne włókno, w którym zostały połączone dwie nici: baby alpaka oraz jedwab morwowy. Termin <em>baby alpaca</em> odnosi się do przędzy wykonanej z włókien alpak. Często można spotkać się z informacją, że jest to przędza pozyskiwana z młodych, rocznych alpak. Jednak określenie <em>baby alpaca</em> nie musi koniecznie oznaczać, że włóczka pochodzi od rocznych zwierząt. Terminem <em>baby</em> określa się także włókna o odpowiedniej średnicy – od 20 do 23 mikronów. Włókna alpaki są cienkie, wyjątkowo miękkie, lekkie i bardzo ciepłe. Alpakka Silke to przede wszystkim przędza z baby alpaki w połączeniu z gładkim jedwabiem. Gładkość i miękkość to nie jedyne cechy tej włóczki. To wyjątkowo delikatne i chłodne dla skóry włókno, jednocześnie posiadające dobre właściwości regulujące ciepło. Dodatkowo jedwab ma wyjątkową właściwość pochłaniania wilgoci. Włókno alpaki nie zawiera lan...</p>','\n                <p>Delikatna dla ciała, miękka przędza z alpaki oraz jedwabiu.</p><p>50 g / 200 m, druty 3,0 mm</p><p>70% baby alpaka, 30% jedwab morwowy</p>\n            ','alpakka-silke-sandnes-garn','','','','Alpakka Silke Sandnes Garn','','','',''),(102,1,1,'<h2>Włóczka Soft Fine Isager</h2><p>Soft Fine Isager składa się z 63% alpaki, 26% jedwabiu oraz 11% jaka. Ta wyjątkowa mieszanka włókien została nazwana <em>kaszmirem Isagera</em>. Aby uzyskać niezwykłą miękkość, a także lekkość zastosowano interesującą technikę produkcji przędzy. Podstawą włókna jest jedwabny rdzeń, na którym zostało osadzone włókno alpaki w postaci pętelkowego bouclé. Następnie aby uzyskać puszystość, włókno alpaki szczotkuje się.</p><p>Ze względu na sposób osadzenia włókna alpaki, miękkość i puszystość tę włóczkę można porównać do grubszej przędzy <a href=\"https://miedzydrutami.pl/eco-soft-isager/\" target=\"_blank\" rel=\"noreferrer noopener\"><em><strong>Eco Soft</strong></em></a> oraz jedwabnego moheru <a href=\"https://miedzydrutami.pl/isager-silk-mohair/\" target=\"_blank\" rel=\"noreferrer noopener\"><em><strong>Silk Mohair</strong></em></a>. Pomimo podobieństw jest to zupełnie inna włóczka, której przerabianie z pewnością przyniesie mnóstwo s...</p>','\n                <p>Delikatna mieszanka alpaki, jedwabiu i jaka.</p><p>25 g / 150 m, druty od 3,5 mm do 6,0 mm</p><p>63% alpaka, 26% jedwab, 11% jak</p>\n            ','soft-fine-isager','','','','Soft Fine Isager','','','',''),(103,1,1,'<h2>Włóczka Alpaca 2 Isager</h2><p>Alpaca 2 Isager to cienka, podwójnie skręcona przędza. Główną cechą tej włóczki jest miękkość dlatego świetnie sprawdzi się w dzianinach dla dzieci i osób, których skóra jest wrażliwa. Miękkość i delikatność tej włóczki wykorzystasz w projektach takich jak szaliki a także chusty. Jeśli chcesz wydziergać sweter lub kardigan to pamiętaj, że jest to wyjątkowo delikatna włóczka i w wersji solo będzie podatna na nadmierne użytkowanie. Dlatego najlepszym rozwiązaniem będzie połączenie tej wyjątkowej przędzy z inną włóczka.</p><p><span>Dobierając włóczkę towarzyszącą z oferty marki Isager będziesz mieć łatwiejszy wybór właściwego tonu kolorystycznego. Kieruj się przy wyborze numerem koloru.</span></p><p>W zależności od indywidualnych ustawień monitora, kolory mogą się nieznacznie różnić.</p><p>Więcej o tej włóczce dowiesz się <a></a></p>','\n                <p>Delikatna i wyjątkowo miękka włóczka z połączenia alpaki i wełny.</p><p>50 g / 250 m, druty 3,0 mm</p><p>50% alpaka, 50% wełna</p>\n            ','alpaca-2-isager','','','','Alpaca 2 Isager','','','',''),(104,1,1,'<h2>Kolorowa włóczka Poppy Sandnes Garn</h2><p>Włóczka Poppy Sandnes Garn to nowa odsłona włóczki <strong><em><a href=\"https://miedzydrutami.pl/kos-sandnes-garn/\" target=\"_blank\" rel=\"noreferrer noopener\">Kos</a></em></strong>. Połączone włókno alpaki i wełny wdmuchane w łańcuszkową osnowę z bawełny pima. Rezultatem jest miękka, niezwykle lekka i przewiewna przędza.</p><p>Uroku Poppy nadają wtrącanie kolorowych włókien, które w dzianinie dają efekt niewielkich plamek i kropek na jednolitym, jasnym tle.</p><p>Idealna włóczka na ciepłe, puszyste swetry, kardigany, kamizelki jak również na czapki czy szale. Poppy przeznaczona jest na grubsze druty, dając możliwość bardzo szybkiego ukończenia projektu.</p><p>Włóczkę Poppy można łączyć z <em><strong><a href=\"https://miedzydrutami.pl/wloczka-tynn-silk-mohair/\" target=\"_blank\" rel=\"noreferrer noopener\">Tynn Silk Mohair</a></strong></em> uzyskując jeszcze bardziej puszysta, a zarazem lekką dzianinę. W <strong><em></em></strong></p>','\n                <p>Lekka włóczka z alpaki, luźne włókno wdmuchane w osłonę.</p><p>50g / 110m, druty 5 – 5,5mm</p><p>50% alpaka superfine, 35% bawełna, 15% merino,</p>\n            ','poppy-sandnes-garn','','','','Poppy Sandnes Garn','','','',''),(105,1,1,'<h2>Alpaca 1 Isager cienka włóczka z alpaki</h2><p><span class=\"TextRun SCXW56033993 BCX0\" lang=\"da-dk\" xml:lang=\"da-dk\"><span class=\"NormalTextRun SCXW56033993 BCX0\">Włóczka Alpaca 1 Isager to ultra cienka, dwuwarstwowa włóczka wykonana w 100% z alpaki. Można używać tej włóczki pojedynczo do koronkowych dzianin, zwłaszcza na chust i szali, ale głównie przerabiamy ją z inną włóczką. </span></span></p><p><span class=\"TextRun SCXW56033993 BCX0\" lang=\"da-dk\" xml:lang=\"da-dk\"><span class=\"NormalTextRun SCXW56033993 BCX0\">Każda włóczka „skorzysta” na połączeniu z Alpaca 1, wełna owcza będzie miała rozluźniony ścieg, włóczki o nierównej powierzchni zostaną wygładzone, moher nabierze „ciężkości”. Reasumując cienka włóczka Alpaca 1 jest świetnym dodatkiem do każdego rodzaju włókna.  </span></span></p><p><span class=\"TextRun SCXW56033993 BCX0\" lang=\"da-dk\" xml:lang=\"da-dk\"><span></span></span></p>','\n                <p>cienka, koronkowa włóczka z alpaki</p><p>50g / 400m, druty 2,5 – 3,0mm</p><p>100% wełna z alpaki</p>\n            ','alpaca-1-isager','','','','Alpaca 1 Isager','','','',''),(106,1,1,'<h2>Alpaka w wersji Bouclé Isager</h2><p><span class=\"TextRun SCXW56033993 BCX0\" lang=\"da-dk\" xml:lang=\"da-dk\"><span class=\"NormalTextRun SCXW56033993 BCX0\">Fantazyjna włóczka Boucle Isager składa się w 100% z wełny alpaki, przez co jest bardzo delikatna, niezwykle miękka z pięknie podkreślonym, lekkim skrętem boucle.</span></span></p><p>Włóczka Bouclé najlepiej sprawdza się w połączeniu z innymi włóczkami, w szczególności gładkimi dając ekscytujący efekt. Przerabiana bez dodatków Isager Bouclé świetnie nadaje się do pasków lub jako wzór w żakardach. Nie zalecana do wzorów strukturalnych, ponieważ rozpoznanie wzoru przy takim charakterze włóczki będzie utrudnione.</p><p>Część kolorów we włóczce to naturalne, niebarwione okrywy alpak.</p><p>Przędzona i farbowana w Peru.</p><h3>Parametry włóczki Bouclé:</h3><ul><li>Skład: 100 % alpaka</li><li>Waga: 50g</li><li>Długość: 175m</li><li>Próbka producenta ściegiem gładkim: ...</li></ul>','\n                <p>delikatne, miękkie bouclé z wełny alpaki</p><p>50g / 175m, druty 3,0 – 4,0mm</p><p>100% alpaka</p>\n            ','boucle-isager','','','','Bouclé Isager','','','',''),(107,1,1,'<h2>Ręcznie farbowana włóczka Balayage Pascuali hand dye</h2><p>Balayage Pascuali hand dye jest wyjątkową włóczką, stworzona przy współpracy z projektantką Melanie Berg.  Powstaje z połączenia 80% białej i szarej baby alpaki oraz 20% białej organicznej wełny z merynosów. Stwarza więc to efekt przejścia kolorów w obrębie poszczególnych nici, a podczas barwienia można uzyskać bardzo naturalne akcenty. Rezultatem są motki włóczki z charakterystycznym efektem balayage, o wielowymiarowym efekcie koloru.</p><p>Balayage hand dye pięknie łączy się z jednokolorową wersją <strong><em><a href=\"https://miedzydrutami.pl/pascuali-wloczka-balayage/\" target=\"_blank\" rel=\"noreferrer noopener\">Balayage</a></em></strong> Pascuali tworząc spójną całość. Jest świetną włóczką na szale i chusty, ale oczywiście nadaje się również na inne projekty – swetry czy kardigany, jak rękawiczki czy czapki. <span></span></p>','\n                <p>Ręcznie farbowana włóczka z alpaki baby i wełny merino</p><p>50g / 175m, druty 3,25 – 3,5mm</p><p>skład : 80% alpaka baby, 20% wełna merino extrafine 21 mik</p>\n            ','balayage-pascuali-hand-dye','','','','Balayage Pascuali hand dye','','','',''),(108,1,1,'<h2>Puno Winikunka Pascuali inspiracja naturą</h2><p>Włóczka Puno Winikunka Pascuali to barwiona wersja włóczki <em><strong><a href=\"https://miedzydrutami.pl/pascuali-wloczka-puno/\" target=\"_blank\" rel=\"noreferrer noopener\">Puno</a></strong></em>, której kolory inspirowane są górą Winikunka w peruwiańskich Andach. Cudownie miękka mieszanka bawełny i wełny z alpaki z certyfikatem GOTS. Oba surowce pochodzą z Peru, gdzie również powstaje ta niezwykła włóczka.</p><p>Mieszanka gładkiej bawełny z puszystą wełną z alpaki sprawia, że ​​Puno Winikunka jest świetną całoroczną włóczką, która nadaje się do robienia na drutach, jak i szydełkowania. Nadaje się zarówno do lekkich topów, bluzeczek czy lekkich sweterków jak i akcesoriów, takich jak szale czy szale. Jest przyjemnie miękka i delikatna więc można ją nosić bezpośrednio na skórze.</p><p>Można łączyć ją z włóczkami <strong><em><a href=\"https://miedzydrutami.pl/pascuali-wloczka-alpaca-lace/\"></a></em></strong></p>','\n                <p>Miękką włóczka całoroczna z bawełny organicznej i alpaki</p><p>50g / 200m, druty 2,5 – 3mm<br />\nskład : 70% bawełna organiczna, 30% alpaka</p>\n            ','puno-winikunka-pascuali','','','','Puno Winikunka Pascuali','','','',''),(109,1,1,'<h2>Teddy B Laines Du Nord włóczka boucle</h2><p>Fantazyjna włóczka boucle Teddy B od Laines du Nord to połączenie alpaki i wełny merino z niewielkim dodatkiem poliamidu. Dzięki niej uzyskasz w dzianinie niezwykle oryginalny charakter.</p><p>Świetna na swetry, krótkie kurteczki typu<b> chanell</b>, czapki czy szaliki. Ciepła oraz bardzo miła w dotyku.</p><h4>Parametry włóczki Teddy B:</h4><ul><li>Skład : 75% Alpaka, 10% Wełna, 15% Poliamid</li><li>Waga : 50g</li><li>Długość : 120m</li><li>Zalecane druty : 4 – 4,5mm</li><li>Próbka wg producenta 17 oczek x 19 rzędów = 10 cm x 10 cm</li><li>Na sweter w rozmiarze M potrzebne jest ok 8 motków</li></ul><p>Kraj produkcji : Włochy</p><p><b>Konserwacja</b> : zalecane pranie ręczne w płynach jak np <em><strong><a href=\"https://miedzydrutami.pl/soak-plyn-do-prania-delikatnych-rzeczy/\" target=\"_blank\" rel=\"noreferrer noopener\">Soak</a></strong></em> , do delikatnych rzeczy, skomponowany z roślinnych składnikó...</p>','\n                <p>Fantazyjna włóczka typu boucle</p><p>50g / 120m, druty 4 – 4,5mm<br />\nskład : 75% Alpaka, 10% Wełna, 15% Poliamid</p>\n            ','teddy-b-wloczka-boucle','','','','Teddy B włóczka boucle','','','',''),(110,1,1,'<h2>Włóczka Eco Soft Isager</h2><p>Eco Soft Isager składa się z 56% Baby Alpaca i 44% organicznej bawełny Pima. Dzięki takiemu połączeniu przędza jest miękka oraz oddychająca. Lekkość i miękkość tej przędzy zawdzięczamy także jej niezwykłej strukturze. W bawełnianą osłonę wdmuchuje się włókna alpaki dlatego to świetny zamiennik dla osób o wrażliwej skórze, alergików a także małych dzieci.</p><p>Eco Soft stanowi świetny zamiennik włóczki moherowej dlatego możesz wykorzystać tę przędzę jako dodatkową nić w robótce i stworzyć niezwykle puchatą dzianinę. To idealna włóczka do projektów noszonych blisko skóry, takich jak swetry, czapki, rękawiczki oraz szale.</p><p><strong>Włóczki z brązową banderolą to naturalne, niebarwione kolory alpaki. </strong></p><p><strong>Włóczki z czarną banderolą oznaczają farbowanie.</strong></p><h3>Parametry włóczki Eco Soft:</h3><ul><li>Skład: 56% alpaka baby, 44% bawełna pima</li><li>Waga: 50 g</li><li>Długość...</li></ul>','\n                <p>Delikatna włóczka o luźnym włóknie w bawełnianej osłonie.</p><p>50 g / 125 m, druty 3,5 mm</p><p>56% alpaka baby, 44% organiczna bawełna pima</p>\n            ','eco-soft-isager','','','','Eco Soft Isager','','','',''),(111,1,1,'<h2>Włóczka Eco Baby Isager</h2><p>Eco Baby Isager składa się z 68% Baby Alpaca i 32% organicznej bawełny Pima. To niezwykłe połączenie włókien o najwyższej jakości.</p><p>Kolory są naturalnymi efektami uzyskanymi z runa alpaki, co oznacza że  włóczka jest niebarwiona środkiem chemicznym. Co czyni z niej świetną propozycję dla alergików, osób o wrażliwej skórze oraz małych dzieci.</p><p>Włóczka posiada strukturę łańcuszka, dzięki czemu dzianiny z niej wykonane będą niezwykle lekkie a jednocześnie zyskają mięsisty wyraz.</p><p> </p><h3>Parametry włóczki Eko Baby:</h3><ul><li>Skład : 68% alpaka baby, 32% bawełna pima</li><li>Waga : 50g</li><li>Długość : 150m</li><li>Zalecane druty : 3,5mm, Próbka producenta ściegiem gładkim:  22 oczka x 30 rzędów</li><li>Zużycie sweter rozmiar M – ok 10 -11 motków</li></ul><h4>Parametry przy łączeniu Eco Baby z innymi produktami Isager</h4><ul><li>Eco Baby + Alpaca 1: druty 3,5mm, próbka 20 oczek x 29 rzę...</li></ul>','\n                <p>Delikatna włóczka o strukturze łańcuszka</p><p>50g / 150m, druty 3,5mm</p><p>68 % alpaka baby , 32% organiczna bawełna pima</p><p> </p>\n            ','eco-baby-isager','','','','Eco Baby Isager','','','',''),(112,1,1,'<h2>Babylpaca Los Andes Pascuali włóczka alpaka baby</h2><p>Babyalpaca Los Andes to cudownie miękka, gruba włóczka wykonana z czystej wełny alpaki hodowanej na wyżynach Andów w Peru. To 100% alpaka baby z runa młodych zwierząt, dzięki czemu jest niezwykle delikatna z najwyższą jakością włókna. Babyalpaca Los Andes Pascuali jest włóczką nie poddaną farbowaniu, a jej kolory pochodzą od naturalnej barwy alpak.</p><p>Babyalpaca Los Andes jest włóczką dwunitkową. Daje bardzo równą strukturę ściegów o różnym charakterze. Pięknie wyglądać będzie we wzorach warkoczowych, ale sprawdzi się świetnie również we wzorach gładkich, przerabianych jerseyem. Podobnie jak wszystkie włóczki z alpaki od Pascuali, Los Andes jest bardzo wytrzymała pomimo swojej wyjątkowej miękkości.</p><p>Idealnie nadaje się na ciepłe swetry i kurtki, a także na dodatki takie jak szaliki czy czapki. Jest przytulna i ciepła, a jednocześnie mimo swojej grubości bardzo lekka i m...</p>','\n                <p>Gruba włóczka z alpaki baby, niebarwiona, naturalny kolor alpaki</p><p>100g / 100m, skład 100% alpaka baby</p><p>druty – 6mm</p>\n            ','babyalpaca-los-andes-pascuali','','','','Babyalpaca Los Andes Pascuali','','','',''),(113,1,1,'<h2>Włóczka naturalna niebarwiona Puno Pascuali</h2><p>Włóczka Puno Pascuali to cudownie miękka mieszanka bawełny z certyfikatem GOTS i wełny alpaki. Oba surowce pochodzą z Peru, gdzie również powstaje ta niezwykła włóczka.</p><p>Życzeniem Pascuali było stworzenie przędzy bawełnianej w różnych odcieniach bez konieczności barwienia włókna. Dzięki połączeniu z naturalnymi kolorami alpak udało nam się stworzyć paletę w pięknych, subtelnych naturalnych odcieniach.</p><p>Mieszanka gładkiej bawełny z puszystą wełną z alpaki sprawia, że ​​Puno jest świetną całoroczną włóczką, która nadaje się do robienia na drutach, jak i szydełkowania. Puno nadaje się zarówno do lekkich topów, bluzeczek czy lekkich sweterków jak i akcesoriów, takich jak szale czy szale. Jest przyjemnie miękka i delikatna więc można ją nosić bezpośrednio na skórze.</p><h3>Parametry włóczki Puno :</h3><ul><li>Skład : 70% bawełna organiczna, 30% alpaka</li><li>Waga : 50g</li></ul>','\n                <p>Naturalna, niebarwiona włóczka z bawełny organicznej i alpaki</p><p>50g / 200m, druty 2,5 – 3mm<br />\nskład : 70% bawełna organiczna, 30% alpaka</p>\n            ','puno-pascuali','','','','Puno Pascuali','','','',''),(114,1,1,'<h2>Kos Sandnes Garn</h2><p>Włóczka Kos Sandnes Garn to połączone włókno alpaki i wełny wdmuchane w osnowę nylonową o strukturze łańcuszka. Rezultatem jest miękka, niezwykle lekka i przewiewna przędza o rozmytej fakturze. Kolory są lekko przymglone, a cześć z nich posiada melanżowe wykończenie.<br />\nIdealna włóczka na ciepłe, puszyste swetry, kardigany, kamizelki jak również na czapki czy szale. Kos przeznaczona jest na grubsze druty, dając możliwość bardzo szybkiego ukończenia projektu. Surowiec użyty do produkcji tej włóczki pochodzi z Peru i Urugwaju</p><p>Włóczkę Kos można łączyć z <em><strong><a href=\"https://miedzydrutami.pl/wloczka-tynn-silk-mohair/\" target=\"_blank\" rel=\"noreferrer noopener\">Tynn Silk Mohair</a></strong></em> uzyskując jeszcze bardziej puszysta, a zarazem lekką dzianinę. W <strong><em><a href=\"https://miedzydrutami.pl/sklep/?product_cat=czasopisma\" target=\"_blank\" rel=\"noreferrer noopener\">czasopismach</a></em></strong> Sandnes Garn mo...</p>','\n                <p>Lekka włóczka z alpaki, luźne włókno wdmuchane w osłonę</p><p>50g / 150m, 62% alpaka, 9% wełna, 29% nylon, druty 5 – 5,5mm</p>\n            ','kos-sandnes-garn','','','','Kos Sandnes Garn','','','',''),(115,1,1,'<h2>Włóczka Alpakka Folgetrad</h2><p>Sandnes Garn zaproponował włóczkę Alpakka Folgetrad przede wszystkim dla tych osób, które nie tolerują włóczek moherowych lub nie są ich miłośnikiem, a mimo wszystko chciałyby tworzyć puszyste dzianiny. Ta cieniutka włóczka w szczególności polecana do robienia na drutach wraz z inną włóczką np z wełną owczą lub mieszanką wełna / alpaka. Miękka i bardzo przyjemna w odbiorze. Posiada lekki, charakterystyczny dla alpaki włosek, co w odbiorze bardzo przypomina włóczkę moherową.</p><h3>Jakie dzianiny z włóczki Alpakka Folgetrad?</h3><p>Z połączenia dowolnej wełny i Alpakki Folgetrad można wykonać każdy rodzaj dzianiny, od swetrów po mitenki. Będą one posiadać charakterystyczny włosek alpaki, a w odbiorze będą ciepłe i przyjemnie miękkie. Możemy łączyć włóczki w podobnym tonie kolorystycznym lub w kontraście, aby uzyskać efekt melanżu</p><p>Producent nie podaje rozmiaru drutów do tej włóczki, ponieważ ich ...</p>','\n                <p>Cienka włóczka z alpaki</p><p>świetna alternatywa dla osób nie lubiących włóczek moherowych<br />\n50g / 400m, alpaka 100%</p>\n            ','alpakka-folgetrad-sandnes-garn','','','','Alpakka Folgetrad Sandnes Garn','','','',''),(116,1,1,'<h2>Alpakka Ull Sandnes Garn</h2><p>Włóczka Alpakka Ull Sandnes Garn łączy w sobie dwa włókna alpakę i wełnę. To połączenie daje nam wyjątkowe ciepło alpaki oraz elastyczność i sprężystość wełny owczej. Może być użyta do każdego rodzaju dzianiny jesienno – zimowej od swetrów, chust, szalików, po czapki a nawet grube rękawiczki.</p><p>W propozycji projektów PatiteKnit w oparciu o włóczkę AlpakkUll znalazł się <strong><em><a href=\"https://www.petiteknit.com/collections/engelske-opskrifter-tilbehor/products/sophie-shawl-5?variant=39977592946743\" target=\"_blank\" rel=\"noreferrer noopener\">Sophie Sawl</a></em></strong>, klasyczny szal w nowoczesnej odsłonie. Projekt rozpisany jest na 3 rozmiary, także można wielkość dopasować do swoich preferencji. Ilość włóczki Alpakka Ull potrzebnej do wykonania szala w zależności od rozmiaru to 3 – 6 motków</p><h2>Parametry Alpakka Ull Sandnes Garn:</h2><ul><li>Skład : 65% alpaka, 35% wełna</li><li>Waga : 50g</li></ul>','\n                <p>50g / 100m, 65% alpaka 35% wełna, druty 5mm</p>\n            ','alpakka-ull-sandnes-garn','','','','Alpakka Ull Sandnes Garn','','','',''),(117,1,1,'<h2>Alpakka Borstet Sandnes Garn</h2><p>Włóczka Alpakka Borstet Sandnes Garn to szczotkowane włókno alpaki, skręcone mocną nylonową przędzą. Rezultatem jest miękka, niezwykle lekka i przewiewna przędza o rozmytej fakturze.<br />\nIdealna włóczka na ciepłe, puszyste swetry, kardigany, kamizelki jak również na czapki czy szale. Alpakka Borstet przeznaczona jest na grube druty, dając możliwość bardzo szybkiego ukończenia projektu. Surowiec użyty do produkcji tej włóczki pochodzi z Peru</p><p>Alpakkę Borstet można łączyć z inną gładką włóczką jak <em><strong><a href=\"https://miedzydrutami.pl/wloczka-tynn-peer-gynt/\" target=\"_blank\" rel=\"noreferrer noopener\">Tynn Peer Gynt</a></strong></em> lub <strong><em><a href=\"https://miedzydrutami.pl/peer-gynt-sandnes-garn/\">Peer Gynt</a></em></strong>, w zależności jak grubą dzianinę chcemy uzyskać. Oryginalny efekt melanżu otrzymamy przy połączeniu włóczek o kontrastowych kolorach.</p><h2>Alpakka Borstet zalety wł...</h2>','\n                <p>Puszysta włóczka ze szczotkowanej alpaki</p><p>50g / 110m , skład : 96% alpaka, 4% nylon, druty 5-7mm</p>\n            ','alpakka-borstet-sandnes-garn','','','','Alpakka Borstet Sandnes Garn','','','',''),(118,1,1,'<h2>Alpaca Lace Pascuali koronkowa alpaka baby</h2><p>Alpaca Lace Pascuali to luksusowa, cudownie miękka, delikatna, a zarazem mocna włóczka wykonana z czystej wełny alpaki. Koronkowa Alpaca Lace to cienka włóczka skręcona z dwóch nitek. Posiada charakterystyczny włosek alpaki, który jest odporny na mechacenie. To bardzo lekka włóczka, idealna do wszelkiego rodzaju wzorów ażurowych.</p><p>Alpaca Lace składa się w 100% z runa młodych zwierząt (baby), dzięki czemu jest niezwykle delikatna z najwyższą jakością włókna. Pochodzi ono z pierwszego strzyżenia młodych zwierząt hodowanych na andyjskich wyżynach w Peru. Gdzie nasza włóczka została również ufarbowana i zwinięta w motki. W<span> ofercie są stonowane odcienie jak również piękna gama kolorów.</span></p><p>Alpaca Lace idealnie nadaje się do lekkich topów z delikatnym koronkowym wzorem jak również na dodatk...</p>','\n                <p>delikatna, koronkowa alpaka baby</p><p>50g / 400m, skład : 100% alpaka baby</p>\n            ','alpaca-lace-pascuali','','','','Alpaca Lace Pascuali','','','',''),(119,1,1,'<h2>Alpaca Fino Pascuali włóczka alpaka baby</h2><p>Alpaca Fino to cudownie miękka włóczka wykonana z czystej wełny alpaki hodowanej na wyżynach Andów w Peru. To 100% alpaka baby z runa młodych zwierząt, dzięki czemu jest niezwykle delikatna z najwyższą jakością włókna. Alpaca Fino Pascuali dostępna jest w wielu odcieniach, od naturalnej bieli do delikatnego różu i od jasnożółtego do ciemnoszarego.</p><p>Alpaca Fino Pascuali jest włóczką czterowarstwowa (4PL) o grubości DK. Przędza Alpaka Fino daje bardzo równomierną strukturę oczek z charakterystycznym puszkiem alpaki. Idealnie nadaje się do wszelkiego rodzaju wzorów, ale również wygląda bardzo ładnie po prostu dziergana dżersejem. Jak wszystkie przędze alpaki, Alpaca Fino jest bardzo wytrzymała pomimo swojej miękkości. Ubrania zachowują swój kształt i formę, ponadto przędza prawie się nie mechaci.</p><p>Alpaca Fino idealnie nadaje się na ciepłe swetry czy kardigany, ale można z niej w...</p>','\n                <p>Najdelikatniejsze włóczko alpaki baby</p><p>50g / 100m, druty 4mm</p><p>skład : 100% alpaka baby</p>\n            ','alpaca-fino-pascuali','','','','Alpaca Fino Pascuali','','','',''),(120,1,1,'<h2>Balayage Pascuali włóczka alpaka z wełną merino</h2><p>Balayage Pascuali jest wyjątkową włóczką o wysokiej jakości surowca,  która powstaje z połączenia 80% białej i szarej baby alpaki oraz 20% białej organicznej wełny z merynosów. Stwarza więc to efekt przejścia kolorów w obrębie poszczególnych nici, a podczas barwienia można uzyskać bardzo naturalne akcenty – podobne do tych przy farbowaniu ręcznym. Rezultatem są motki włóczki z charakterystycznym efektem balayage, gdzie kolor nie wydaje się „płaski”</p><p>Balayage jest świetną włóczką na szale i chusty, ale oczywiście nadaje się również na inne projekty – swetry czy kardigany, jak rękawiczki czy czapki. <span>Jest przędzą niezwykle miękką i delikatną w wersji 2 Ply, także to będzie idealny wybór na wyroby dla małych dzieci i dzianin noszonych bezpośrednio przy ciele.</span></p><p>Ponieważ alpaka nie ...</p>','\n                <p>50g / 175m, druty 3,25 – 3,5mm</p><p>skład : 80% alpaka baby, 20% wełna merino extrafine 21 mik</p>\n            ','balayage-pascuali','','','','Balayage Pascuali','','','',''),(121,1,1,'<h2>Pinta Pascuali ręcznie barwiona roślinami włóczka wełniana 50 g</h2><p>Pinta ręcznie farbowana roślinami włóczka to wyjątkowa propozycja w sklepie Między Drutami. Jako kompozycja naturalnych składników to nie tylko przędza najwyższej jakości, lecz także nić, która dostarczy Ci wspaniałych wrażeń estetycznych. Zarówno w trakcie dziergania, jak i noszenia gotowej dzianiny.</p><p>Ta wyjątkowa włóczka o wszechstronnym zastosowaniu już teraz dostępna jest w naszym sklepie w nowej odsłonie kolorystycznej! Pokolorowana naturą przez polską barwiarkę, która stworzyła markę <a href=\"https://www.instagram.com/meadow.art.yarn/\" target=\"_blank\" rel=\"noreferrer noopener\"><em><strong>Meadow Art Yarn</strong></em></a>. Do naturalnego barwienia przędzy roślinami zostały użyte m.in. następujące rośliny: <strong><span style=\"color:#cd94e0;\">modrzejec kempechiański</span></strong> dający fioletowy lub niebieski odcień, <strong><span style=\"color:#f27474;\">brezy...</span></strong></p>','\n                <p>Włóczka wełniana z dodatkiem jedwabiu i ramii – ręcznie barwiona roślinami.</p><p>50 g / 212 m, druty 3,0 mm</p><p>skład: 60% wełna merino, 20% jedwab, 20% ramia</p>\n            ','pascuali-pinta-recznie-farbowana-roslinami-50-g','','','','Pascuali Pinta ręcznie farbowana roślinami 50 g','','','',''),(122,1,1,'<h2>Velvet Lace włóczka z wełną i jedwabiem ręcznie farbowana</h2><p>Velvet Lace to wyjątkowa włóczka skręcona z nici z wełny merynosów i jedwabiu morwowego. Farbowana w Polsce na specjalne życzenie sklepu Między Drutami, tak aby móc łączyć ją z jedwabnym <a href=\"https://miedzydrutami.pl/mohair-bliss-pascuali/\" target=\"_blank\" rel=\"noreferrer noopener\"><em><strong>moherem Bliss</strong></em></a> marki <a href=\"https://www.pascuali.de/en\" target=\"_blank\" rel=\"noreferrer noopener\"><em><strong>Pascuali</strong></em></a>. Włóczka ta jest dostępna w 100 g preclach o długości 600 metrów, co czyni ją idealną do tworzenia delikatnych, luksusowych dzianin na drutach. Dodatek jedwabiu nadaje włóczce subtelny połysk i niezwykłą miękkość, podkreślając jej wyjątkowy charakter. W połączeniu z moherem Bliss marki Pascuali, Velvet tworzy idealną kompozycję pod względem jakości, a także połączenia kolorystycznego. Z tej włóczki wydziergasz eleganckie, ponadczasowe dzianiny,...</p>','\n                <p>Ręcznie farbowana włóczka wełniana z jedwabiem. Idealna do łączenia z najwyższej jakości moherem Bliss marki Pascuali.</p><p>100 g / 600 m</p><p>skład: 50% wełna merino, 50% jedwab</p><hr /><p><span style=\"color:#339966;\">Nazwy kolorów włóczki Velvet Lace to numery kolorów <a style=\"color:#339966;\" href=\"https://miedzydrutami.pl/mohair-bliss-pascuali/\" target=\"_blank\" rel=\"noreferrer noopener\"><em><strong>Mohair Bliss</strong></em></a> marki Pascuali. Dzięki temu nie musisz się zastanawiać, który kolor moheru Bliss dopasować do włóczki Vevet tak, aby kolor był jak najbardziej jednolity.</span></p>\n            ','velvet-lace','','','','VELVET Lace','','','',''),(123,1,1,'<h2>Włóczka ręcznie farbowana Żonkile Sock 100 od Woollala</h2><p>To przyjemna w odbiorze włóczka z wełny merynosów z dodatkiem nylonu w autorskim farbowaniu Żonkile Sock 100 od Woollala. Wielowymiarowy kolor soczyście żółtych kwiatów, farbowanie jednokolorowe, bez przetarć i kropkowań.</p><p>Sock Merino, to włóczka z wełny merynosów z dodatkiem nylonu który sprawia, że nitka jest wytrzymalsza i trudniej ją zerwać, przy czym jednocześnie włóczka nie traci na swojej miękkości. Jest to doskonała propozycja na skarpetki, ale nie tylko. Z tej włóczki stworzysz zwiewne szale, mocne rękawiczki, wytrzymalsze sweterki.