az zieleni, farbowanie jednokolorowe, bez przetarć i kropkowań.</p><p>100 g / 420 m</p><p>skład: 75% merino, 25% nylon</p>\n            ','zlocista-gruszka-woollala-sock-100','','','','Złocista Gruszka Woollala Sock 100','','','',''),(133,1,1,'<h2>Włóczka ręcznie farbowana Złocista Gruszka Pure Silk 100 od Woollala</h2><p>To przyjemna w odbiorze włóczka w 100% jedwabiu morwowego w autorskim farbowaniu Złocista Gruszka Pure Silk 100 od Woollala. Wielowymiarowy kolor dojrzałej gruszki, z nutą ciepłego, złotego odcienia dojrzewającej żółci oraz zieleni, farbowanie jednokolorowe, bez przetarć i kropkowań.</p><p>Pure Silk 100 to włóczka z jedwabiu morwowego najwyższej jakości o szlachetnym połysku. W odbiorze jest przyjemnie miękka, chłodna, lejąca, nie sprawia żadnego dyskomfortu w kontakcie ze skórą – idealna dla osób wrażliwych. Z tej włóczki stworzysz ubrania na lato: bluzki, koszulki, sukienki. Poleca się również na odzież całoroczną i projekty, które nosi się blisko szyi: apaszki, chustki, zwiewne szale.</p><p>Ta luksusowa jedwabna nić, w porównaniu do jedwabiu Pure Silk Lace 600, jest grubsza, ponieważ została skręcona z 4 nitek. Dzięki temu jest też mocniejsza.</p><h3>Para...</h3>','\n                <p>Wielowymiarowy kolor dojrzałej gruszki, z nutą ciepłego, złotego odcienia dojrzewającej żółci oraz zieleni, farbowanie jednokolorowe, bez przetarć i kropkowań.</p><p>100 g / 400 m</p><p>skład: 100% jedwab morwowy</p>\n            ','zlocista-gruszka-woollala-pure-silk-100','','','','Złocista Gruszka Woollala Pure Silk 100','','','',''),(134,1,1,'<h2>Short Rainbow Comfy Merino włóczka ręcznie farbowana</h2><p>Short Rainbow Comfy Merino to wyjątkowe farbowanie na jednolitej bazie w kolorze granatowym, szmaragdowym, antracytowym, a także jasnym szarym. Krótkie, neonowe i wyraziste przejścia kolorystyczne gwarantują wspaniałą zabawę podczas tworzenia dzianiny. Dzięki tej włóczce stworzysz unikalny i niepowtarzalny wzór na swoim swetrze lub chuście. Aby uzyskać efekt krótkich przejść kolorystycznych nasze włóczki zostały zafarbowane znaną w świecie barwiarskim techniką <em>krótkiego gradientu</em>.</p><p><em>Krótki gradient</em> to technika farbowania włóczki, w której kolory zmieniają się szybko i płynnie na krótkich odcinkach nitki. Efekt ten jest bardzo popularny w społeczności dziewiarskiej, ponieważ pozwala na tworzenie unikalnych i żywych wzorów w gotowych dzianinach. Dlatego głównym atutem włóczek farbowanych ręcznie jest ich piękno i niepowtarzalność.</p><p>Ze względu na swó...</p>','\n                <p>Włóczka farbowana techniką krótkiego gradientu, która zaskoczy Cię neonowymi przejściami kolorystycznymi.</p><p>100 g / 400 m</p><p>druty: 2,5 – 3,5 mm</p><p>skład: 100% wełna merino SW</p>\n            ','short-rainbow-comfy-merino','','','','Short Rainbow Comfy Merino','','','',''),(135,1,1,'<h2>Pinta Pascuali ręcznie barwiona włóczka wełniana</h2><p>Pinta Pascuali ręcznie barwiona w Niemczech to nowa propozycja wyjątkowej włóczki o wszechstronnym zastosowaniu. Dobrze znana i lubiana Pinta w nowej odsłonie – barwiona ręcznie. Pinta ręcznie farbowana zaprojektowana jako uzupełnienie gamy kolorystycznej przędz jednobarwnych. Niezależnie od tego, czy połączysz tę włóczkę z inną nicią, czy stworzysz dzianinę pojedynczą nicią, ta przędza dostarczy Ci wspaniałych wrażeń estetycznych!</p><p>To wyjątkowa włóczka o wszechstronnym zastosowaniu. Można z niej tworzyć na drutach szeroką gamę ubrań i akcesoriów, takich jak swetry, szale, chusty czy skarpetki. Włóczka wełniana Pinta Pascuali ręcznie barwiona wyróżnia się na tle innych włóczek wyjątkowym składem włókien: 60% Merino, 20% Jedwab i 20% Ramia, a także przemyślanym doborem barwników by stworzyć wyjątkową gamę kolorystyczną. Wełna z merynosów pochodzi z Patagonii, która jest wol...</p>','\n                <p>Włóczka wełniana z dodatkiem jedwabiu i ramii – ręcznie barwiona.</p><p>50 g / 212 m, druty 3,0 mm</p><p>s<span>kład: 60% wełna merino, 20% jedwab, 20% ramia</span></p>\n            ','pascuali-pinta-recznie-farbowana','','','','Pascuali Pinta ręcznie farbowana','','','',''),(136,1,1,'<h2>Włóczka ręcznie farbowana Fuksja Pure Silk Lace 600 od Woollala</h2><p>To przyjemna w odbiorze włóczka w 100% jedwabiu morwowego w autorskim farbowaniu Fuksja Pure Silk Lace 600 od Woollala. Wielowymiarowy, intensywny kolor różu, farbowanie jednokolorowe, bez przetarć i kropkowań.</p><p>Pure Silk Lace, to włóczka z jedwabiu morwowego najwyższej jakości o szlachetnym połysku. W odbiorze jest przyjemnie miękka, chłodna, lejąca, nie sprawia żadnego dyskomfortu w kontakcie ze skórą – idealna dla osób wrażliwych. Z tej włóczki stworzysz ubrania na lato: bluzki, koszulki, sukienki. Poleca się również na odzież całoroczną i projekty, które nosi się blisko szyi: apaszki, chustki, zwiewne szale.</p><p>Kolekcja Pure Silk Lace Woollala dostępna w naszym sklepie powstała na specjalne zamówienie, a kolory zostały dopasowane, tak by pięknie komponowały się z delikatnym moherem <a href=\"https://miedzydrutami.pl/mohair-bliss-pascuali/\"></a></p>','\n                <p>Wielowymiarowy kolor intensywnego różu, farbowanie jednokolorowe, bez przetarć i kropkowań.</p><p>100 g / 600 m</p><p>skład: 100% jedwab morwowy</p>\n            ','fuksja-woollala-pure-silk-lace-600','','','','Fuksja Woollala Pure Silk Lace 600','','','',''),(137,1,1,'<h2>Włóczka ręcznie farbowana Emma Speckled Pure Silk 100 od Woollala</h2><p>To przyjemna w odbiorze włóczka w 100% jedwabiu morwowego w autorskim farbowaniu Emma Speckled Pure Silk 100 od Woollala. Wielowymiarowy kolor soczystego różu, widoczne kolorowe akcenty w postaci przetarć i kropkowań w kolorach ciemnego różu, pomarańczy, a nawet fioletu.</p><p>Pure Silk 100 to włóczka z jedwabiu morwowego najwyższej jakości o szlachetnym połysku. W odbiorze jest przyjemnie miękka, chłodna, lejąca, nie sprawia żadnego dyskomfortu w kontakcie ze skórą – idealna dla osób wrażliwych. Z tej włóczki stworzysz ubrania na lato: bluzki, koszulki, sukienki. Poleca się również na odzież całoroczną i projekty, które nosi się blisko szyi: apaszki, chustki, zwiewne szale.</p><p>Ta luksusowa jedwabna nić, w porównaniu do jedwabiu Pure Silk Lace 600, jest grubsza, ponieważ została skręcona z 4 nitek. Dzięki temu jest też mocniejsza.</p><h3>Parametry włóczki Em...</h3>','\n                <p>Wielowymiarowy kolor różu, farbowanie z delikatnym kropkowaniem w kolorach pomarańczy, różu a nawet fioletu.</p><p><span>100 g / 400 m</span></p><p>skład: 100% jedwab morwowy</p>\n            ','emma-speckled-woollala-pure-silk-100','','','','Emma Speckled Woollala Pure Silk 100','','','',''),(138,1,1,'<h2>Włóczka ręcznie farbowana Enjoy Your Life Pure Silk 100 od Woollala</h2><p>To przyjemna w odbiorze włóczka w 100% jedwabiu morwowego w autorskim farbowaniu Enjoy Your Life Pure Silk 100 od Woollala. Wielowymiarowy mix pastelowych kolorów, które przenikają się wzajemnie tworząc przyjemny dla oka, delikatny, pastelowy pejzaż. Widoczne odcienie jasnego różu, błękitu, zieleni, fioletu, a także mocniejsze, kropkowane akcenty kolorystyczne.</p><p>Pure Silk 100 to włóczka z jedwabiu morwowego najwyższej jakości o szlachetnym połysku. W odbiorze jest przyjemnie miękka, chłodna, lejąca, nie sprawia żadnego dyskomfortu w kontakcie ze skórą – idealna dla osób wrażliwych. Z tej włóczki stworzysz ubrania na lato: bluzki, koszulki, sukienki. Poleca się również na odzież całoroczną i projekty, które nosi się blisko szyi: apaszki, chustki, zwiewne szale.</p><p>Ta luksusowa jedwabna nić, w porównaniu do jedwabiu Pure Silk Lace 600, jest grubsza, pon...</p>','\n                <p>Wielowymiarowy mix kolorów, które przenikają się wzajemnie tworząc przyjemny dla oka, delikatny, pastelowy pejzaż.</p><p><span>100 g / 400 m</span></p><p>skład: 100% jedwab morwowy</p>\n            ','enjoy-your-life-woollala-pure-silk-100','','','','Enjoy Your Life Woollala Pure Silk 100','','','',''),(139,1,1,'<h2>Włóczka ręcznie farbowana Denim Pure Silk 100 od Woollal