</p><p>100 g / 420 m</p><p>skład: 75% merino, 25% nylon</p>\n            ','secret-woollala-sock-100','','','','Secret Woollala Sock 100','','','',''),(161,1,1,'<h2>Włóczka ręcznie farbowana Georgina Speckled Sock 100 od Woollala</h2><p>To przyjemna w odbiorze włóczka z wełny merynosów z dodatkiem nylonu w autorskim farbowaniu Georgina Speckled Sock 100 od Woollala. Całość utrzymana w odcieniu jasnej, różowej brzoskwini z delikatnymi przetarciami w jasnym kolorze oraz subtelnym kropkowaniem w jasnych odcieniach pomarańczy i żółtego.</p><p>Sock Merino, to włóczka z wełny merynosów z dodatkiem nylonu który sprawia, że nitka jest wytrzymalsza i trudniej ją zerwać, przy czym jednocześnie włóczka nie traci na swojej miękkości. Jest to doskonała propozycja na skarpetki, ale nie tylko. Z tej włóczki stworzysz zwiewne szale, mocne rękawiczki, wytrzymalsze sweterki.</p><h3>Parametry włóczki Georgina Speckled:</h3><ul><li>Skład: 75% wełna merino superwash, 25% Nylon</li><li>Waga: 100 g</li><li>Długość: 425 m</li><li>Sugerowane druty: 2,5 – 3,75 mm – zobacz nasze <em><strong><a></a></strong></em></li></ul>','\n                <p>Przepiękny odcień jasnej brzoskwini z delikatnymi przetarciami i subtelnym kropkowaniem w jasnych odcieniach pomarańczy i żółtego.</p><p>100 g / 420 m</p><p>skład: 75% merino, 25% nylon</p>\n            ','georgina-speckled-woollala-sock-100','','','','Georgina Speckled Woollala Sock 100','','','',''),(162,1,1,'<h2>Włóczka ręcznie farbowana Pale Pink Sock 100 od Woollala</h2><p>To przyjemna w odbiorze włóczka z wełny merynosów z dodatkiem nylonu w autorskim farbowaniu Pale Pink Sock 100 od Woollala. Wielowymiarowy kolor zgaszonego różu z pięknym opalizującym efektem, farbowanie jednokolorowe, bez przetarć i kropkowań.</p><p>Sock Merino, to włóczka z wełny merynosów z dodatkiem nylonu który sprawia, że nitka jest wytrzymalsza i trudniej ją zerwać, przy czym jednocześnie włóczka nie traci na swojej miękkości. Jest to doskonała propozycja na skarpetki, ale nie tylko. Z tej włóczki stworzysz zwiewne szale, mocne rękawiczki, wytrzymalsze sweterki.</p><h3>Parametry włóczki Pale Pink:</h3><ul><li>Skład: 75% wełna merino superwash, 25% Nylon</li><li>Waga: 100 g</li><li>Długość: 425 m</li><li>Sugerowane druty: 2,5 – 3,75 mm – zobacz nasze <em><strong><a href=\"https://miedzydrutami.pl/druty/\">DRUTY</a></strong></em></li><li>Próbka ściegiem gładkim: 10 c...</li></ul>','\n                <p>Wielowymiarowy kolor zgaszonego różu z pięknym opalizującym efektem, farbowanie jednokolorowe, bez przetarć i kropkowań.</p><p>100 g / 420 m</p><p>skład: 75% merino, 25% nylon</p>\n            ','pale-pink-woollala-sock-100','','','','Pale Pink Woollala Sock 100','','','',''),(163,1,1,'<h2>Diamonds Woollala luksusowa włóczka</h2><p>Niezwykła włóczka Diamonds Woollala  błyszczy w świetle jak prawdziwy diament. Subtelne skrzenie jakie będzie miała dzianina uzyskane jest poprzez dodanie cienkiej steliny do włóczki. Błysk jest delikatny i uzależniony od ilości światła jakie pada na włóczkę. Dzięki niej będziesz czuć się bardzo kobieco i elegancko, choć nie jest to włóczka tylko na wieczorowe dzianiny. Z powodzeniem można ją używać do codziennych stylizacji.</p><p>Włóczka Diamonds Lux Lace jest farbowana ręcznie przez markę Woollala.</p><p>Włóczka przeznaczona na wszelkie dzianiny – czapki, swetry, bluzki, chusty, czapki czy skarpetki.</p><p>Może być przerabiana również z dodatkiem włóczki moherowej, delikatnej jak <em><strong><a href=\"https://miedzydrutami.pl/mohair-bliss-pascuali/\" target=\"_blank\" rel=\"noreferrer noopener\">Mohair Bliss Pascuali</a></strong></em> czy <em><strong><a href=\"https://miedzydrutami.pl/isager-silk-mohair/\"></a></strong></em></p>','\n                <p>Pięknie błyszcząca włóczka, niczym diament – szyk, błysk i elegancja</p><p>100g / 400m, druty 2,25 – 3,75mm<br />\nskład : 75% wełna merino , 20% nylon, 5% stelina</p>\n            ','diamonds-woollala','','','','Diamonds Woollala','','','',''),(164,1,1,'<h2>Włóczka skarpetkowa Dream Lace Pro Lana</h2><p>Włóczka skarpetkowa Dream Lace Pro Lana jest przędzą jednonitkową barwiona w paseczki o płynnym przejściu kolorów, gdzie przejście pasków jest średniej długości.</p><p>Z motka 50g wykonamy parę krótkich skarpet w rozmiarze do 40. Na regularną długość skarpetek do rozmiaru 46 potrzebne będą 2 motki. Ze względu na swój urok i fantazyjne przejście kolorów jak również na przyjemny odbiór włóczkę Dream Lace można zastosować we wszelkich innych dzianinach, jak chusty czy swetry.</p><h2>Parametry włóczki Dream Lace :</h2><ul><li>Skład : 75% wełna, 25% nylon</li><li>Waga : 50g</li><li>Długość : 200m</li><li>Zalecane druty : 2,5 – 3,0 mm – zobacz nasz <a href=\"https://miedzydrutami.pl/druty/\"><strong><em>DRUTY</em></strong></a></li><li>Zużycie para skarpet – 2 motki, sweter w rozmiarze M – 8 motki</li></ul><p>Próbka producenta ściegiem gładkim: 10 x 10cm = 29 oczek x 38 rzędów . Dla ustalenia wł...</p>','\n                <p>Włóczka skarpetkowa z krótkim przejściem koloru</p><p>50g / 200m, druty 2,5 – 3,0mm</p><p>skład : 75% wełna,  25% nylon</p>\n            ','dream-lace-pro-lana','','','','Dream Lace Pro Lana','','','',''),(165,1,1,'<h2>Włóczka skarpetkowa Sisu Sandnes Garn</h2><p>Miękka włóczka wełniana, wzmocniona dodatkiem nylonu. Skład włóczki Sisu Sandnes Garn jednoznacznie wskazuje na użycie w skarpetkach, jednak nic nie stoi na przeszkodzie aby tą bazową wełnianą włóczkę użyć np w swetrach. W Norwegii jest to włóczka wykorzystywana w wielu dzianinach w tym w tradycyjnych swetrach kofte. Włóczka posiada średni skręt z użyciem 4 nitek, a producent zadbał o szeroką kolorystykę.</p><h3>Parametry włóczki Sisu Sandnes Garn:</h3><ul><li>Skład: 80% wełna, 20% nylon</li><li>Waga: 50 g</li><li>Długość: 175 m</li><li>Zalecane druty: 2,5 – 3,0 mm zobacz polecane druty <em><strong><a href=\"https://miedzydrutami.pl/druty-do-dziergania/\" target=\"_blank\" rel=\"noreferrer noopener\">TUTAJ</a></strong></em></li><li>Zużycie para skarpet – 2 motki</li></ul><p>Próbka producenta ściegiem gładkim: 10 cm = 27 oczek. <span></span></p>','\n                <p>Bazowa włóczka skarpetkowa, świetna też na swetry żakardowe.</p><p>50 g / 175 m, druty 2,5 – 3,0 mm</p><p>80% wełna, 20% nylon</p>\n            ','sisu-sandnes-garn','','','','Sisu Sandnes Garn','','','',''),(166,1,1,'<h2>Włóczka skarpetkowa Woolly Hugs Year Socks</h2><p>Pięknie barwiona w efekt gradientu (lub potocznie degrade), włóczka skarpetkowa Woolly Hugs Year Socks, która jest przędzą jednonitkową.</p><p>Z motka 100g wykonamy parę skarpet w rozmiarze do 46. Jednak ze względu na swój urok i fantazyjne przejście kolorów jak również na przyjemny odbiór włóczkę Year Socks można zastosować we wszelkich innych dzianinach.</p><p>Użyjmy jej do barwnej chusty, szala, komina czy sweterka. Bez wątpienia oszałamiający efekt dzianiny uzyskamy łącząc dwa kontrastowe kolory we wzorze żakardowym.</p><h2>Parametry włóczki Year Socks :</h2><ul><li>Skład : 75% wełna, 25% nylon</li><li>Waga : 100g</li><li>Długość : 400m</li><li>Zalecane druty : 2,5 – 3,0 mm – zobacz nasz <a href=\"https://miedzydrutami.pl/druty/\"><strong><em>DRUTY</em></strong></a></li><li>Zużycie para skarpet – 1 motek, sweter w rozmiarze M – 4 motki</li></ul><p>Próbka producenta ściegiem gładkim...</p>','\n                <p>Gradientowa włóczka skarpetkowa z płynnym przejściem koloru</p><p>100g / 400m, druty 2,5 – 3,0mm</p><p>skład : 75% wełna,  25% nylon</p>\n            ','woolly-hugs-year-socks','','','','Woolly Hugs Year Socks','','','',''),(167,1,1,'<h2>Włóczka ręcznie farbowana Elinor Speckled Sock 100 od Woollala</h2><p>To przyjemna w odbiorze włóczka z wełny merynosów z dodatkiem nylonu w autorskim farbowaniu Elinor Speckled Sock 100 od Woollala.  Całość utrzymana w chłodnym odcieniu srebrzystej szarości ocieplona lawendowymi i bordowymi przetarciami. Dodatkiem są granatowe kropkowania.</p><p>Sock Merino, to włóczka z wełny merynosów z dodatkiem nylonu który sprawia, że nitka jest