3>Parametry włóczki Enjoy Your Life:</h3><ul><li>Skład: 75% wełna merino superwash, 25% Nylon</li><li>Waga: 100 g</li><li>Długość: 425 m</li><li>Sugerowane druty: 2,5 – 3,75 mm – zobacz nasze <em><strong><a href=\"https://miedzydrutami.pl/druty/\">DRUTY</a></strong></em></li><li>Pr...</li></ul>','\n                <p>Wielokolorowe, urocze farbowanie, raczej stonowane niż krzykliwe.</p><p>100 g / 420 m</p><p>skład: 75% merino, 25% nylon</p>\n            ','enjoy-your-life-woollala-sock-100','','','','Enjoy Your Life Woollala Sock 100','','','',''),(176,1,1,'<h2>Włóczka ręcznie farbowana Summer Sun Pink Sock 50 od Woollala</h2><p>To przyjemna w odbiorze włóczka z wełny merynosów z dodatkiem nylonu w autorskim farbowaniu Summer Sun Pink Sock 50 od Woollala. Całość utrzymana w subtelnym odcieniu dość żywego różu, z mocniejszymi akcentami w postaci kropkowania.</p><p>Sock Merino, to włóczka z wełny merynosów z dodatkiem nylonu który sprawia, że nitka jest wytrzymalsza i trudniej ją zerwać, przy czym jednocześnie włóczka nie traci na swojej miękkości. Jest to doskonała propozycja na skarpetki, ale nie tylko. Z tej włóczki stworzysz zwiewne szale, mocne rękawiczki, wytrzymalsze sweterki.</p><h3>Parametry włóczki Summer Sun Pink :</h3><ul><li>Skład : 75% wełna merino superwash, 25% Nylon</li><li>Waga : 50g</li><li>Długość : 212m</li><li>Sugerowane druty : 2,5 – 3,75 mm – zobacz nasze <em><strong><a href=\"https://miedzydrutami.pl/druty/\">DRUTY</a></strong></em></li><li>Próbka ściegiem gładkim 10cm...</li></ul>','\n                <p>Zdecydowana różowa nuta z ciemniejszym kropkowaniem</p><p>50g / 212m , skład : 75% merino, 25% nylon</p>\n            ','summer-sun-pink-woollala-sock-50','','','','Summer Sun Pink Woollala Sock 50','','','',''),(177,1,1,'<h2>Palet Isager włóczka bawełniana</h2><p>Palet Isager to świetna włóczka, która sprawdzi się w okresie letnim, jak i również przez cały rok! To bawełna tasiemkowa 100%, której struktura daje niesamowity efekt w dzianinie dlatego warto wrzucić ją na druty. Charakterystyczną cechą tej włóczki jest matowe wykończenie. Możesz dziergać jedną nitką lub dwie, a także łączyć z innymi włóczkami marki Isager, np.: <a href=\"https://miedzydrutami.pl/trio-2-isager/\" target=\"_blank\" rel=\"noreferrer noopener\"><em><strong>Trio 2</strong></em></a>, <a href=\"https://miedzydrutami.pl/isager-silk-mohair/\" target=\"_blank\" rel=\"noreferrer noopener\"><em><strong>Silk Mohair</strong></em></a>, <a href=\"https://miedzydrutami.pl/japansk-bomuld-isager/\" target=\"_blank\" rel=\"noreferrer noopener\"><em><strong>Japansk Bomuld</strong></em></a>, <a href=\"https://miedzydrutami.pl/alpaca-1-isager/\" target=\"_blank\" rel=\"noreferrer noopener\"><em><strong>Alpaca 1</strong></em></a>, <a href=\"https://miedzydrutami.pl/...\"></a></p>','\n                <p>Bawełna tasiemkowa.</p><p>50 g / 160 m, druty 3,00 mm</p><p>100% bawełna</p>\n            ','palet-isager','','','','Palet Isager','','','',''),(178,1,1,'<h2><strong>Włóczka Re-Jeans Pascuali</strong></h2><p>Re-Jeans Pascuali to włóczka, która powstała z bawełny dżinsowej pochodzącej z recyklingu, czyli z postindustrialnych odpadów dżinsowych. Produkcja tego typu przędzy wygląda następująco: resztki tkaniny stopniowo rozpuszcza się do poszczególnych włókien, które następnie ponownie miesza się i przędzie. Obróbka bawełny wymaga dużych ilości wody, energii i pracy dlatego bawełna pochodząca z recyklingu jest przyjazną dla środowiska alternatywą, ponieważ jej produkcja zużywa mniej zasobów. Według World Wildlife Fund (WWF) do wyprodukowania jednego kilograma bawełny, co odpowiada jednemu t-shirtowi i jednej parze dżinsów, potrzeba około 20 000 litrów wody. Recykling bawełny zmniejsza wpływ odpadów tekstylnych trafiających na wysypiska śmieci na środowisko. Dzięki temu oszczędzamy energię i wodę. Proces recyklingu nadaje włóczce Re-Jeans charakterystyczną, piękną rustykalną strukturę, przyp...</p>','\n                <p>Miękka, rustykalna włóczka, która powstała z bawełny dżinsowej pochodzącej z recyklingu.</p><p>50 g / 96 m, druty 4,5 – 5,0 mm</p><p>95% bawełna (denim z recyklingu), 5% inne włókna</p>\n            ','re-jeans-pascuali','','','','Re-Jeans Pascuali','','','',''),(179,1,1,'<div class=\"widget widget-text widget-none bg-produkte\"><div class=\"widget-inner bg-appearance\"><h2>Włóczka New Nepal Pascuali</h2><p>Skład przędzy Nepal Pascuali jest naprawdę niezwykły, to 60% bawełny organicznej i 40% lnu . Mieszanka sprawia, że ​​przędza jest jednocześnie sprężysta i miękka – również dzięki specjalnemu skrętowi, który nadaje włóczce Nepal szczególnie piękną i naturalną strukturę. Po zmoczeniu włóczka mięknie dając w odbiorze lekką i przyjemną dzianinę</p><p>New Nepal ma doskonałe właściwości użytkowe: bawełna przepuszcza powietrze, zawartość lnu sprawia, że ​​przędza jest przyjemna w dotyku. To sprawia, że ​​Nepal jest idealną bazą dla przewiewnych bluzek, letnich sukienek. Jednocześnie jest na tyle ciepły, że może być przyjemną włóczką przez cały rok. Świetnie łączy się z innymi włóczkami, jak np <em><strong><a href=\"https://miedzydrutami.pl/pascuali-wloczka-suave/\" target=\"_blank\" rel=\"noreferrer noopener\">Suave</a></strong>...</em></p></div></div>','\n                <p>Letnia włóczka z ekologicznych upraw o rustykalnym wyglądzie</p><p>50g / 180m, druty 3-4mm<br />\nskład : 60% bawełna organiczna, 40% len</p>\n            ','new-nepal-pascuali','','','','New Nepal Pascuali','','','',''),(180,1,1,'<h2>Włóczka Japansk Bomuld Isager</h2><p>Włóczka Japansk Bomuld Isager to japońska bawełna – niebanalna włóczka, która na pierwszy rzut oka może przypominać twardą rafię lub papier. Jednak dopiero po wypraniu gotowego projektu możesz zachwycić się miękkością tej przędzy. Wykonasz z niej projekty wiosenne oraz letnie. W połączeniu z inną przędzą otrzymasz ciekawą strukturę na dzianinie.</p><p>Bawełnę japońską można połączyć z innymi letnimi włóczkami, np. <em><strong><a href=\"https://miedzydrutami.pl/bomulin-isager/\" target=\"_blank\" rel=\"noreferrer noopener\">Bomulin</a></strong></em> a także z wełną.</p><p>W zależności od indywidualnych ustawień monitora, kolory mogą się nieznacznie różnić.</p><p>Więcej o tej włóczce dowiesz się <em><strong><a href=\"https://isagerstrik.dk/en/product/japansk-bomuld/\" target=\"_blank\" rel=\"noreferrer noopener\">TUTAJ</a></strong></em>.</p><h3>Parametry włóczki:</h3><ul><li>Skład: 100% bawełna</li><li>Waga: 50 g</li><li>Długość: 3...</li></ul>','\n                <p>Japońska bawełna</p><p>50g / 315 m, druty 3,00 mm</p><p>100 % bawełna</p>\n            ','japansk-bomuld-isager','','','','Japansk Bomuld Isager','','','',''),(181,1,1,'<h2>Włóczka Bomulin Isager</h2><p>Włóczka Bomulin Isager to kompozycja bawełny oraz lnu. To połączenie dwóch roślinnych nici nadaje przędzy ciekawą teksturę. To niebanalna włóczka, z której wykonasz lekkie i przewiewne projekty na wiosnę oraz lato – także dla dzieci.</p><p>Przędzę Bomulin można połączyć z innymi letnimi włóczkami a także z wełną. <span>Dobierając włóczkę towarzyszącą z oferty marki Isager będziemy mieć łatwiejszy wybór właściwego tonu kolorystycznego. Kierujmy się przy wyborze numerem koloru.</span></p><p>Producent podaje informację, że wysoka zawartość lnu może powodować skręcanie się projektu podczas pracy na okrągło.</p><p>W zależności od indywidualnych ustawień monitora, kolory mogą się nieznacznie różnić.</p><p>Więcej o tej włóczce dowiesz się <em><strong><a href=\"https://isagerstrik.dk/en/product/bomulin/?attribute_pa_color=62-en\"></a></strong></em></p>','\n                <p>Letnia włóczka o ciekawej strukturze.</p><p>50 g / 210 m, druty 3 mm</p><p>65% bawełna, 35% len</p>\n            ','bomulin-isager','','','','Bomulin Isager','','','',''),(182,1,1,'<h2>Trio 2 Isager</h2><p><span class=\"TextRun SCXW56033993 BCX0\" lang=\"da-dk\" xml:lang=\"da-dk\"><span class=\"NormalTextRun SCXW56033993 BCX0\"><span class=\"TextRun SCXW260722944 BCX0\" lang=\"da-dk\" xml:lang=\"da-dk\"><span class=\"NormalTextRun SCXW260722944 BCX0\">Trio 2 Isager to letnia kompozycja naturalnych włókien: lnu, bawełny i lyocellu. To włóczka, która zachwyca zarówno solo, jak i w połączeniu z innymi przędzami, np. wełną. </span></span></span></span></p><p><span class=\"TextRun SCXW56033993 BCX0\" lang=\"da-dk\" xml:lang=\"da-dk\"><span class=\"NormalTextRun SCXW56033993 BCX0\"><span class=\"TextRun SCXW260722944 BCX0\" lang=\"da-dk\" xml:lang=\"da-dk\"><span class=\"SpellingError SCXW260722944 BCX0\">Isager oferuje aż 22 warianty kolorystyczne włóczki Trio dlatego możesz tworzyć różnorodne wersje kolorystyczne.</span></span></span></span></p><p>Z tej przędzy wykon...</p>','\n                <p>Połączenie lnu, bawełny i lyocellu</p><p>50g / 175 m, druty 3,00 – 3,5 mm</p><p>50 % len, 30% bawełna, 20% lyocell</p>\n            ','trio-2-isager','','','','Trio 2 Isager','','','',''),(183,1,1,'<h2>Puno Winikunka Pascuali inspiracja naturą</h2><p>Włóczka Puno Winikunka Pascuali to barwiona wersja włóczki <em><strong><a href=\"https://miedzydrutami.pl/pascuali-wloczka-puno/\" target=\"_blank\" rel=\"noreferrer noopener\">Puno</a></strong></em>, której kolory inspirowane są górą Winikunka w peruwiańskich Andach. Cudownie miękka mieszanka bawełny i wełny z alpaki z certyfikatem GOTS. Oba surowce pochodzą z Peru, gdzie również powstaje ta niezwykła włóczka.</p><p>Mieszanka gładkiej bawełny z puszystą wełną z alpaki sprawia, że ​​Puno Winikunka jest świetną całoroczną włóczką, która nadaje się do robienia na drutach, jak i szydełkowania. Nadaje się zarówno do lekkich topów, bluzeczek czy lekkich sweterków jak i akcesoriów, takich jak szale czy szale. Jest przyjemnie miękka i delikatna więc można ją nosić bezpośrednio na skórze.</p><p>Można łączyć ją z włóczkami <strong><em><a href=\"https://miedzydrutami.pl/pascuali-wloczka-alpaca-lace/\"></a></em></strong></p>','\n                <p>Miękką włóczka całoroczna z bawełny organicznej i alpaki</p><p>50g / 200m, druty 2,5 – 3mm<br />\nskład : 70% bawełna organiczna, 30% alpaka</p>\n            ','puno-winikunka-pascuali','','','','Puno Winikunka Pascuali','','','',''),(184,1,1,'<h2>Trio 1 Isager drobna włóczka lniana</h2><p><span class=\"TextRun SCXW56033993 BCX0\" lang=\"da-dk\" xml:lang=\"da-dk\"><span class=\"NormalTextRun SCXW56033993 BCX0\"><span class=\"TextRun SCXW260722944 BCX0\" lang=\"da-dk\" xml:lang=\"da-dk\"><span class=\"NormalTextRun SCXW260722944 BCX0\">Trio 1 Isager jest cienką  włóczką skomponowaną z lnu, bawełny i lyocellu. Może być przerabiana pojedynczą nitką, podwójną lub potrójną. Świetnie łączy się z innymi włóczkami jako nitka towarzysząca. </span></span></span></span></p><p><span class=\"TextRun SCXW56033993 BCX0\" lang=\"da-dk\" xml:lang=\"da-dk\"><span class=\"NormalTextRun SCXW56033993 BCX0\"><span class=\"TextRun SCXW260722944 BCX0\" lang=\"da-dk\" xml:lang=\"da-dk\"><span class=\"SpellingError SCXW260722944 BCX0\">Włóczka Trio  </span></span><span class=\"TextRun SCXW260722944 BCX0\" lang=\"da-dk\" xml:lang=\"da-dk\"></span></span></span></p>','\n                <p>połączenie lnu, bawełny i lyocellu</p><p>50g / 350m, druty 2,5 – 3,0mm</p><p>50 % len, 30% bawełna, 20% lyocell</p>\n            ','trio-1-isager','','','','Trio 1 Isager','','','',''),(185,1,1,'<h2>Ręcznie farbowana bawełna Araucania Huasco Cotton Kettle</h2><p>Włóczka Araucania Huasco Coton Kettle to 100% bawełna farbowana ręcznie przez rzemieślników w Chile. Cotton Kettle jest włóknem bardzo miękkim, zupełnie innym w odbiorze niż klasyczne włóczki bawełniane dostępne na rynku. Jednocześnie to włóczka dobrze skręcona, co w efekcie daje bardzo równy ścieg. Barwa w motku przenika od jaśniejszego do ciemniejszego odcienia, co nadaje tej włóczce wyjątkowego wyrazu.</p><p>Taka wersja farbowania bawełny, dodatkowo przy grubości super fine spotykana jest na rynku dość rzadko, w związku z tym Coton Kettle staje się włóczką wyjątkową.</p><p>Należy pamiętać, że włóczki farbowane ręcznie mogą wykazywać różnicę w odcieniu nawet z tej samej partii farbowania. Dlatego też zaleca się przy większym projekcie przerabianie jednocześnie z dwóch motków zmieniając nitkę co dwa rzędy aby uzyskać jednolitą dzianinę.</p><h3>Parametry włóczki Araucan...</h3>','\n                <p>Ręcznie farbowana, miękka włóczka bawełniana</p><p>100g / 440m, druty 2,25 – 3,75mm<br />\nskład : 100% bawełna z Chile</p>\n            ','araucania-huasco-cotton-kettle','','','','Araucania Huasco Cotton Kettle','','','',''),(186,1,1,'<h2>Ręcznie farbowana bawełna Araucania Huasco Coton</h2><p>Włóczka Araucania Huasco Coton to 100% bawełna farbowana ręcznie przez rzemieślników w Chile. Cotton jest włóknem bardzo miękkim, zupełnie innym w odbiorze niż klasyczne włóczki bawełniane dostępne na rynku. Jednocześnie to włóczka dobrze skręcona, co w efekcie daje bardzo równy ścieg. Barwy w motku tworzą artystyczny melanż, co nadaje tej włóczce wyjątkowego wyrazu.</p><p>Taka wersja farbowania bawełny, dodatkowo przy grubości super fine spotykana jest na rynku dość rzadko, w związku z tym Coton Kettle staje się włóczką wyjątkową.</p><p>Należy pamiętać, że włóczki farbowane ręcznie mogą wykazywać różnicę w odcieniu nawet z tej samej partii farbowania. Dlatego też zaleca się przy większym projekcie przerabianie jednocześnie z dwóch motków zmieniając nitkę co dwa rzędy aby uzyskać jednolitą dzianinę.</p><h3>Parametry włóczki Araucania Huasco Coton:</h3><ul><li>Skład: 100% bawełn...</li></ul>','\n                <p>Ręcznie farbowana, miękka włóczka bawełniana</p><p>100g / 440m, druty 2,25 – 3,25mm<br />\nskład : 100% bawełna z Chile</p>\n            ','araucania-huasco-coton','','','','Araucania Huasco Coton','','','',''),(187,1,1,'<h2>DUO Sandnes Garn włóczka bawełniana z wełną merino</h2><p>Dodatek wełny merino do włóczka bawełnianej nadaje jej lżejszego charakteru i zdecydowanie zmiękcza bawełnę, podnosząc komfort użytkowania. Takie połączenie w DUO Sandnes Garn daje świetną włóczkę całoroczną, którą można użyć w letnich jak i zimowych dzianinach.</p><p>Duo polecane jest w szczególności dla osób wrażliwych na włóczki wełniane jak również dla dzieci i niemowląt. Możemy ją użyć w bluzkach, swetrach czy szalikach. Świetnie sprawdzi się też w lekkich kocykach dla dzieci.</p><h3>Parametry włóczki DUO Sandnes Garn:</h3><ul><li>Skład: 55% wełna merino, 45% bawełna</li><li>Waga: 50 g</li><li>Długość: 115 m</li><li>Zalecane druty: 3,5 mm zobacz polecane druty <em><strong><a href=\"https://miedzydrutami.pl/druty-do-dziergania/\" target=\"_blank\" rel=\"noreferrer noopener\">TUTAJ</a></strong></em></li><li>Zużycie: na sweter w rozmiarze M z długim rękawem – 9/10 motków</li></ul><p>Próbka ...</p>','\n                <p>Połączenie bawełny i wełny merino</p><p>50g / 115 m, druty 3,5mm</p><p>skład: 55% wełna merino, 45% bawełna</p>\n            ','duo-sandnes-garn','','','','DUO Sandnes Garn','','','',''),(188,1,1,'<h2>Włóczka wegańska Cumbria Pascuali</h2><p>Cumbria to niezwykle jedwabista mieszanka wysokiej jakości bawełny PIMA i wiskozy bambusowej. Takie połączenie włókien sprawia, że ​​Cumbria Pascuali jest cudownie miękką przędzą, która pod względem dotyku na skórze z łatwością może konkurować z włóczkami z merynosów i jedwabiu. Cumbria zachwyca swoją lekkością, będą jednocześnie wyjątkowo trwałą przędzą odporną na odkształcenia. Jest bardzo łatwa w obróbce więc dobrze sprawdzi się w projektach na druty jak i szydełko.</p><p>Włókna Cumbrii dają efekt chłodzenia latem, ale jej struktura ogrzeje nas również zimą. To sprawia, że ta ​​wegańska przędza jest świetną całoroczną włóczką. Odpowiednio dostosowana paleta kolorów, od delikatnych i powściągliwych po mocne i radosne, daje szerokie możliwości kreowania charakteru dzianin.</p><p>Cumbria nadaje się zarówno na topy, bluzeczki, sukienki jak i na akcesoria, takie jak szaliki czy szale. Jest przy...</p>','\n                <p>Niezwykle miękkie połączenie bawełny PIMA i włókna z bambusa.</p><p>50 g / 150 m, druty 3,0 mm</p><p>60% bawełna PIMA, 40% bambus (wiskoza)</p>\n            ','cumbria-pascuali','','','','Cumbria Pascuali','','','',''),(189,1,1,'<h2>Włóczka naturalna niebarwiona Puno Pascuali</h2><p>Włóczka Puno Pascuali to cudownie miękka mieszanka bawełny z certyfikatem GOTS i wełny alpaki. Oba surowce pochodzą z Peru, gdzie również powstaje ta niezwykła włóczka.</p><p>Życzeniem Pascuali było stworzenie przędzy bawełnianej w różnych odcieniach bez konieczności barwienia włókna. Dzięki połączeniu z naturalnymi kolorami alpak udało nam się stworzyć paletę w pięknych, subtelnych naturalnych odcieniach.</p><p>Mieszanka gładkiej bawełny z puszystą wełną z alpaki sprawia, że ​​Puno jest świetną całoroczną włóczką, która nadaje się do robienia na drutach, jak i szydełkowania. Puno nadaje się zarówno do lekkich topów, bluzeczek czy lekkich sweterków jak i akcesoriów, takich jak szale czy szale. Jest przyjemnie miękka i delikatna więc można ją nosić bezpośrednio na skórze.</p><h3>Parametry włóczki Puno :</h3><ul><li>Skład : 70% bawełna organiczna, 30% alpaka</li><li>Waga : 50g</li></ul>','\n                <p>Naturalna, niebarwiona włóczka z bawełny organicznej i alpaki</p><p>50g / 200m, druty 2,5 – 3mm<br />\nskład : 70% bawełna organiczna, 30% alpaka</p>\n            ','puno-pascuali','','','','Puno Pascuali','','','',''),(190,1,1,'<h2>Wyjątkowa włóczka z bawełny organicznej Suave Pascuali</h2><p>Suave to prawdziwa specjalność wśród przędz z czystej bawełny, ponieważ włókna nie są przędzone w zwykły sposób. Tutaj rodzaj bawełnianej siatki utrzymuje luźne włókna razem. Ponadto ta wegańska włóczka ma najwyższą jakość organiczną co sprawia że jest cudowna do robienia na drutach jak i również na szydełku.</p><p>Suave idealnie nadaje się na lekkie ubrania, takie jak swetry i swetry rozpinane, ale dzięki świetnemu układaniu się świetnie nadaje się również na szaliki i szale. Ponieważ włóczka jest tak miękka, można ją nosić bezpośrednio na skórze, spodoba się nawet dzieciom i osobom wrażliwym!<br />\nPo wyprasowaniu dzianina Suave uzyskuje gładką powierzchnię, natomiast po wyczesaniu dzianina staje się miękka i puszysta, a swoją miękkością przypomina kaszmir i moher. Suave jest zatem świetną alternatywą dla osób uczulonych na wełnę i wegan!</p><p>Włókna bawełniane, użyte do...</p>','\n                <p>Suave to uczucie kaszmiru wykonane z bawełny z certyfikatem GOTS!</p><p>25g / 162m, druty 3mm<br />\nskład : 100% bawełna organiczna</p>\n            ','suave-pascuali','','','','Suave Pascuali','','','',''),(191,1,1,'<h2>Sole Pascuali włóczka bawełna Pima i kaszmir</h2><p>Sole Pascuali to wspaniała mieszanka delikatnej bawełny Pima i szlachetnego kaszmiru. Takie połączenie połączenie włókien występuje bardzo rzadko w przędzy bawełnianej. Mieszanka 90% peruwiańskiej bawełny Pima i 10% mongolskiego kaszmiru sprawia, że ​​Sole jest cudownie miękka. Jest to 6-warstwowa przędza z potrójnym skrętem, dzięki czemu jest mocna, a jednocześnie delikatna i błyszcząca.</p><p>Włóczka Sole jest urocza w robótce i daje piękna strukturę ściegu. Dobrze sprawdza się zarówno w przypadku dzianin ażurowych, jak i gładkich dżersejów, a także doskonale nadaje się do szydełkowania.</p><p>Sole to idealna włóczka całoroczna, zarówno do lekkich letnich topów, jak i  kardiganów i pulowerów. To także doskonały wybór na dodatki takie jak szaliki, szale czy czapki. Ponieważ jest tak miękka, jest dobrą alternatywą dla tych, którzy uważają, że czysta wełna jest zbyt drapiąca w stosu...</p>','\n                <p>Luksusowa włóczka bawełniana.</p><p>50g/140m, zalecane druty 3,5mm</p><p>Skład : 90% bawełna Pima, 10% organiczny kaszmir</p>\n            ','sole-pascuali','','','','Sole Pascuali','','','',''),(192,1,1,'<h2>Włóczka bawełniana Tynn Line Sandnes Garn z lnem i wiskozą</h2><p>Tynn Line Sandnes Garn to cienka włóczka bawełniana z dodatkiem lnu i wiskozy dzięki której jest miękka i ma delikatny połysk. Natomiast dodatek lnu zapewnia tej włóczce niepowtarzalny, rustykalny charakter. Dzianiny wykonane z włóczki Tynn Line będą lekko lejące i ładnie układające się na sylwetce. Podsumowując Tynn Line to świetny wybór na lekkie letnie dzianiny jak bluzki, topy, czy sukienki. Tynn Line można przerabiać podwójną nitką uzyskując dzięki temu grubszą dzianinę. Dodatkowo połączenie dwóch nitek o różnych kolorach pozwoli na uzyskanie ciekawego efektu melanżu.</p><p>Tynn Line jest włóczką skomponowaną z 3 nitek o średnim stopniu skręcenia. Można używać jej do wzorów gładkich jak również do ażurowych. Oczka w dzianinie ułożą się niezwykle równo dając w efekcie piękną dzianinę.</p><p>Włóczka Tynn Line często występuje w dzianinach znanych projektantów. Duńs...</p>','\n                <p>Na letnie topy, bluzeczki i sukienki</p><p>50g / 220m, skład : 53% bawełna, 33% wiskoza, 14% len, druty 3mm</p>\n            ','tynn-line-sandnes-garn','','','','Tynn Line Sandnes Garn','','','',''),(193,1,1,'<h2>Line Sandnes Garn włóczka bawełniana z lnem i wiskozą</h2><p>Włóczka bawełniana z lnem dzięki zawartości wiskozy jest miękka i ma delikatny połysk. Natomiast dodatek lnu zapewnia tej włóczce niepowtarzalny, rustykalny charakter. Dzianiny wykonane z włóczki Line będą lekko lejące i ładnie układające się na sylwetce. Podsumowując Line Sandnes Garn to świetny wybór na letnie bluzeczki, lekkie sweterki czy sukienki.</p><p>Line jest włóczką skomponowaną z 4 nitek o średnim stopniu skręcenia. Można używać jej do wzorów gładkich jak również do ażurowych. Oczka w dzianinie ułożą się niezwykle równo dając w efekcie piękną dzianinę.</p><p>Włóczka Line często występuje w dzianinach znanych projektantów. Duńska projektantka <a href=\"https://www.petiteknit.com/\">PetiteKnit</a> również użyła włóczkę Line w projektach letnich bluzek Anker’s Summer Shirt i Anker Tee.</p><p>Włóczka bawełniana z lnem Line posiada wersję na cieńsze druty – <a href=\"ht...\"></a></p>','\n                <p>Line to świetny wybór na wiosenne i letnie dzianiny</p><p>50g / 110m, skład : 53% bawełna, 33% wiskoza, 14% len</p>\n            ','line-sandnes-garn','','','','Line Sandnes Garn','','','',''),(194,1,1,'<h2>Tykk Line włóczka bawełniana z lnem i wiskozą</h2><p>Gruba włóczka bawełniana z lnem dzięki dodatkowi wiskozy jest miękka i ma delikatny połysk. Natomiast zawartość lnu zapewnia tej włóczce niepowtarzalny, rustykalny charakter. Dzianiny wykonane z włóczki Tykk Line Sandnes Garn będą lekko lejące i ładnie układające się na sylwetce. Podsumowując Tykk Line to świetny wybór na grubsze letnie dzianiny jak również na akcesoria. W szczególności Tykk Line to idealny materiał na stylowe torebki, czy duże pojemne torby. Sprawdzi się również w podkładkach na stół. .</p><p>Tykk Line posiada ciekawą, skręconą strukturę, która daje wrażenie przestrzenności, powodując że wyroby z niej mają wyjątkowy charakter. Najładniej wygląda przerabiana wzorem gładkim. Oczka w dzianinie ułożą się niezwykle równo dając w efekcie piękną dzianinę.</p><p>Gruba włóczka bawełniana z lnem Tykk Line Sandnes Garn posiada cieńsze wersje – <a></a></p>','\n                <p>letnia włóczka na dzianiny i akcesoria</p><p>50g / 60m, skład : 53% bawełna, 33% wiskoza, 14% len</p>\n            ','tykk-line-sandnes-garn','','','','Tykk Line Sandnes Garn','','','',''),(195,1,1,'<div class=\"widget widget-text widget-none bg-produkte\"><div class=\"widget-inner bg-appearance\"><h2>Włóczka New Nepal Pascuali</h2><p>Skład przędzy Nepal Pascuali jest naprawdę niezwykły, to 60% bawełny organicznej i 40% lnu . Mieszanka sprawia, że ​​przędza jest jednocześnie sprężysta i miękka – również dzięki specjalnemu skrętowi, który nadaje włóczce Nepal szczególnie piękną i naturalną strukturę. Po zmoczeniu włóczka mięknie dając w odbiorze lekką i przyjemną dzianinę</p><p>New Nepal ma doskonałe właściwości użytkowe: bawełna przepuszcza powietrze, zawartość lnu sprawia, że ​​przędza jest przyjemna w dotyku. To sprawia, że ​​Nepal jest idealną bazą dla przewiewnych bluzek, letnich sukienek. Jednocześnie jest na tyle ciepły, że może być przyjemną włóczką przez cały rok. Świetnie łączy się z innymi włóczkami, jak np <em><strong><a href=\"https://miedzydrutami.pl/pascuali-wloczka-suave/\" target=\"_blank\" rel=\"noreferrer noopener\">Suave</a></strong>...</em></p></div></div>','\n                <p>Letnia włóczka z ekologicznych upraw o rustykalnym wyglądzie</p><p>50g / 180m, druty 3-4mm<br />\nskład : 60% bawełna organiczna, 40% len</p>\n            ','new-nepal-pascuali','','','','New Nepal Pascuali','','','',''),(196,1,1,'<h2>Włóczka Hor Organic Isager</h2><p>Hor Organic Isager to pojedyncza, lniana przędza, idealna do łączenia z innymi włóczkami marki Isager, a także do dziergania solo lub w dwie/trzy nitki. Ze względu na rodzaj skrętu tej wyjątkowej przędzy (skręt Z) nie zaleca się przerabiania na drutach na okrągło ponieważ dzianina może się skręcać. Jeśli chcesz temu zapobiec dziergaj w dwie lub więcej nitek, dodaj wełnę lub inną przędzę, dziergaj na płasko.</p><p>Dobierając włóczkę towarzyszącą z oferty marki Isager będziesz mieć łatwiejszy wybór właściwego tonu kolorystycznego dlatego kieruj się przy wyborze numerem koloru.</p><p>W zależności od indywidualnych ustawień monitora, kolory mogą się nieznacznie różnić.</p><p>Więcej o tej włóczce dowiesz się <a href=\"https://isagerstrik.dk/en/product/hoer-organic/?attribute_pa_color=linen-en\" target=\"_blank\" rel=\"noreferrer noopener\"><em><strong>TUTAJ</strong></em>.</a></p><h3>Parametry włóczki Hor Organic:</h3>','\n                <p>Len organiczny</p><p>50g / 178 m, druty 3,00 mm</p><p>100 % len</p>\n            ','hor-organic-isager','','','','Hor Organic Isager','','','',''),(197,1,1,'<h2>Włóczka Bomulin Isager</h2><p>Włóczka Bomulin Isager to kompozycja bawełny oraz lnu. To połączenie dwóch roślinnych nici nadaje przędzy ciekawą teksturę. To niebanalna włóczka, z której wykonasz lekkie i przewiewne projekty na wiosnę oraz lato – także dla dzieci.</p><p>Przędzę Bomulin można połączyć z innymi letnimi włóczkami a także z wełną. <span>Dobierając włóczkę towarzyszącą z oferty marki Isager będziemy mieć łatwiejszy wybór właściwego tonu kolorystycznego. Kierujmy się przy wyborze numerem koloru.</span></p><p>Producent podaje informację, że wysoka zawartość lnu może powodować skręcanie się projektu podczas pracy na okrągło.</p><p>W zależności od indywidualnych ustawień monitora, kolory mogą się nieznacznie różnić.</p><p>Więcej o tej włóczce dowiesz się <em><strong><a href=\"https://isagerstrik.dk/en/product/bomulin/?attribute_pa_color=62-en\"></a></strong></em></p>','\n                <p>Letnia włóczka o ciekawej strukturze.</p><p>50 g / 210 m, druty 3 mm</p><p>65% bawełna, 35% len</p>\n            ','bomulin-isager','','','','Bomulin Isager','','','',''),(198,1,1,'<h2>Trio 2 Isager</h2><p><span class=\"TextRun SCXW56033993 BCX0\" lang=\"da-dk\" xml:lang=\"da-dk\"><span class=\"NormalTextRun SCXW56033993 BCX0\"><span class=\"TextRun SCXW260722944 BCX0\" lang=\"da-dk\" xml:lang=\"da-dk\"><span class=\"NormalTextRun SCXW260722944 BCX0\">Trio 2 Isager to letnia kompozycja naturalnych włókien: lnu, bawełny i lyocellu. To włóczka, która zachwyca zarówno solo, jak i w połączeniu z innymi przędzami, np. wełną. </span></span></span></span></p><p><span class=\"TextRun SCXW56033993 BCX0\" lang=\"da-dk\" xml:lang=\"da-dk\"><span class=\"NormalTextRun SCXW56033993 BCX0\"><span class=\"TextRun SCXW260722944 BCX0\" lang=\"da-dk\" xml:lang=\"da-dk\"><span class=\"SpellingError SCXW260722944 BCX0\">Isager oferuje aż 22 warianty kolorystyczne włóczki Trio dlatego możesz tworzyć różnorodne wersje kolorystyczne.</span></span></span></span></p><p>Z tej przędzy wykon...</p>','\n                <p>Połączenie lnu, bawełny i lyocellu</p><p>50g / 175 m, druty 3,00 – 3,5 mm</p><p>50 % len, 30% bawełna, 20% lyocell</p>\n            ','trio-2-isager','','','','Trio 2 Isager','','','',''),(199,1,1,'<h2>Trio 1 Isager drobna włóczka lniana</h2><p><span class=\"TextRun SCXW56033993 BCX0\" lang=\"da-dk\" xml:lang=\"da-dk\"><span class=\"NormalTextRun SCXW56033993 BCX0\"><span class=\"TextRun SCXW260722944 BCX0\" lang=\"da-dk\" xml:lang=\"da-dk\"><span class=\"NormalTextRun SCXW260722944 BCX0\">Trio 1 Isager jest cienką  włóczką skomponowaną z lnu, bawełny i lyocellu. Może być przerabiana pojedynczą nitką, podwójną lub potrójną. Świetnie łączy się z innymi włóczkami jako nitka towarzysząca. </span></span></span></span></p><p><span class=\"TextRun SCXW56033993 BCX0\" lang=\"da-dk\" xml:lang=\"da-dk\"><span class=\"NormalTextRun SCXW56033993 BCX0\"><span class=\"TextRun SCXW260722944 BCX0\" lang=\"da-dk\" xml:lang=\"da-dk\"><span class=\"SpellingError SCXW260722944 BCX0\">Włóczka Trio  </span></span><span class=\"TextRun SCXW260722944 BCX0\" lang=\"da-dk\" xml:lang=\"da-dk\"></span></span></span></p>','\n                <p>połączenie lnu, bawełny i lyocellu</p><p>50g / 350m, druty 2,5 – 3,0mm</p><p>50 % len, 30% bawełna, 20% lyocell</p>\n            ','trio-1-isager','','','','Trio 1 Isager','','','',''),(200,1,1,'<h2>Włóczka Merilin Isager</h2><p>Włóczka Merilin Isager to połączenie wełny owczej i lnu. Jest to przędza trójwarstwowa, która świetni sprawdzi się we wzorach strukturalnych. W odczuciu bardzo miękka, więc jest dobrym wyborem dla osób o wrażliwej skórze. Len dodaje włóczce swoistą rustykalność, ponieważ nie barwi się w tym samym stopniu co wełna</p><p>Włóczka Merilin przeznaczona jest na wszelkie dzianiny o całorocznym charakterze, w tym również na dzianiny dla dzieci.</p><p>Dobrze łączy się z innymi włóknami, takimi jak :</p><ul><li>cienka wełna owcza – Spinni Isager</li><li>cienka alpaka – Alpaka 1 Isager lub Alpaka Lace Pascuali</li><li>włóczka moherowa – Silk Mohair Isager lub Mohair Bliss Pascuali</li></ul><p>Dobierając włóczkę towarzyszącą z oferty marki Isager będziemy mieć łatwiejszy wybór właściwego tonu kolorystycznego. Kierujmy się przy wyborze numerem koloru</p><p>Wśród produktów marki Pascuali znajduje się również wiele ci...</p>','\n                <p>Połączenie wełny i lnu z rustykalnym charakterem <span>gwarantujące miękkość</span></p><p>50g / 208m, druty 3,0mm</p><p>80% wełna, 20% len</p>\n            ','merilin-isager','','','','Merilin Isager','','','',''),(201,1,1,'<h2>Włóczka bawełniana Tynn Line Sandnes Garn z lnem i wiskozą</h2><p>Tynn Line Sandnes Garn to cienka włóczka bawełniana z dodatkiem lnu i wiskozy dzięki której jest miękka i ma delikatny połysk. Natomiast dodatek lnu zapewnia tej włóczce niepowtarzalny, rustykalny charakter. Dzianiny wykonane z włóczki Tynn Line będą lekko lejące i ładnie układające się na sylwetce. Podsumowując Tynn Line to świetny wybór na lekkie letnie dzianiny jak bluzki, topy, czy sukienki. Tynn Line można przerabiać podwójną nitką uzyskując dzięki temu grubszą dzianinę. Dodatkowo połączenie dwóch nitek o różnych kolorach pozwoli na uzyskanie ciekawego efektu melanżu.</p><p>Tynn Line jest włóczką skomponowaną z 3 nitek o średnim stopniu skręcenia. Można używać jej do wzorów gładkich jak również do ażurowych. Oczka w dzianinie ułożą się niezwykle równo dając w efekcie piękną dzianinę.</p><p>Włóczka Tynn Line często występuje w dzianinach znanych projektantów. Duńs...</p>','\n                <p>Na letnie topy, bluzeczki i sukienki</p><p>50g / 220m, skład : 53% bawełna, 33% wiskoza, 14% len, druty 3mm</p>\n            ','tynn-line-sandnes-garn','','','','Tynn Line Sandnes Garn','','','',''),(202,1,1,'<h2>Line Sandnes Garn włóczka bawełniana z lnem i wiskozą</h2><p>Włóczka bawełniana z lnem dzięki zawartości wiskozy jest miękka i ma delikatny połysk. Natomiast dodatek lnu zapewnia tej włóczce niepowtarzalny, rustykalny charakter. Dzianiny wykonane z włóczki Line będą lekko lejące i ładnie układające się na sylwetce. Podsumowując Line Sandnes Garn to świetny wybór na letnie bluzeczki, lekkie sweterki czy sukienki.</p><p>Line jest włóczką skomponowaną z 4 nitek o średnim stopniu skręcenia. Można używać jej do wzorów gładkich jak również do ażurowych. Oczka w dzianinie ułożą się niezwykle równo dając w efekcie piękną dzianinę.</p><p>Włóczka Line często występuje w dzianinach znanych projektantów. Duńska projektantka <a href=\"https://www.petiteknit.com/\">PetiteKnit</a> również użyła włóczkę Line w projektach letnich bluzek Anker’s Summer Shirt i Anker Tee.</p><p>Włóczka bawełniana z lnem Line posiada wersję na cieńsze druty – <a href=\"ht...\"></a></p>','\n                <p>Line to świetny wybór na wiosenne i letnie dzianiny</p><p>50g / 110m, skład : 53% bawełna, 33% wiskoza, 14% len</p>\n            ','line-sandnes-garn','','','','Line Sandnes Garn','','','',''),(203,1,1,'<h2>Tykk Line włóczka bawełniana z lnem i wiskozą</h2><p>Gruba włóczka bawełniana z lnem dzięki dodatkowi wiskozy jest miękka i ma delikatny połysk. Natomiast zawartość lnu zapewnia tej włóczce niepowtarzalny, rustykalny charakter. Dzianiny wykonane z włóczki Tykk Line Sandnes Garn będą lekko lejące i ładnie układające się na sylwetce. Podsumowując Tykk Line to świetny wybór na grubsze letnie dzianiny jak również na akcesoria. W szczególności Tykk Line to idealny materiał na stylowe torebki, czy duże pojemne torby. Sprawdzi się również w podkładkach na stół. .</p><p>Tykk Line posiada ciekawą, skręconą strukturę, która daje wrażenie przestrzenności, powodując że wyroby z niej mają wyjątkowy charakter. Najładniej wygląda przerabiana wzorem gładkim. Oczka w dzianinie ułożą się niezwykle równo dając w efekcie piękną dzianinę.</p><p>Gruba włóczka bawełniana z lnem Tykk Line Sandnes Garn posiada cieńsze wersje – <a></a></p>','\n                <p>letnia włóczka na dzianiny i akcesoria</p><p>50g / 60m, skład : 53% bawełna, 33% wiskoza, 14% len</p>\n            ','tykk-line-sandnes-garn','','','','Tykk Line Sandnes Garn','','','',''),(204,1,1,'<h2>Velvet Lace włóczka z wełną i jedwabiem ręcznie farbowana</h2><p>Velvet Lace to wyjątkowa włóczka skręcona z nici z wełny merynosów i jedwabiu morwowego. Farbowana w Polsce na specjalne życzenie sklepu Między Drutami, tak aby móc łączyć ją z jedwabnym <a href=\"https://miedzydrutami.pl/mohair-bliss-pascuali/\" target=\"_blank\" rel=\"noreferrer noopener\"><em><strong>moherem Bliss</strong></em></a> marki <a href=\"https://www.pascuali.de/en\" target=\"_blank\" rel=\"noreferrer noopener\"><em><strong>Pascuali</strong></em></a>. Włóczka ta jest dostępna w 100 g preclach o długości 600 metrów, co czyni ją idealną do tworzenia delikatnych, luksusowych dzianin na drutach. Dodatek jedwabiu nadaje włóczce subtelny połysk i niezwykłą miękkość, podkreślając jej wyjątkowy charakter. W połączeniu z moherem Bliss marki Pascuali, Velvet tworzy idealną kompozycję pod względem jakości, a także połączenia kolorystycznego. Z tej włóczki wydziergasz eleganckie, ponadczasowe dzianiny,...</p>','\n                <p>Ręcznie farbowana włóczka wełniana z jedwabiem. Idealna do łączenia z najwyższej jakości moherem Bliss marki Pascuali.</p><p>100 g / 600 m</p><p>skład: 50% wełna merino, 50% jedwab</p><hr /><p><span style=\"color:#339966;\">Nazwy kolorów włóczki Velvet Lace to numery kolorów <a style=\"color:#339966;\" href=\"https://miedzydrutami.pl/mohair-bliss-pascuali/\" target=\"_blank\" rel=\"noreferrer noopener\"><em><strong>Mohair Bliss</strong></em></a> marki Pascuali. Dzięki temu nie musisz się zastanawiać, który kolor moheru Bliss dopasować do włóczki Vevet tak, aby kolor był jak najbardziej jednolity.</span></p>\n            ','velvet-lace','','','','VELVET Lace','','','',''),(205,1,1,'<h2>Włóczka ręcznie farbowana Summer Sun Pink Pure Silk 100 od Woollala</h2><p>To przyjemna w odbiorze włóczka w 100% jedwabiu morwowego w autorskim farbowaniu Summer Sun Pink Pure Silk 100 od Woollala. Wielowymiarowy odcień żywej czerwieni z dodatkiem mocnych fuksjowych tonów, farbowanie bez dodatkowych przetarć i kropkowań.</p><p>Pure Silk 100 to włóczka z jedwabiu morwowego najwyższej jakości o szlachetnym połysku. W odbiorze jest przyjemnie miękka, chłodna, lejąca, nie sprawia żadnego dyskomfortu w kontakcie ze skórą – idealna dla osób wrażliwych. Z tej włóczki stworzysz ubrania na lato: bluzki, koszulki, sukienki. Poleca się również na odzież całoroczną i projekty, które nosi się blisko szyi: apaszki, chustki, zwiewne szale.</p><p>Ta luksusowa jedwabna nić, w porównaniu do jedwabiu Pure Silk Lace 600, jest grubsza, ponieważ została skręcona z 4 nitek. Dzięki temu jest też mocniejsza.</p><h3>Parametry włóczki Summer Sun Pink:</h3>','\n                <p>Wielowymiarowy odcień żywej czerwieni z dodatkiem mocnych fuksjowych tonów, farbowanie bez dodatkowych przetarć i kropkowań.</p><p><span>100 g / 400 m</span></p><p>skład: 100% jedwab morwowy</p>\n            ','summer-sun-pink-woollala-pure-silk-100','','','','Summer Sun Pink Woollala Pure Silk 100','','','',''),(206,1,1,'<h2>Włóczka ręcznie farbowana Dester Sand Pink Pure Silk 100 od Woollala</h2><p>To przyjemna w odbiorze włóczka w 100% jedwabiu morwowego w autorskim farbowaniu Dester Sand Pink Pure Silk 100 od Woollala. Wielowymiarowy odcień ciepłego piasku pustyni, połyskującego różowymi i brzoskwiniowymi tonami, farbowanie bez dodatkowych przetarć i kropkowań.</p><p>Pure Silk 100 to włóczka z jedwabiu morwowego najwyższej jakości o szlachetnym połysku. W odbiorze jest przyjemnie miękka, chłodna, lejąca, nie sprawia żadnego dyskomfortu w kontakcie ze skórą – idealna dla osób wrażliwych. Z tej włóczki stworzysz ubrania na lato: bluzki, koszulki, sukienki. Poleca się również na odzież całoroczną i projekty, które nosi się blisko szyi: apaszki, chustki, zwiewne szale.</p><p>Ta luksusowa jedwabna nić, w porównaniu do jedwabiu Pure Silk Lace 600, jest grubsza, ponieważ została skręcona z 4 nitek. Dzięki temu jest też mocniejsza.</p><h3>Parametry włóczki D...</h3>','\n                <p>Wielowymiarowy odcień ciepłego piasku pustyni, połyskującego różowymi i brzoskwiniowymi tonami, farbowanie bez dodatkowych przetarć i kropkowań.</p><p><span>100 g / 400 m</span></p><p>skład: 100% jedwab morwowy</p>\n            ','dester-sand-pink-woollala-pure-silk-100','','','','Dester Sand Pink Woollala Pure Silk 100','','','',''),(207,1,1,'<h2>Włóczka ręcznie farbowana Light Gray Pure Silk 100 od Woollala</h2><p>To przyjemna w odbiorze włóczka w 100% jedwabiu morwowego w autorskim farbowaniu Light Gray Pure Silk 100 od Woollala. Wielowymiarowy odcień jasnej, połyskującej szarości, farbowanie bez dodatkowych przetarć i kropkowań.</p><p>Pure Silk 100 to włóczka z jedwabiu morwowego najwyższej jakości o szlachetnym połysku. W odbiorze jest przyjemnie miękka, chłodna, lejąca, nie sprawia żadnego dyskomfortu w kontakcie ze skórą – idealna dla osób wrażliwych. Z tej włóczki stworzysz ubrania na lato: bluzki, koszulki, sukienki. Poleca się również na odzież całoroczną i projekty, które nosi się blisko szyi: apaszki, chustki, zwiewne szale.</p><p>Ta luksusowa jedwabna nić, w porównaniu do jedwabiu Pure Silk Lace 600, jest grubsza, ponieważ została skręcona z 4 nitek. Dzięki temu jest też mocniejsza.</p><h3>Parametry włóczki Light Gray:</h3><ul><li>Skład: 100% jedwab morwowy&lt;...</li></ul>','\n                <p>Wielowymiarowy odcień jasnej, połyskującej szarości, farbowanie bez dodatkowych przetarć i kropkowań.</p><p><span>100 g / 400 m</span></p><p>skład: 100% jedwab morwowy</p>\n            ','light-gray-woollala-pure-silk-100','','','','Light Gray Woollala Pure Silk 100','','','',''),(208,1,1,'<h2>Włóczka ręcznie farbowana Frosty Down Pure Silk 100 od Woollala</h2><p>To przyjemna w odbiorze włóczka w 100% jedwabiu morwowego w autorskim farbowaniu Frosty Down Pure Silk 100 od Woollala. Delikatny odcień szałwiowo – miętowy</p><p>Pure Silk 100 to włóczka z jedwabiu morwowego najwyższej jakości o szlachetnym połysku. W odbiorze jest przyjemnie miękka, chłodna, lejąca, nie sprawia żadnego dyskomfortu w kontakcie ze skórą – idealna dla osób wrażliwych. Z tej włóczki stworzysz ubrania na lato: bluzki, koszulki, sukienki. Poleca się również na odzież całoroczną i projekty, które nosi się blisko szyi: apaszki, chustki, zwiewne szale.</p><p>Ta luksusowa jedwabna nić, w porównaniu do jedwabiu Pure Silk Lace 600, jest grubsza, ponieważ została skręcona z 4 nitek. Dzięki temu jest też mocniejsza.</p><h3>Parametry włóczki Frosty Down:</h3><ul><li>Skład: 100% jedwab morwowy</li><li>Waga: 100 g</li><li>Długość: 400 m</li><li>Sugerowane druty...</li></ul>','\n                <p>Delikatny odcień szałwiowo-miętowy.</p><p><span>100 g / 400 m</span></p><p>skład: 100% jedwab morwowy</p>\n            ','frosty-dawn-woollala-pure-silk-100','','','','Frosty Dawn Woollala Pure Silk 100','','','',''),(209,1,1,'<h2>Włóczka ręcznie farbowana Złocista Gruszka Pure Silk 100 od Woollala</h2><p>To przyjemna w odbiorze włóczka w 100% jedwabiu morwowego w autorskim farbowaniu Złocista Gruszka Pure Silk 100 od Woollala. Wielowymiarowy kolor dojrzałej gruszki, z nutą ciepłego, złotego odcienia dojrzewającej żółci oraz zieleni, farbowanie jednokolorowe, bez przetarć i kropkowań.</p><p>Pure Silk 100 to włóczka z jedwabiu morwowego najwyższej jakości o szlachetnym połysku. W odbiorze jest przyjemnie miękka, chłodna, lejąca, nie sprawia żadnego dyskomfortu w kontakcie ze skórą – idealna dla osób wrażliwych. Z tej włóczki stworzysz ubrania na lato: bluzki, koszulki, sukienki. Poleca się również na odzież całoroczną i projekty, które nosi się blisko szyi: apaszki, chustki, zwiewne szale.</p><p>Ta luksusowa jedwabna nić, w porównaniu do jedwabiu Pure Silk Lace 600, jest grubsza, ponieważ została skręcona z 4 nitek. Dzięki temu jest też mocniejsza.</p><h3>Para...</h3>','\n                <p>Wielowymiarowy kolor dojrzałej gruszki, z nutą ciepłego, złotego odcienia dojrzewającej żółci oraz zieleni, farbowanie jednokolorowe, bez przetarć i kropkowań.</p><p>100 g / 400 m</p><p>skład: 100% jedwab morwowy</p>\n            ','zlocista-gruszka-woollala-pure-silk-100','','','','Złocista Gruszka Woollala Pure Silk 100','','','',''),(210,1,1,'<h2>Włóczka ręcznie farbowana Fuksja Pure Silk Lace 600 od Woollala</h2><p>To przyjemna w odbiorze włóczka w 100% jedwabiu morwowego w autorskim farbowaniu Fuksja Pure Silk Lace 600 od Woollala. Wielowymiarowy, intensywny kolor różu, farbowanie jednokolorowe, bez przetarć i kropkowań.</p><p>Pure Silk Lace, to włóczka z jedwabiu morwowego najwyższej jakości o szlachetnym połysku. W odbiorze jest przyjemnie miękka, chłodna, lejąca, nie sprawia żadnego dyskomfortu w kontakcie ze skórą – idealna dla osób wrażliwych. Z tej włóczki stworzysz ubrania na lato: bluzki, koszulki, sukienki. Poleca się również na odzież całoroczną i projekty, które nosi się blisko szyi: apaszki, chustki, zwiewne szale.</p><p>Kolekcja Pure Silk Lace Woollala dostępna w naszym sklepie powstała na specjalne zamówienie, a kolory zostały dopasowane, tak by pięknie komponowały się z delikatnym moherem <a href=\"https://miedzydrutami.pl/mohair-bliss-pascuali/\"></a></p>','\n                <p>Wielowymiarowy kolor intensywnego różu, farbowanie jednokolorowe, bez przetarć i kropkowań.</p><p>100 g / 600 m</p><p>skład: 100% jedwab morwowy</p>\n            ','fuksja-woollala-pure-silk-lace-600','','','','Fuksja Woollala Pure Silk Lace 600','','','',''),(211,1,1,'<h2>Włóczka ręcznie farbowana Emma Speckled Pure Silk 100 od Woollala</h2><p>To przyjemna w odbiorze włóczka w 100% jedwabiu morwowego w autorskim farbowaniu Emma Speckled Pure Silk 100 od Woollala. Wielowymiarowy kolor soczystego różu, widoczne kolorowe akcenty w postaci przetarć i kropkowań w kolorach ciemnego różu, pomarańczy, a nawet fioletu.</p><p>Pure Silk 100 to włóczka z jedwabiu morwowego najwyższej jakości o szlachetnym połysku. W odbiorze jest przyjemnie miękka, chłodna, lejąca, nie sprawia żadnego dyskomfortu w kontakcie ze skórą – idealna dla osób wrażliwych. Z tej włóczki stworzysz ubrania na lato: bluzki, koszulki, sukienki. Poleca się również na odzież całoroczną i projekty, które nosi się blisko szyi: apaszki, chustki, zwiewne szale.</p><p>Ta luksusowa jedwabna nić, w porównaniu do jedwabiu Pure Silk Lace 600, jest grubsza, ponieważ została skręcona z 4 nitek. Dzięki temu jest też mocniejsza.</p><h3>Parametry włóczki Em...</h3>','\n                <p>Wielowymiarowy kolor różu, farbowanie z delikatnym kropkowaniem w kolorach pomarańczy, różu a nawet fioletu.</p><p><span>100 g / 400 m</span></p><p>skład: 100% jedwab morwowy</p>\n            ','emma-speckled-woollala-pure-silk-100','','','','Emma Speckled Woollala Pure Silk 100','','','',''),(212,1,1,'<h2>Włóczka ręcznie farbowana Enjoy Your Life Pure Silk 100 od Woollala</h2><p>To przyjemna w odbiorze włóczka w 100% jedwabiu morwowego w autorskim farbowaniu Enjoy Your Life Pure Silk 100 od Woollala. Wielowymiarowy mix pastelowych kolorów, które przenikają się wzajemnie tworząc przyjemny dla oka, delikatny, pastelowy pejzaż. Widoczne odcienie jasnego różu, błękitu, zieleni, fioletu, a także mocniejsze, kropkowane akcenty kolorystyczne.</p><p>Pure Silk 100 to włóczka z jedwabiu morwowego najwyższej jakości o szlachetnym połysku. W odbiorze jest przyjemnie miękka, chłodna, lejąca, nie sprawia żadnego dyskomfortu w kontakcie ze skórą – idealna dla osób wrażliwych. Z tej włóczki stworzysz ubrania na lato: bluzki, koszulki, sukienki. Poleca się również na odzież całoroczną i projekty, które nosi się blisko szyi: apaszki, chustki, zwiewne szale.</p><p>Ta luksusowa jedwabna nić, w porównaniu do jedwabiu Pure Silk Lace 600, jest grubsza, pon...</p>','\n                <p>Wielowymiarowy mix kolorów, które przenikają się wzajemnie tworząc przyjemny dla oka, delikatny, pastelowy pejzaż.</p><p><span>100 g / 400 m</span></p><p>skład: 100% jedwab morwowy</p>\n            ','enjoy-your-life-woollala-pure-silk-100','','','','Enjoy Your Life Woollala Pure Silk 100','','','',''),(213,1,1,'<h2>Włóczka ręcznie farbowana Denim Pure Silk 100 od Woollala</h2><p>To przyjemna w odbiorze włóczka w 100% jedwabiu morwowego w autorskim farbowaniu Denim Pure Silk 100 od Woollala. Wielowymiarowy i nasycony, niebieski kolor, bez dodatkowych przetarć oraz kropkowań.</p><p>Pure Silk 100 to włó