abiem</h2><p>Cardiff Cashmere Brushlight to włóczka kaszmirowa z dodatkiem jedwabiu morwowego. Ta doskonała przędza jest niezwykle delikatna i miękka. W przypadku przędzy Cashmere Brushlight zastosowano specjalny proces szczotkowania, w związku z tym struktura przędzy jest niesamowicie lekka i puszysta. To idealny materiał na odzież a w szczególności na: czapki, kominy, bluzki, swetry noszone blisko ciała.</p><h3>Parametry Cashmere Brushlight:</h3><ul><li>Skład: 82% kaszmiru, 18% jedwabiu</li><li>Waga: 25 g</li><li>Długość: 138 m</li><li>Zalecane druty: 3,5 – 4,5 mm  – zobacz nasz <em><strong><a href=\"https://miedzydrutami.pl/druty/\">DRUTY</a></strong></em></li></ul><p>Zanim rozpoczniesz dzianinę, wykonaj własną próbkę w wybranym wzorze, aby ocenić ilość oczek i przyjąć poprawną ich ilość do dalszej pracy.<br />\nW zależności od indywidualnych ustawień monitora, kolory mogą się niezn...</p>','\n                <p>Szczotkowany kaszmir mongolski z dodatkiem jedwabiu morwowego</p><p>25 g / 138 m, druty 3,5 – 4,5 mm</p><p>82% kaszmiru, 18% jedwabiu</p>\n            ','cardiff-cashmere-brushlight','','','','Cardiff Cashmere Brushlight','','','',''),(225,1,1,'<h2>Luksusowa włóczka moherowa Mohair Bliss Pascuali</h2><p>Mohair Bliss Pascuali to najwyższej jakości włóczka moherowa. Wykonana z luksusowej mieszanki 60% moheru Super Kid i 40% jedwabiu morwowego.</p><p>Jest delikatna i bardzo miękka, można dziergać nią pojedynczo lub podwójnie. Można ją również łączyć z innymi włóczkami, aby stworzyć zmysłowe, lekkie jak piórko, przewiewne dzianiny. Które dzięki jedwabiowi będą miały niezwykły, subtelny połysk.</p><p>Paleta kolorów Mohair Bliss obejmuje 30 żywych i wyrafinowanych odcieni, które można mieszać i dopasowywać do włóczek marki Pascuali takich jak:<em><strong><a href=\"https://miedzydrutami.pl/pascuali-wloczka-balayage/\" target=\"_blank\" rel=\"noreferrer noopener\">Balayage</a></strong></em>,<em><strong><a href=\"https://miedzydrutami.pl/pinta-pascuali-wloczka-welniana/\" target=\"_blank\" rel=\"noreferrer noopener\">Pinta</a></strong></em>,<em><strong><a href=\"https://miedzydrutami.pl/pascuali-wloczka-puno/\"></a></strong></em></p>','\n                <p>Luksusowa włóczka moherowa</p><p>25g / 300m, druty 2,5 – 5mm<br />\nskład : 60% mohair SuperKid, 40% jedwab morwowy</p>\n            ','mohair-bliss-pascuali','','','','Mohair Bliss Pascuali','','','',''),(226,1,1,'<h2>Delikatna włóczka moherowa ITO Sensai</h2><p>Sensai ITO to delikatna i lekka jak piórko włóczka moherowa z dużym dodatkiem jedwabiu. Słowo <em>sensai </em>w języku japońskim oznacza <em>wróżkę</em> – w przędza jest lekka, delikatna i eteryczna dlatego to określenie bardzo odzwierciedla charakter dzianiny, która powstaje z tej włóczki. Osoby wrażliwe, które odczuwają dyskomfort w kontakcie ciała z moherem koniecznie powinny wypróbować na sobie tę delikatność. Dodatkowo Sensai jest cieńszy niż popularne włóczki typu Kid-Silk, co znacząco podnosi wydajność w zużyciu.</p><p>Włóczkę Sensai możemy przerabiać pojedynczą lub podwójną nitką tworząc koronkowe dzianiny.</p><ul><li>Dodaj włóczkę <a href=\"https://miedzydrutami.pl/ito-asa/\" target=\"_blank\" rel=\"noreferrer noopener\"><em><strong>Asa </strong></em></a>lub <em><strong>Shio</strong></em> do moheru Sensai aby nadać dzianinie stabilności.</li><li>Połącz włóczkę <a href=\"https://miedzydrutami.pl/ki...\"></a></li></ul>','\n                <p>Niezwykle delikatne i lekkie połączenie moheru z jedwabiem.</p><p>20 g / 240 m, druty 2,0 – 5,0 mm</p><p>60% moher, 40% jedwab</p><p> </p>\n            ','sensai-ito','','','','Sensai ITO','','','',''),(227,1,1,'<h2>Bilum Yarns Bataplai 200g włóczka ombre</h2><p>Włóczka ombre Bilum Yarns Bataplai 200g barwiona jest w taki sposób aby uzyskać gradientowe, płynne przejście koloru. Bazą w tej włóczce jest mieszanka wełny merino z jedwabiem i kaszmirem. Dzięki czemu jest niezwykle miękka i przyjemna w dotyku z lekkim połyskiem i śliskością jedwabiu.</p><p>Dostępna w różnych wielkościach motków – 100g, 200g, 300g</p><p>Włóczka barwiona gradientowo będzie pięknie wyglądać zwłaszcza w chustach i szalach, jak np w projekcie <strong>Stephen West Honeycombs Shawl</strong>, Wzór do nabycia na Raverty <strong><em><a href=\"https://www.ravelry.com/patterns/library/painting-honeycombs-shawl---big-honeycombs\" target=\"_blank\" rel=\"noreferrer noopener\">TUTAJ</a></em></strong></p><p>Komplet włóczek tej chusty to Bilum Yarns Bataplai gradinet i Bilum Bataplai precel. Dla dużej chusty należy przyjąć 200g wersji gradientowej, możesz kupić od razu duży motek 200g oraz 100g wersj...</p>','\n                <p>Motek 200g = 800m</p><p>skład : 70% wełna merino, 20% jedwab, 10% kaszmir, barwienie gradientowe</p><p><strong>W przypadku braku produktu na magazynie – </strong></p><p><strong>TERMIN REALIZACJI ZAMÓWIEŃ PRE-ORDER – OK 6-8 TYGODNI</strong></p>\n            ','bilum-yarns-bataplai-200g','','','','Bilum Yarns Bataplai 200g','','','',''),(228,1,1,'<h2>Bilum Yarns Bataplai 100g włóczka gradientowa</h2><p>Motki włóczki Bilum Yarns Bataplai barwione są w taki sposób aby uzyskać gradientowe przejście koloru. Bazą w tej włóczce jest mieszanka wełny merino z jedwabiem i kaszmirem. Dzięki czemu jest niezwykle miękka i przyjemna w dotyku z lekkim połyskiem i śliskością jedwabiu.</p><p>Dostępna w różnych wielkościach motków – 100g, 200g, 300g</p><p>Włóczka barwiona gradientowo będzie pięknie wyglądać zwłaszcza w chustach i szalach, jak np w projekcie <strong>Stephen West Honeycombs Shawl</strong>, Wzór do nabycia na Raverty <strong><em><a href=\"https://www.ravelry.com/patterns/library/painting-honeycombs-shawl---big-honeycombs\" target=\"_blank\" rel=\"noreferrer noopener\">TUTAJ</a></em></strong></p><p>Komplet włóczek tej chusty to Bilum Yarns Bataplai gradinet i <em><strong><a href=\"https://miedzydrutami.pl/bilum-bataplai-jednobarwan-wloczka/\" target=\"_blank\" rel=\"noreferrer noopener\">Bilum Bataplai precel</a></strong></em></p>','\n                <p>Niesamowite barwienie gradientowe z płynnym przejściem koloru</p><p>Motek 100g = 400m</p><p>skład : 70% wełna merino, 20% jedwab, 10% kaszmir, barwienie gradientowe</p><p><strong>W przypadku braku produktu na magazynie – </strong></p><p><strong>TERMIN REALIZACJI ZAMÓWIEŃ PRE-ORDER – OK 6-8 TYGODNI</strong></p>\n            ','bilum-yarns-bataplai-100g','','','','Bilum Yarns Bataplai 100g','','','',''),(229,1,1,'<h2>Jednobarwne precle Bilum Yarns Bataplai</h2><p>Jednobarwne motki Bilum Yarns Bataplai stanowią bazowe tło dla motków Bilum Bataplai gradient. W bazie mamy ten sam rodzaj włóczki, więc używając obu farbowań motków Bataplai w jednej dzianinie mamy pewność co do jednolitości ściegu.</p><p>Bazą w tej włóczce jest mieszanka wełny merino z jedwabiem i kaszmirem. Dzięki czemu jest niezwykle miękka i przyjemna w dotyku z lekkim połyskiem i śliskością jedwabiu.</p><p>Z włóczki barwionej gradientowo i wersji jednobarwnej możemy stworzyć na chustę jak w projekcie <strong>Stephen West Honeycombs Shawl</strong>, Wzór do nabycia na Raverty <strong><em><a href=\"https://www.ravelry.com/patterns/library/painting-honeycombs-shawl---big-honeycombs\" target=\"_blank\" rel=\"noreferrer noopener\">TUTAJ</a></em></strong></p><p>W dzianinach robionych bezszwowo, każdą metodą, czy to raglanem, czy contiguous lub z z okrągłym karczkiem, włóczka  Bataplai wygląda również rew...</p>','\n                <p>Jednobarwne motki pasujące charakterem do motków gradientowych Bataplai</p><p>100g = 400m</p><p>skład : 70% wełna merino, 20% jedwab, 10% kaszmir</p><p><strong>W przypadku braku produktu na magazynie – </strong></p><p><strong>TERMIN REALIZACJI ZAMÓWIEŃ PRE-ORDER – OK 6-8 TYGODNI</strong></p>\n            ','bilum-yarns-bataplai-jednobarwne','','','','Bilum Yarns Bataplai jednobarwne','','','',''),(230,1,1,'<h2>Manada Pascuali luksusowa włóczka moherowa z jedwabiem</h2><p>Włóczka Manada łączy puszysty koźlęcy moher z kóz angorskich, lśniący jedwab morwowy, cenną wełnę yaka i certyfikowaną, organiczną wełnę merynosów w cienką przędzę z mocno skręconymi nitkami. Manada Pascuali posiada również wyważoną ilość włosa, który nie jest zbyt długi.</p><p>Ta wyjątkowa, luksusowa przędza jest przede wszystkim niezwykle miła w dotyku, delikatna niczym piórko. Manada jest idealnym wyborem, jeśli popularne włóczki typu kid-silk podrażniają Twoją skórę, to koniecznie musisz poczuć jej niezwykły jedwabisto – kaszmirowy dotyk.</p><p>Manada to bardzo uniwersalna, o szerokim zastosowaniu włóczka. Można ją przerabiać samodzielnie i w zależności od rozmiaru drutów uzyskać gęsty, ciepły lub lekki, zwiewny wzór ściegu. Można ją połączyć z inną włóczką marki Pascuali, jak <em><strong><a href=\"https://miedzydrutami.pl/pinta-pascuali-wloczka-welniana/\"></a></strong></em></p>','\n                <p>Luksusowe, miękkie jak piórko połączenie moheru, jedwabiu, wełny merino i yaka</p><p>25g / 200m, druty 2,5 – 4mm<br />\nSkład: 45% moher superkid, 25% jedwab morwowy, 15% organiczne merino, 15% yak</p>\n            ','manada-pascuali','','','','Manada Pascuali','','','',''),(231,1,1,'<h2>Saffira Pascuali włóczka merino z jedwabiem</h2><p>Saffira Pascuali jest prawdziwym klejnotem wśród naszej oferty. Ta niezwykła włóczka składa się z ultra delikatnego merino o grubości 16,5 mikrona z certyfikatem GOTS i jedwabiu morwowego.</p><p>Pęknie wyglądać będzie w każdym rodzaju dzianiny, ale ze względu na swoją wyjątkową miękkość polecamy ją w szczególności na te, które nosimy bezpośrednio na ciele.</p><p>Połączenie włókien w Saffirze tworzy z niej włóczkę całoroczną. Wełna merino posiada właściwości termoregulacyjne, a jedwab morwowy nadaje jej najwyższe luksusowe właściwości zarówno pod względem wyglądu, jak i dotyku. Chociaż jedwab morwowy jest bardzo delikatnym włóknem, jest również bardzo wytrzymały. Jest wyjątkowo gładki i miękki, dzięki czemu można go nosić bezpośrednio na skórze.</p><p>Saffira jest przędzą naturalną, która jest w pełni biodegradowalna. Jest również odporna na gniecenie i uszkodzenia mechaniczne, jest ...</p>','\n                <p>Saffira to najbardziej luksusowa włóczka wełniana w naszym sklepie</p><p>50g / 200m, druty 3 – 3,5mm</p><p>skład : ultra lekkie merino (16,5 mik) 75% , jedwab morwowy 25%</p>\n            ','saffira-pascuali','','','','Saffira Pascuali','','','',''),(232,1,1,'<h2>Pinta Pascuali włóczka wełniana</h2><p>To wyjątkowa włóczka o wszechstronnym zastosowaniu. Można z niej tworzyć na drutach szeroką gamę ubrań i akcesoriów, takich jak swetry, szale, chusty czy skarpetki. Włóczka wełniana Pinta Pascuali wyróżnia się na tle innych włóczek wyjątkowym składem włókien: 60% Merino, 20% Jedwab i 20% Ramia. Wełna z merynosów pochodzi z Patagonii, która jest wolna od mulesingu i certyfikowana zgodnie z RWS (Responsible Wool Standard). Dodatek jedwabiu morwowego nadaje Pincie jedwabisty połysk i gładkość, a trwałość zawdzięcza włóknom ramii.</p><p>Dzięki swoim właściwościom termoregulacyjnym Pinta jest idealną przędzą całoroczną. Bez względu na to, jak jest ciepło – z Pintą czujesz się świeżo przez cały dzień. Ponadto wykonane z niej ubrania nie gniotą się, dzięki bardzo elastycznym włóknom, które miękko przylegają do ciała nie powodując żadnych podrażnień skóry.</p><p>Pinta reprezentuje również koncepcję Pas...</p>','\n                <p>Włóczka wełniana z dodatkiem jedwabiu i ramii.</p><p>50 g / 212 m, druty 3 mm</p><p>s<span>kład: 60% wełna merino, 20% jedwab, 20% ramia</span></p>\n            ','pinta-pascuali','','','','Pinta Pascuali','','','',''),(233,1,1,'<h2>Organic Cashmere Lace Pascuali włóczka z kaszmiru 100%</h2><p>Organic Cashmere Lace marki Pascuali to wyjątkowe włókno z podszerstka kozy mongolskiej, które wytwarza się z najlepszej jakości kaszmiru na rynku. Podobnie jak Cashmere 6/28, Cashmere Lace został uprzędzony w 100% z organicznej wełny kaszmirowej, która jest certyfikowana przez <em><a href=\"https://www.mongolchamber.mn/?locale=en\" target=\"_blank\" rel=\"noreferrer noopener\"><strong>Mongolian Chamber of Commerce</strong></a></em>. Ten wysokiej jakości kaszmir wytwarza się wyłącznie z miękkiego podszerstka kozy kaszmirskiej.</p><p>Włóczkę kaszmirową Pascuali przędzie się w jednej z najlepszych włoskich przędzalni na świecie, gdzie zespół dba o każdy etap i szczegół procesu wytwarzania włóczki. Ponadto w tej przędzalni obowiązuje bardzo rygorystyczny system kontroli jakości, w którym szanowana jest naturalna żywotność włókien kaszmirowych. Po uprzędzeniu włóczka jest farbowana również we...</p>','\n                <p>Niezwykłej miękkości cienki mongolski kaszmir organiczny.</p><p>25 g / 170 m, druty: 2,5 mm</p><p>skład: 100 % kaszmir organiczny</p>\n            ','organic-cashmere-lace-pascuali','','','','Organic Cashmere Lace Pascuali','','','',''),(234,1,1,'<h2>Organic Cashmere 6/28 Pascuali włóczka z kaszmiru 100%</h2><p>Organic Cashmere 6/28 marki Pascuali to wyjątkowe włókno z podszerstka kozy mongolskiej, które wytwarza się z najlepszej jakości kaszmiru na rynku. Podobnie jak Cashmere Lace, Organic Cashmere 6/28 został uprzędzony w 100% z organicznej wełny kaszmirowej, która jest certyfikowana przez <em><a href=\"https://www.mongolchamber.mn/?locale=en\" target=\"_blank\" rel=\"noreferrer noopener\"><strong>Mongolian Chamber of Commerce</strong></a></em>. Ten wysokiej jakości kaszmir wytwarza się wyłącznie z miękkiego podszerstka kozy kaszmirskiej.</p><p>Włóczkę kaszmirową Pascuali przędzie się w jednej z najlepszych włoskich przędzalni na świecie, gdzie zespół dba o każdy etap i szczegół procesu wytwarzania włóczki. Ponadto w tej przędzalni obowiązuje bardzo rygorystyczny system kontroli jakości, w którym szanowana jest naturalna żywotność włókien kaszmirowych. Po uprzędzeniu włóczka jest farbowana ró...</p>','\n                <p>Niezwykłej miękkości mongolski kaszmir organiczny.</p><p>25 g / 112 m, druty: 3,0 mm</p><p>skład: 100 % kaszmir organiczny</p>\n            ','organic-cashmere-6-28-pascuali','','','','Organic Cashmere 6/28 Pascuali','','','',''),(235,1,1,'<h2>Cardiff Cashmere Curly włóczka 100% kaszmirowa</h2><p>Cardiff Cashmere Curly to włóczka 100% kaszmirowa. Ta doskonała nić jest niezwykle delikatna i miękka. W przypadku Cashmere Curly zastosowano specjalną technikę przędzenia, w związku z tym struktura włóczki jest „pętelkowa”. To faktura mocno przypominająca włóczki <em>bouclé</em>. To idealny materiał na odzież a w szczególności na: czapki, kominy, bluzki, swetry noszone blisko ciała. Wyroby wykonane z przędzy bouclé mają bogatą, teksturowaną powierzchnię, która może przypominać futro lub wełniany materiał o nieregularnym splocie. Nazwa <em>bouclé</em> pochodzi od francuskiego słowa oznaczającego „pętelkę” lub „kędzierzawy”. Ta technika przędzenia jest szczególnie ceniona za teksturę i wygląd, który nadaje gotowym wyrobom charakterystyczny, trójwymiarowy efekt.</p><h3>Parametry Cashmere Curly:</h3><ul><li>Skład: 100% kaszmir</li><li>Waga: 25 g</li><li>Długość: 45 m</li><li>Zalecan...</li></ul>','\n                <p>100% kaszmir mongolski o strukturze pętelek <em>bouclé.</em></p><p><span>25 g / 45 m, druty 6,0 – 6,5 mm</span></p><p>100% kaszmiru</p>\n            ','cardiff-cashmere-curly','','','','Cardiff Cashmere Curly','','','',''),(236,1,1,'<h2>Cardiff Cashmere Brushlight włóczka kaszmirowa z jedwabiem</h2><p>Cardiff Cashmere Brushlight to włóczka kaszmirowa z dodatkiem jedwabiu morwowego. Ta doskonała przędza jest niezwykle delikatna i miękka. W przypadku przędzy Cashmere Brushlight zastosowano specjalny proces szczotkowania, w związku z tym struktura przędzy jest niesamowicie lekka i puszysta. To idealny materiał na odzież a w szczególności na: czapki, kominy, bluzki, swetry noszone blisko ciała.</p><h3>Parametry Cashmere Brushlight:</h3><ul><li>Skład: 82% kaszmiru, 18% jedwabiu</li><li>Waga: 25 g</li><li>Długość: 138 m</li><li>Zalecane druty: 3,5 – 4,5 mm  – zobacz nasz <em><strong><a href=\"https://miedzydrutami.pl/druty/\">DRUTY</a></strong></em></li></ul><p>Zanim rozpoczniesz dzianinę, wykonaj własną próbkę w wybranym wzorze, aby ocenić ilość oczek i przyjąć poprawną ich ilość do dalszej pracy.<br />\nW zależności od indywidualnych ustawień monitora, kolory mogą się niezn...</p>','\n                <p>Szczotkowany kaszmir mongolski z dodatkiem jedwabiu morwowego</p><p>25 g / 138 m, druty 3,5 – 4,5 mm</p><p>82% kaszmiru, 18% jedwabiu</p>\n            ','cardiff-cashmere-brushlight','','','','Cardiff Cashmere Brushlight','','','',''),(237,1,1,'<h2>Cardiff Cashmere Small włóczka kaszmirowa</h2><p>Cardiff Cashmere Small cienka włóczka kaszmirowa to doskonała przędza z czystego kaszmiru. Jest niezwykle delikatny i miękki. Ta delikatność to zasługa włókien które składają się na włóczkę. Do produkcji włóczki Casmehmere Small używane są jedynie włókna o grubości poniżej 15,5 mikrona i długości min 38mm. Więc jest to idealna włóczka na wszelkie dzianiny noszona bezpośrednio przy ciele i dla osób o wrażliwej skórze</p><p>Dostępny w szerokiej gamie kolorów, wszystkie starannie dobierane i aktualizowane zgodnie z najnowszymi trendami. Cardiff Cashmere Small możemy używać do różnych projektów, od prostych akcesoriów jak szale i czapki po bardziej skomplikowane swetry i kardigany.</p><h3>Parametry Cashmere Small:</h3><ul><li>Skład : 100% kaszmir</li><li>Waga : 25g</li><li>Długość : 170m</li><li>Zalecane druty : 2,5 -3,0 mm  – zobacz nasze <em><strong><a href=\"https://miedzydrutami.pl/dru...\"></a></strong></em></li></ul>','\n                <p>Niezwykłej miękkości cienki mongolski kaszmir uchodzący za najlepszy na świecie</p><p>25g / 170m, druty 2,5 – 3,0 mm<br />\nskład : 100% kaszmir mongolski</p>\n            ','cardiff-cashmere-small','','','','Cardiff Cashmere Small','','','',''),(238,1,1,'<h2>Cardiff Cashmere Brushmere włóczka kaszmirowa</h2><p>Cardiff Cashmere Brushmere włóczka kaszmirowa to doskonała przędza z czystego kaszmiru. Jest niezwykle delikatny i miękki. Ta delikatność to zasługa włókien które składają się na włóczkę. Cashmere Brushmere został poddany procesowi szczotkowania przez co włóczka ma ma puszystą i lekką strukturę. To idealny materiał na czapki, kominy, jak również na swetry noszone blisko ciała.</p><p>Na czapkę potrzebne będą 2 motki, na komin 3 motki.</p><h3>Parametry Cashmere Brushmere:</h3><ul><li>Skład: 100% kaszmir</li><li>Waga: 25 g</li><li>Długość: 45 m</li><li>Zalecane druty: 6 – 6,5 mm – zobacz nasz <em><strong><a href=\"https://miedzydrutami.pl/druty/\">druty</a></strong></em></li></ul><p>Zanim rozpoczniesz dzianinę, wykonaj własną próbkę w wybranym wzorze, aby ocenić ilość oczek i przyjąć poprawną ich ilość do dalszej pracy.<br />\nW zależności od indywidualnych ustawień monitora, kolory mogą ...</p>','\n                <p>Szczotkowany kaszmir mongolski</p><p>25 g / 45 m, druty 6 – 6,5 mm</p><p>100% kaszmir mongolski</p>\n            ','cardiff-cashmere-brushmere','','','','Cardiff Cashmere Brushmere','','','',''),(239,1,1,'<h2>Cardiff Cashmere Classic włóczka kaszmirowa</h2><p>Cardiff Cashmere Classic włóczka kaszmirowa to doskonała przędza z czystego kaszmiru. Jest niezwykle delikatny i miękki. Ta delikatność to zasługa włókien które składają się na włóczkę. Do produkcji włóczki Casmehmere Classic używane są jedynie włókna o grubości poniżej 15,5 mikrona i długości min 38mm. Więc jest to idealna włóczka na wszelkie dzianiny noszona bezpośrednio przy ciele i dla osób o wrażliwej skórze</p><p>Dostępny w szerokiej gamie kolorów, wszystkie starannie dobierane i aktualizowane zgodnie z najnowszymi trendami. Cardiff Cashmere Classic możemy używać do różnych projektów, od prostych akcesoriów jak szale i czapki po bardziej skomplikowane swetry i kardigany.</p><h3>Parametry Cashmere Classic:</h3><ul><li>Skład : 100% kaszmir</li><li>Waga : 25g</li><li>Długość : 112m</li><li>Zalecane druty : 3,5 – 4,5 mm  – zobacz nasz <em><strong><a href=\"https://miedzydrutami.pl/...\"></a></strong></em></li></ul>','\n                <p>Niezwykłej miękkości mongolski kaszmir uchodzący za najlepszy na świecie</p><p>25g / 112m, druty 3,5 – 4,5mm<br />\nskład : 100% kaszmir mongolski</p>\n            ','cashmere-classic-cardiff','','','','Cashmere Classic Cardiff','','','',''),(240,1,1,'<h2>Bilum Yarns Bataplai 200g włóczka ombre</h2><p>Włóczka ombre Bilum Yarns Bataplai 200g barwiona jest w taki sposób aby uzyskać gradientowe, płynne przejście koloru. Bazą w tej włóczce jest mieszanka wełny merino z jedwabiem i kaszmirem. Dzięki czemu jest niezwykle miękka i przyjemna w dotyku z lekkim połyskiem i śliskością jedwabiu.</p><p>Dostępna w różnych wielkościach motków – 100g, 200g, 300g</p><p>Włóczka barwiona gradientowo będzie pięknie wyglądać zwłaszcza w chustach i szalach, jak np w projekcie <strong>Stephen West Honeycombs Shawl</strong>, Wzór do nabycia na Raverty <strong><em><a href=\"https://www.ravelry.com/patterns/library/painting-honeycombs-shawl---big-honeycombs\" target=\"_blank\" rel=\"noreferrer noopener\">TUTAJ</a></em></strong></p><p>Komplet włóczek tej chusty to Bilum Yarns Bataplai gradinet i Bilum Bataplai precel. Dla dużej chusty należy przyjąć 200g wersji gradientowej, możesz kupić od razu duży motek 200g oraz 100g wersj...</p>','\n                <p>Motek 200g = 800m</p><p>skład : 70% wełna merino, 20% jedwab, 10% kaszmir, barwienie gradientowe</p><p><strong>W przypadku braku produktu na magazynie – </strong></p><p><strong>TERMIN REALIZACJI ZAMÓWIEŃ PRE-ORDER – OK 6-8 TYGODNI</strong></p>\n            ','bilum-yarns-bataplai-200g','','','','Bilum Yarns Bataplai 200g','','','',''),(241,1,1,'<h2>Bilum Yarns Bataplai 100g włóczka gradientowa</h2><p>Motki włóczki Bilum Yarns Bataplai barwione są w taki sposób aby uzyskać gradientowe przejście koloru. Bazą w tej włóczce jest mieszanka wełny merino z jedwabiem i kaszmirem. Dzięki czemu jest niezwykle miękka i przyjemna w dotyku z lekkim połyskiem i śliskością jedwabiu.</p><p>Dostępna w różnych wielkościach motków – 100g, 200g, 300g</p><p>Włóczka barwiona gradientowo będzie pięknie wyglądać zwłaszcza w chustach i szalach, jak np w projekcie <strong>Stephen West Honeycombs Shawl</strong>, Wzór do nabycia na Raverty <strong><em><a href=\"https://www.ravelry.com/patterns/library/painting-honeycombs-shawl---big-honeycombs\" target=\"_blank\" rel=\"noreferrer noopener\">TUTAJ</a></em></strong></p><p>Komplet włóczek tej chusty to Bilum Yarns Bataplai gradinet i <em><strong><a href=\"https://miedzydrutami.pl/bilum-bataplai-jednobarwan-wloczka/\" target=\"_blank\" rel=\"noreferrer noopener\">Bilum Bataplai precel</a></strong></em></p>','\n                <p>Niesamowite barwienie gradientowe z płynnym przejściem koloru</p><p>Motek 100g = 400m</p><p>skład : 70% wełna merino, 20% jedwab, 10% kaszmir, barwienie gradientowe</p><p><strong>W przypadku braku produktu na magazynie – </strong></p><p><strong>TERMIN REALIZACJI ZAMÓWIEŃ PRE-ORDER – OK 6-8 TYGODNI</strong></p>\n            ','bilum-yarns-bataplai-100g','','','','Bilum Yarns Bataplai 100g','','','',''),(242,1,1,'<h2>Jednobarwne precle Bilum Yarns Bataplai</h2><p>Jednobarwne motki Bilum Yarns Bataplai stanowią bazowe tło dla motków Bilum Bataplai gradient. W bazie mamy ten sam rodzaj włóczki, więc używając obu farbowań motków Bataplai w jednej dzianinie mamy pewność co do jednolitości ściegu.</p><p>Bazą w tej włóczce jest mieszanka wełny merino z jedwabiem i kaszmirem. Dzięki czemu jest niezwykle miękka i przyjemna w dotyku z lekkim połyskiem i śliskością jedwabiu.</p><p>Z włóczki barwionej gradientowo i wersji jednobarwnej możemy stworzyć na chustę jak w projekcie <strong>Stephen West Honeycombs Shawl</strong>, Wzór do nabycia na Raverty <strong><em><a href=\"https://www.ravelry.com/patterns/library/painting-honeycombs-shawl---big-honeycombs\" target=\"_blank\" rel=\"noreferrer noopener\">TUTAJ</a></em></strong></p><p>W dzianinach robionych bezszwowo, każdą metodą, czy to raglanem, czy contiguous lub z z okrągłym karczkiem, włóczka  Bataplai wygląda również rew...</p>','\n                <p>Jednobarwne motki pasujące charakterem do motków gradientowych Bataplai</p><p>100g = 400m</p><p>skład : 70% wełna merino, 20% jedwab, 10% kaszmir</p><p><strong>W przypadku braku produktu na magazynie – </strong></p><p><strong>TERMIN REALIZACJI ZAMÓWIEŃ PRE-ORDER – OK 6-8 TYGODNI</strong></p>\n            ','bilum-yarns-bataplai-jednobarwne','','','','Bilum Yarns Bataplai jednobarwne','','','',''),(243,1,1,'<h2>Sole Pascuali włóczka bawełna Pima i kaszmir</h2><p>Sole Pascuali to wspaniała mieszanka delikatnej bawełny Pima i szlachetnego kaszmiru. Takie połączenie połączenie włókien występuje bardzo rzadko w przędzy bawełnianej. Mieszanka 90% peruwiańskiej bawełny Pima i 10% mongolskiego kaszmiru sprawia, że ​​Sole jest cudownie miękka. Jest to 6-warstwowa przędza z potrójnym skrętem, dzięki czemu jest mocna, a jednocześnie delikatna i błyszcząca.</p><p>Włóczka Sole jest urocza w robótce i daje piękna strukturę ściegu. Dobrze sprawdza się zarówno w przypadku dzianin ażurowych, jak i gładkich dżersejów, a także doskonale nadaje się do szydełkowania.</p><p>Sole to idealna włóczka całoroczna, zarówno do lekkich letnich topów, jak i  kardiganów i pulowerów. To także doskonały wybór na dodatki takie jak szaliki, szale czy czapki. Ponieważ jest tak miękka, jest dobrą alternatywą dla tych, którzy uważają, że czysta wełna jest zbyt drapiąca w stosu...</p>','\n                <p>Luksusowa włóczka bawełniana.</p><p>50g/140m, zalecane druty 3,5mm</p><p>Skład : 90% bawełna Pima, 10% organiczny kaszmir</p>\n            ','sole-pascuali','','','','Sole Pascuali','','','',''),(244,1,1,'<h2>Tweed Recycled Sandnes Garn</h2><p>Włóczka Tweed Recycled Sandnes Garn łączy w sobie dwa włókna wełnę i kaszmir. A co najważniejsze oba pochodzą w 100% z recyclingu, co dla osób dbających o środowisko naturalne jest bardzo istotną informacją. Włóczka jest wytwarzana zarówno z odpadów z produkcji przędzy, jak i odzieży, która została ponownie rozdrobniona na włókna</p><p>Połączenie wełny i kaszmiru daje nam wyjątkowe ciepłą i lekką włóczkę, a wykończenie tweedowe nadaje jej lekko rustykalnego charakteru. Włóczki Tweed Recycled  można użyć do każdego rodzaju dzianin jesienno-zimowych, od swetrów, chust, szalików, po czapki a nawet grube rękawiczki.</p><p>Gotowe projekty dzianin z tej włóczki znajdziecie w czasopiśmie <strong><em><a href=\"https://miedzydrutami.pl/sandnesgarn-2214-tweed-czasopismo/\" target=\"_blank\" rel=\"noreferrer noopener\">Tweed 2214</a></em></strong></p><h3>Parametry Tweed Recycled Sandnes Garn:</h3><ul><li>Skład : 80% wełna z r...</li></ul>','\n                <p>Włóczka pochodząca w 100% z recyclingu !</p><p>50g / 175m, 80% wełna, 20% kaszmir, druty 3,5 – 4mm</p>\n            ','tweed-recycled-sandnes-garn','','','','Tweed Recycled Sandnes Garn','','','',''),(245,1,1,'<div class=\"widget widget-text widget-none bg-produkte\"><div class=\"widget-inner bg-appearance\"><h2>Włóczka z wielbłąda Camel DK Pascuali</h2><p>Pascuali Camel DK to niezwykle miękka, luksusowa i dość wyjątkowa przędza pochodząca z podszerstka dwugarbnych wielbłądów występujących w regionie Alashan w Mongolii Wewnętrznej. Nazywane statkami pustyni ze względu na ich wytrzymałość i zdolność radzenia sobie z upałem i brakiem wody, wielbłądy dwugarbne są znane ze swojej długiej, lśniącej sierści. Mają dwie warstwy włosa: włos ochronny, zewnętrzny szorstki i prosty; i podszerstek, który jest miękki i delikatny. Wielbłądy dwugarbne borykają się z mroźnymi zimami i upalnymi latami, ale ich podszerstek zapewnia wyjątkową izolację, utrzymując ciepło w zimnych miesiącach i chłód w ciepłym sezonie. To właśnie tę warstwę włosia (zwaną także baby Camel) wykorzystana została we włóczce Camel DK.</p><p>Zamiast typowej przędzy pojedynczej lub splecione...</p></div></div>','\n                <p>miękka prawie jak kaszmir włóczka wielbłądzia</p><p>25g / 80m, druty 4,5 mm<br />\nSkład: 100% wełna z wielbłąda mongolskiego</p>\n            ','camel-dk-pascuali','','','','Camel DK Pascuali','','','',''),(246,1,1,'<h2>Linie 344 Starlight błyszcząca włóczka z cekinami marki On-Line</h2><p>Linie 344 Starlight to włóczka zmieniająca charakter dzianiny na wieczorowy. Jeżeli chcesz nadać bluzce, sukience, czy topowi wyjątkowego szyku i elegancji, włóczka z cekinami Linie 344 Starlight będzie świetnym wyborem. Jest ona bardzo cienka, więc przerabiamy ją razem z włóczką wiodącą uzyskując w całości efekt błysku.</p><p>Włóczka występuje w kilku wersjach błysku, srebrnym, złotym, grafitowym lub białym.</p><h3>Parametry włóczki:</h3><ul><li>Skład: 100%poliester</li><li>Waga: 25 g</li><li>Długość: 390 m</li><li>Zalecane druty: dobór drutów uzależniony od włóczki wiodącej</li></ul>','\n                <p>Błyszcząca włóczka jako dodatek do wieczorowej dzianiny.</p><p>25 g / 390 m , skład: 100% poliester</p>\n            ','on-line-blyszczaca-wloczka-z-cekinami-linie-344-starlight','','','','On-Line błyszcząca włóczka z cekinami Linie 344 Starlight','','','',''),(247,1,1,'<h2>Woolly Hugs Glitter błyszcząca włóczka fantazyjna</h2><p>Woolly Hugs Glitter to włóczka zmieniająca charakter dzianiny na wieczorowy. Jeżeli chcesz nadać bluzce, sukience, czy topowi wyjątkowego szyku i elegancji, włóczka Glitter będzie świetnym wyborem. Jest ona bardzo cienka, więc przerabiamy ją razem z włóczką wiodącą uzyskując w całości efekt błysku.</p><p>Włóczka występuje w kilku wersjach błysku, srebrnym, złotym, czerwonym, różowym, miedzianym i grafitowym.</p><h3>Parametry włóczki:</h3><p>Skład: 62% poliester, 38% poliamid<br />\nWaga: 100 g<br />\nDługość: 1000 m<br />\nZalecane druty: dobór drutów uzależniony od włóczki wiodącej</p>','\n                <p>Błyszcząca włóczka jako dodatek do wieczorowej dzianiny.</p><p>100 g / 1000 m, skład: 62% poliester, 38% poliamid</p>\n            ','woolly-hugs-glitter','','','','Woolly Hugs Glitter','','','',''),(248,1,1,'<h2>Fantazyjna włóczka ręcznie farbowana FANCY</h2><p>FANCY Wool to przyjemna w odbiorze włóczka z wełny merynosów z dodatkiem nylonu w autorskim farbowaniu od Woollala tylko dla Między Drutami. Ta wyjątkowa włóczka dostępna jest w wielu kolorach tylko i wyłącznie w naszym sklepie.</p><p>FANCY Wool, to włóczka z wełny merynosów z dodatkiem nylonu który sprawia, że nitka jest wytrzymalsza i trudniej ją zerwać, przy czym jednocześnie włóczka nie traci na swojej miękkości. Fantazyjność włóczki to przede wszystkim nietypowa struktura: cieńszy lub grubszy skręt, ozdobne nopki, miejscami przypomina przędzę boucle. Dodatkowo wyjątkowe, autorskie farbowanie. Włóczkę możesz wykorzystać jako dodatek do dzianiny, np. by stworzyć ozdobny detal na dzianinie. Świetnie sprawdzi się także jako pojedyncza nić, z której możesz wykonać sweter, szal lub chustę.</p><h3>Parametry włóczki Fancy:</h3><ul><li>Skład: 90% wełna merino superwash, 10% Nylon</li></ul>','\n                <p>Merynosowa włóczka fantazyjna o nieregularnej strukturze, dzięki której urozmaicisz swój projekt dziewiarski.</p><p>100 g / 400 m</p><p>skład: 90% merino, 10% nylon</p>\n            ','fancy-wool-wloczka-fantazyjna','','','','FANCY Wool włóczka fantazyjna','','','',''),(249,1,1,'<h2>Alpaka w wersji Bouclé Isager</h2><p><span class=\"TextRun SCXW56033993 BCX0\" lang=\"da-dk\" xml:lang=\"da-dk\"><span class=\"NormalTextRun SCXW56033993 BCX0\">Fantazyjna włóczka Boucle Isager składa się w 100% z wełny alpaki, przez co jest bardzo delikatna, niezwykle miękka z pięknie podkreślonym, lekkim skrętem boucle.</span></span></p><p>Włóczka Bouclé najlepiej sprawdza się w połączeniu z innymi włóczkami, w szczególności gładkimi dając ekscytujący efekt. Przerabiana bez dodatków Isager Bouclé świetnie nadaje się do pasków lub jako wzór w żakardach. Nie zalecana do wzorów strukturalnych, ponieważ rozpoznanie wzoru przy takim charakterze włóczki będzie utrudnione.</p><p>Część kolorów we włóczce to naturalne, niebarwione okrywy alpak.</p><p>Przędzona i farbowana w Peru.</p><h3>Parametry włóczki Bouclé:</h3><ul><li>Skład: 100 % alpaka</li><li>Waga: 50g</li><li>Długość: 175m</li><li>Próbka producenta ściegiem gładkim: ...</li></ul>','\n                <p>delikatne, miękkie bouclé z wełny alpaki</p><p>50g / 175m, druty 3,0 – 4,0mm</p><p>100% alpaka</p>\n            ','boucle-isager','','','','Bouclé Isager','','','',''),(250,1,1,'<h2>Teddy B Laines Du Nord włóczka boucle</h2><p>Fantazyjna włóczka boucle Teddy B od Laines du Nord to połączenie alpaki i wełny merino z niewielkim dodatkiem poliamidu. Dzięki niej uzyskasz w dzianinie niezwykle oryginalny charakter.</p><p>Świetna na swetry, krótkie kurteczki typu<b> chanell</b>, czapki czy szaliki. Ciepła oraz bardzo miła w dotyku.</p><h4>Parametry włóczki Teddy B:</h4><ul><li>Skład : 75% Alpaka, 10% Wełna, 15% Poliamid</li><li>Waga : 50g</li><li>Długość : 120m</li><li>Zalecane druty : 4 – 4,5mm</li><li>Próbka wg producenta 17 oczek x 19 rzędów = 10 cm x 10 cm</li><li>Na sweter w rozmiarze M potrzebne jest ok 8 motków</li></ul><p>Kraj produkcji : Włochy</p><p><b>Konserwacja</b> : zalecane pranie ręczne w płynach jak np <em><strong><a href=\"https://miedzydrutami.pl/soak-plyn-do-prania-delikatnych-rzeczy/\" target=\"_blank\" rel=\"noreferrer noopener\">Soak</a></strong></em> , do delikatnych rzeczy, skomponowany z roślinnych składnikó...</p>','\n                <p>Fantazyjna włóczka typu boucle</p><p>50g / 120m, druty 4 – 4,5mm<br />\nskład : 75% Alpaka, 10% Wełna, 15% Poliamid</p>\n            ','teddy-b-wloczka-boucle','','','','Teddy B włóczka boucle','','','',''),(251,1,1,'<h2>Palet Isager włóczka bawełniana</h2><p>Palet Isager to świetna włóczka, która sprawdzi się w okresie letnim, jak i również przez cały rok! To bawełna tasiemkowa 100%, której struktura daje niesamowity efekt w dzianinie dlatego warto wrzucić ją na druty. Charakterystyczną cechą tej włóczki jest matowe wykończenie. Możesz dziergać jedną nitką lub dwie, a także łączyć z innymi włóczkami marki Isager, np.: <a href=\"https://miedzydrutami.pl/trio-2-isager/\" target=\"_blank\" rel=\"noreferrer noopener\"><em><strong>Trio 2</strong></em></a>, <a href=\"https://miedzydrutami.pl/isager-silk-mohair/\" target=\"_blank\" rel=\"noreferrer noopener\"><em><strong>Silk Mohair</strong></em></a>, <a href=\"https://miedzydrutami.pl/japansk-bomuld-isager/\" target=\"_blank\" rel=\"noreferrer noopener\"><em><strong>Japansk Bomuld</strong></em></a>, <a href=\"https://miedzydrutami.pl/alpaca-1-isager/\" target=\"_blank\" rel=\"noreferrer noopener\"><em><strong>Alpaca 1</strong></em></a>, <a href=\"https://miedzydrutami.pl/...\"></a></p>','\n                <p>Bawełna tasiemkowa.</p><p>50 g / 160 m, druty 3,00 mm</p><p>100% bawełna</p>\n            ','palet-isager','','','','Palet Isager','','','',''),(252,1,1,'<div class=\"widget widget-text widget-none bg-produkte\"><div class=\"widget-inner bg-appearance\"><h2>Włóczka New Nepal Pascuali</h2><p>Skład przędzy Nepal Pascuali jest naprawdę niezwykły, to 60% bawełny organicznej i 40% lnu . Mieszanka sprawia, że ​​przędza jest jednocześnie sprężysta i miękka – również dzięki specjalnemu skrętowi, który nadaje włóczce Nepal szczególnie piękną i naturalną strukturę. Po zmoczeniu włóczka mięknie dając w odbiorze lekką i przyjemną dzianinę</p><p>New Nepal ma doskonałe właściwości użytkowe: bawełna przepuszcza powietrze, zawartość lnu sprawia, że ​​przędza jest przyjemna w dotyku. To sprawia, że ​​Nepal jest idealną bazą dla przewiewnych bluzek, letnich sukienek. Jednocześnie jest na tyle ciepły, że może być przyjemną włóczką przez cały rok. Świetnie łączy się z innymi włóczkami, jak np <em><strong><a href=\"https://miedzydrutami.pl/pascuali-wloczka-suave/\" target=\"_blank\" rel=\"noreferrer noopener\">Suave</a></strong>...</em></p></div></div>','\n                <p>Letnia włóczka z ekologicznych upraw o rustykalnym wyglądzie</p><p>50g / 180m, druty 3-4mm<br />\nskład : 60% bawełna organiczna, 40% len</p>\n            ','new-nepal-pascuali','','','','New Nepal Pascuali','','','',''),(253,1,1,'<h2>Włóczka Japansk Bomuld Isager</h2><p>Włóczka Japansk Bomuld Isager to japońska bawełna – niebanalna włóczka, która na pierwszy rzut oka może przypominać twardą rafię lub papier. Jednak dopiero po wypraniu gotowego projektu możesz zachwycić się miękkością tej przędzy. Wykonasz z niej projekty wiosenne oraz letnie. W połączeniu z inną przędzą otrzymasz ciekawą strukturę na dzianinie.</p><p>Bawełnę japońską można połączyć z innymi letnimi włóczkami, np. <em><strong><a href=\"https://miedzydrutami.pl/bomulin-isager/\" target=\"_blank\" rel=\"noreferrer noopener\">Bomulin</a></strong></em> a także z wełną.</p><p>W zależności od indywidualnych ustawień monitora, kolory mogą się nieznacznie różnić.</p><p>Więcej o tej włóczce dowiesz się <em><strong><a href=\"https://isagerstrik.dk/en/product/japansk-bomuld/\" target=\"_blank\" rel=\"noreferrer noopener\">TUTAJ</a></strong></em>.</p><h3>Parametry włóczki:</h3><ul><li>Skład: 100% bawełna</li><li>Waga: 50 g</li><li>Długość: 3...</li></ul>','\n                <p>Japońska bawełna</p><p>50g / 315 m, druty 3,00 mm</p><p>100 % bawełna</p>\n            ','japansk-bomuld-isager','','','','Japansk Bomuld Isager','','','',''),(254,1,1,'<h2>Włóczka Bomulin Isager</h2><p>Włóczka Bomulin Isager to kompozycja bawełny oraz lnu. To połączenie dwóch roślinnych nici nadaje przędzy ciekawą teksturę. To niebanalna włóczka, z której wykonasz lekkie i przewiewne projekty na wiosnę oraz lato – także dla dzieci.</p><p>Przędzę Bomulin można połączyć z innymi letnimi włóczkami a także z wełną. <span>Dobierając włóczkę towarzyszącą z oferty marki Isager będziemy mieć łatwiejszy wybór właściwego tonu kolorystycznego. Kierujmy się przy wyborze numerem koloru.</span></p><p>Producent podaje informację, że wysoka zawartość lnu może powodować skręcanie się projektu podczas pracy na okrągło.</p><p>W zależności od indywidualnych ustawień monitora, kolory mogą się nieznacznie różnić.</p><p>Więcej o tej włóczce dowiesz się <em><strong><a href=\"https://isagerstrik.dk/en/product/bomulin/?attribute_pa_color=62-en\"></a></strong></em></p>','\n                <p>Letnia włóczka o ciekawej strukturze.</p><p>50 g / 210 m, druty 3 mm</p><p>65% bawełna, 35% len</p>\n            ','bomulin-isager','','','','Bomulin Isager','','','',''),(255,1,1,'<h2>Trio 2 Isager</h2><p><span class=\"TextRun SCXW56033993 BCX0\" lang=\"da-dk\" xml:lang=\"da-dk\"><span class=\"NormalTextRun SCXW56033993 BCX0\"><span class=\"TextRun SCXW260722944 BCX0\" lang=\"da-dk\" xml:lang=\"da-dk\"><span class=\"NormalTextRun SCXW260722944 BCX0\">Trio 2 Isager to letnia kompozycja naturalnych włókien: lnu, bawełny i lyocellu. To włóczka, która zachwyca zarówno solo, jak i w połączeniu z innymi przędzami, np. wełną. </span></span></span></span></p><p><span class=\"TextRun SCXW56033993 BCX0\" lang=\"da-dk\" xml:lang=\"da-dk\"><span class=\"NormalTextRun SCXW56033993 BCX0\"><span class=\"TextRun SCXW260722944 BCX0\" lang=\"da-dk\" xml:lang=\"da-dk\"><span class=\"SpellingError SCXW260722944 BCX0\">Isager oferuje aż 22 warianty kolorystyczne włóczki Trio dlatego możesz tworzyć różnorodne wersje kolorystyczne.</span></span></span></span></p><p>Z tej przędzy wykon...</p>','\n                <p>Połączenie lnu, bawełny i lyocellu</p><p>50g / 175 m, druty 3,00 – 3,5 mm</p><p>50 % len, 30% bawełna, 20% lyocell</p>\n            ','trio-2-isager','','','','Trio 2 Isager','','','',''),(256,1,1,'<h2>Trio 1 Isager drobna włóczka lniana</h2><p><span class=\"TextRun SCXW56033993 BCX0\" lang=\"da-dk\" xml:lang=\"da-dk\"><span class=\"NormalTextRun SCXW56033993 BCX0\"><span class=\"TextRun SCXW260722944 BCX0\" lang=\"da-dk\" xml:lang=\"da-dk\"><span class=\"NormalTextRun SCXW260722944 BCX0\">Trio 1 Isager jest cienką  włóczką skomponowaną z lnu, bawełny i lyocellu. Może być przerabiana pojedynczą nitką, podwójną lub potrójną. Świetnie łączy się z innymi włóczkami jako nitka towarzysząca. </span></span></span></span></p><p><span class=\"TextRun SCXW56033993 BCX0\" lang=\"da-dk\" xml:lang=\"da-dk\"><span class=\"NormalTextRun SCXW56033993 BCX0\"><span class=\"TextRun SCXW260722944 BCX0\" lang=\"da-dk\" xml:lang=\"da-dk\"><span class=\"SpellingError SCXW260722944 BCX0\">Włóczka Trio  </span></span><span class=\"TextRun SCXW260722944 BCX0\" lang=\"da-dk\" xml:lang=\"da-dk\"></span></span></span></p>','\n                <p>połączenie lnu, bawełny i lyocellu</p><p>50g / 350m, druty 2,5 – 3,0mm</p><p>50 % len, 30% bawełna, 20% lyocell</p>\n            ','trio-1-isager','','','','Trio 1 Isager','','','',''),(257,1,1,'<h2>Ręcznie farbowana bawełna Araucania Huasco Cotton Kettle</h2><p>Włóczka Araucania Huasco Coton Kettle to 100% bawełna farbowana ręcznie przez rzemieślników w Chile. Cotton Kettle jest włóknem bardzo miękkim, zupełnie innym w odbiorze niż klasyczne włóczki bawełniane dostępne na rynku. Jednocześnie to włóczka dobrze skręcona, co w efekcie daje bardzo równy ścieg. Barwa w motku przenika od jaśniejszego do ciemniejszego odcienia, co nadaje tej włóczce wyjątkowego wyrazu.</p><p>Taka wersja farbowania bawełny, dodatkowo przy grubości super fine spotykana jest na rynku dość rzadko, w związku z tym Coton Kettle staje się włóczką wyjątkową.</p><p>Należy pamiętać, że włóczki farbowane ręcznie mogą wykazywać różnicę w odcieniu nawet z tej samej partii farbowania. Dlatego też zaleca się przy większym projekcie przerabianie jednocześnie z dwóch motków zmieniając nitkę co dwa rzędy aby uzyskać jednolitą dzianinę.</p><h3>Parametry włóczki Araucan...</h3>','\n                <p>Ręcznie farbowana, miękka włóczka bawełniana</p><p>100g / 440m, druty 2,25 – 3,75mm<br />\nskład : 100% bawełna z Chile</p>\n            ','araucania-huasco-cotton-kettle','','','','Araucania Huasco Cotton Kettle','','','',''),(258,1,1,'<h2>Ręcznie farbowana bawełna Araucania Huasco Coton</h2><p>Włóczka Araucania Huasco Coton to 100% bawełna farbowana ręcznie przez rzemieślników w Chile. Cotton jest włóknem bardzo miękkim, zupełnie innym w odbiorze niż klasyczne włóczki bawełniane dostępne na rynku. Jednocześnie to włóczka dobrze skręcona, co w efekcie daje bardzo równy ścieg. Barwy w motku tworzą artystyczny melanż, co nadaje tej włóczce wyjątkowego wyrazu.</p><p>Taka wersja farbowania bawełny, dodatkowo przy grubości super fine spotykana jest na rynku dość rzadko, w związku z tym Coton Kettle staje się włóczką wyjątkową.</p><p>Należy pamiętać, że włóczki farbowane ręcznie mogą wykazywać różnicę w odcieniu nawet z tej samej partii farbowania. Dlatego też zaleca się przy większym projekcie przerabianie jednocześnie z dwóch motków zmieniając nitkę co dwa rzędy aby uzyskać jednolitą dzianinę.</p><h3>Parametry włóczki Araucania Huasco Coton:</h3><ul><li>Skład: 100% bawełn...</li></ul>','\n                <p>Ręcznie farbowana, miękka włóczka bawełniana</p><p>100g / 440m, druty 2,25 – 3,25mm<br />\nskład : 100% bawełna z Chile</p>\n            ','araucania-huasco-coton','','','','Araucania Huasco Coton','','','',''),(259,1,1,'<h2>Włóczka wegańska Cumbria Pascuali</h2><p>Cumbria to niezwykle jedwabista mieszanka wysokiej jakości bawełny PIMA i wiskozy bambusowej. Takie połączenie włókien sprawia, że ​​Cumbria Pascuali jest cudownie miękką przędzą, która pod względem dotyku na skórze z łatwością może konkurować z włóczkami z merynosów i jedwabiu. Cumbria zachwyca swoją lekkością, będą jednocześnie wyjątkowo trwałą przędzą odporną na odkształcenia. Jest bardzo łatwa w obróbce więc dobrze sprawdzi się w projektach na druty jak i szydełko.</p><p>Włókna Cumbrii dają efekt chłodzenia latem, ale jej struktura ogrzeje nas również zimą. To sprawia, że ta ​​wegańska przędza jest świetną całoroczną włóczką. Odpowiednio dostosowana paleta kolorów, od delikatnych i powściągliwych po mocne i radosne, daje szerokie możliwości kreowania charakteru dzianin.</p><p>Cumbria nadaje się zarówno na topy, bluzeczki, sukienki jak i na akcesoria, takie jak szaliki czy szale. Jest przy...</p>','\n                <p>Niezwykle miękkie połączenie bawełny PIMA i włókna z bambusa.</p><p>50 g / 150 m, druty 3,0 mm</p><p>60% bawełna PIMA, 40% bambus (wiskoza)</p>\n            ','cumbria-pascuali','','','','Cumbria Pascuali','','','',''),(260,1,1,'<h2>Wyjątkowa włóczka z bawełny organicznej Suave Pascuali</h2><p>Suave to prawdziwa specjalność wśród przędz z czystej bawełny, ponieważ włókna nie są przędzone w zwykły sposób. Tutaj rodzaj bawełnianej siatki utrzymuje luźne włókna razem. Ponadto ta wegańska włóczka ma najwyższą jakość organiczną co sprawia że jest cudowna do robienia na drutach jak i również na szydełku.</p><p>Suave idealnie nadaje się na lekkie ubrania, takie jak swetry i swetry rozpinane, ale dzięki świetnemu układaniu się świetnie nadaje się również na szaliki i szale. Ponieważ włóczka jest tak miękka, można ją nosić bezpośrednio na skórze, spodoba się nawet dzieciom i osobom wrażliwym!<br />\nPo wyprasowaniu dzianina Suave uzyskuje gładką powierzchnię, natomiast po wyczesaniu dzianina staje się miękka i puszysta, a swoją miękkością przypomina kaszmir i moher. Suave jest zatem świetną alternatywą dla osób uczulonych na wełnę i wegan!</p><p>Włókna bawełniane, użyte do...</p>','\n                <p>Suave to uczucie kaszmiru wykonane z bawełny z certyfikatem GOTS!</p><p>25g / 162m, druty 3mm<br />\nskład : 100% bawełna organiczna</p>\n            ','suave-pascuali','','','','Suave Pascuali','','','',''),(261,1,1,'<h2>Włóczka bawełniana Tynn Line Sandnes Garn z lnem i wiskozą</h2><p>Tynn Line Sandnes Garn to cienka włóczka bawełniana z dodatkiem lnu i wiskozy dzięki której jest miękka i ma delikatny połysk. Natomiast dodatek lnu zapewnia tej włóczce niepowtarzalny, rustykalny charakter. Dzianiny wykonane z włóczki Tynn Line będą lekko lejące i ładnie układające się na sylwetce. Podsumowując Tynn Line to świetny wybór na lekkie letnie dzianiny jak bluzki, topy, czy sukienki. Tynn Line można przerabiać podwójną nitką uzyskując dzięki temu grubszą dzianinę. Dodatkowo połączenie dwóch nitek o różnych kolorach pozwoli na uzyskanie ciekawego efektu melanżu.</p><p>Tynn Line jest włóczką skomponowaną z 3 nitek o średnim stopniu skręcenia. Można używać jej do wzorów gładkich jak również do ażurowych. Oczka w dzianinie ułożą się niezwykle równo dając w efekcie piękną dzianinę.</p><p>Włóczka Tynn Line często występuje w dzianinach znanych projektantów. Duńs...</p>','<p>Na letnie topy, bluzeczki i sukienki</p><p>50g / 220m, skład : 53% bawełna, 33% wiskoza, 14% len, druty 3mm</p>','tynn-line-sandnes-garn','','','','Tynn Line Sandnes Garn','','','',''),(262,1,1,'<h2>Line Sandnes Garn włóczka bawełniana z lnem i wiskozą</h2><p>Włóczka bawełniana z lnem dzięki zawartości wiskozy jest miękka i ma delikatny połysk. Natomiast dodatek lnu zapewnia tej włóczce niepowtarzalny, rustykalny charakter. Dzianiny wykonane z włóczki Line będą lekko lejące i ładnie układające się na sylwetce. Podsumowując Line Sandnes Garn to świetny wybór na letnie bluzeczki, lekkie sweterki czy sukienki.</p><p>Line jest włóczką skomponowaną z 4 nitek o średnim stopniu skręcenia. Można używać jej do wzorów gładkich jak również do ażurowych. Oczka w dzianinie ułożą się niezwykle równo dając w efekcie piękną dzianinę.</p><p>Włóczka Line często występuje w dzianinach znanych projektantów. Duńska projektantka <a href=\"https://www.petiteknit.com/\">PetiteKnit</a> również użyła włóczkę Line w projektach letnich bluzek Anker’s Summer Shirt i Anker Tee.</p><p>Włóczka bawełniana z lnem Line posiada wersję na cieńsze druty – <a href=\"ht...\"></a></p>','<p>Line to świetny wybór na wiosenne i letnie dzianiny</p><p>50g / 110m, skład : 53% bawełna, 33% wiskoza, 14% len</p>','line-sandnes-garn','','','','Line Sandnes Garn','','','',''),(263,1,1,'<h2>Tykk Line włóczka bawełniana z lnem i wiskozą</h2><p>Gruba włóczka bawełniana z lnem dzięki dodatkowi wiskozy jest miękka i ma delikatny połysk. Natomiast zawartość lnu zapewnia tej włóczce niepowtarzalny, rustykalny charakter. Dzianiny wykonane z włóczki Tykk Line Sandnes Garn będą lekko lejące i ładnie układające się na sylwetce. Podsumowując Tykk Line to świetny wybór na grubsze letnie dzianiny jak również na akcesoria. W szczególności Tykk Line to idealny materiał na stylowe torebki, czy duże pojemne torby. Sprawdzi się również w podkładkach na stół. .</p><p>Tykk Line posiada ciekawą, skręconą strukturę, która daje wrażenie przestrzenności, powodując że wyroby z niej mają wyjątkowy charakter. Najładniej wygląda przerabiana wzorem gładkim. Oczka w dzianinie ułożą się niezwykle równo dając w efekcie piękną dzianinę.</p><p>Gruba włóczka bawełniana z lnem Tykk Line Sandnes Garn posiada cieńsze wersje – <a></a></p>','<p>letnia włóczka na dzianiny i akcesoria</p><p>50g / 60m, skład : 53% bawełna, 33% wiskoza, 14% len</p>','tykk-line-sandnes-garn','','','','Tykk Line Sandnes Garn','','','',''),(264,1,1,'<h2>Włóczka wegańska Cumbria Pascuali</h2><p>Cumbria to niezwykle jedwabista mieszanka wysokiej jakości bawełny PIMA i wiskozy bambusowej. Takie połączenie włókien sprawia, że ​​Cumbria Pascuali jest cudownie miękką przędzą, która pod względem dotyku na skórze z łatwością może konkurować z włóczkami z merynosów i jedwabiu. Cumbria zachwyca swoją lekkością, będą jednocześnie wyjątkowo trwałą przędzą odporną na odkształcenia. Jest bardzo łatwa w obróbce więc dobrze sprawdzi się w projektach na druty jak i szydełko.</p><p>Włókna Cumbrii dają efekt chłodzenia latem, ale jej struktura ogrzeje nas również zimą. To sprawia, że ta ​​wegańska przędza jest świetną całoroczną włóczką. Odpowiednio dostosowana paleta kolorów, od delikatnych i powściągliwych po mocne i radosne, daje szerokie możliwości kreowania charakteru dzianin.</p><p>Cumbria nadaje się zarówno na topy, bluzeczki, sukienki jak i na akcesoria, takie jak szaliki czy szale. Jest przy...</p>','\n                <p>Niezwykle miękkie połączenie bawełny PIMA i włókna z bambusa.</p><p>50 g / 150 m, druty 3,0 mm</p><p>60% bawełna PIMA, 40% bambus (wiskoza)</p>\n            ','cumbria-pascuali','','','','Cumbria Pascuali','','','',''),(265,1,1,'<h2>Druty Addi CraSyTrio Bamboo</h2><p>Druty Addi CraSyTrio Bamboo to zestaw 3 drutów do przerabiania dzianiny w okrążeniach. Igły klasycznej długości 13 cm połączono krótką żyłką aby ułatwić pracę na małych obwodach.</p><p>Długość drutów to 13 cm. Dodatkowo połączone są wyjątkowo elastyczna żyłką, która nie skręca się i nie załamuje, nawet przy wieloletnim używaniu. Należy pamiętać, że podana długość  cm liczona jest wraz z drutami.</p><p>Wyjątkowe druty bambusowe są nowatorskim rozwiązaniem, aby umożliwić przyjemną i nie męczącą pracę dziewiarską. Addi CraSyTrio są drutami niezwykle dopracowanymi, są lekkie oraz idealnie gładkie. Co ważne, łączenie igieł z żyłką jest perfekcyjne, w skutek czego oczka na połączeniu przesuwają się bardzo swobodnie, nie zahaczając o połączenie.</p><h2>Druty Addi – o marce</h2><p>Marka Addi to niemiecka firma produkująca druty o szerokim przekroju od metalowych po drewniane. Godnym uwagi są zestawy drutów...</p>','\n                <p>Zestaw 3 drutów do przerabiania małych obwodów, takich jak: czapka, rękaw, rękawiczki czy skarpetki.</p>\n            ','druty-addi-crasytrio-bamboo','','','','Druty Addi CraSyTrio Bamboo','','','',''),(266,1,1,'<h2>Druty KnitPro Ginger na żyłce 60cm</h2><p>Druty KnitPro Ginger 60cm wykonane z laminowanego drewna brzozowego. Są ciepłe w dotyku jednocześnie o pięknym wyglądzie. Na uwagę zasługuje perfekcyjnie dopracowana końcówka igieł, którą z wielką łatwością wsuniemy w oczko. Co znacząco ułatwia robienie na drutach, nawet kiedy używamy skomplikowanych ściegów ażurowych czy warkoczowych.</p><p>Każda igła posiada laserowe oznaczenie wielkości, aby szybko i sprawnie odszukać właściwy rozmiar.</p><p>Igły o długości 13cm połączone elastyczną, niezałamującą się żyłką, która wraz z drutami ma długość 60cm</p>','\n                <p>Piękne, drewniane druty z laminowanego drewna brzozowego</p>\n            ','druty-knitpro-ginger-60cm','','','','Druty KnitPro Ginger 60cm','','','',''),(267,1,1,'<h2>Druty KnitPro Ginger na żyłce 40cm</h2><p>Krótkie druty KnitPro Ginger 40cm wykonane z laminowanego drewna brzozowego. Mniejsza długość igły tj 8cm ułatwia w przerabianie mniejszych obwodów.</p><p>Drewniane druty są ciepłe w dotyku jednocześnie o pięknym wyglądzie. <span>Na uwagę zasługuje perfekcyjnie dopracowana końcówka igieł, którą z wielką łatwością wsuniemy w oczko. Co znacząco ułatwia robienie na drutach, nawet kiedy używamy skomplikowanych ściegów ażurowych czy warkoczowych.</span></p><p>Każda igła posiada laserowe oznaczenie wielkości, aby szybko i sprawnie odszukać właściwy rozmiar.</p><p>Krótkie igły o długości 8cm połączone elastyczną, niezałamującą się żyłką, która wraz z drutami ma długość 40cm</p>','\n                <p>Krótkie, drewniane druty z laminowanego drewna brzozowego</p>\n            ','druty-knitpro-ginger-40cm','','','','Druty KnitPro Ginger 40cm','','','',''),(268,1,1,'<h2>Druty KnitPro Cubics na żyłce 60cm</h2><p>Drewniane druty o kwadratowym przekroju, dzięki któremu oczka przesuwają się bardzo swobodnie. Jednocześnie przy takim kształcie dłonie nie odczuwają zmęczenia nawet przy długotrwałej pracy. Druty KnitPro Cubics 60cm na żyłce wykonane z trwałego, laminowanego drewna brzozowego, które gwarantuje cichą pracę oraz przyjemny dotyk.</p><p>Kwadratowy kształt w igły zwęża się w okrągłą końcówkę, a wypolerowana powierzchnia drewna sprawia, że robienie na drutach odbywa się bez większego wysiłku z każdym rodzajem włóczki. Rozmiar drutów mierzony po przekątnej co odpowiada klasycznej igle okrągłej.</p><p>Każda igła posiada laserowe oznaczenie wielkości, aby ułatwić rozpoznanie właściwego rozmiaru. Igły o długości 13cm połączone elastyczną żyłką, która wraz z drutami ma długość 60cm</p><p>Druty KnitPro Cubics dostępne w rozmiarach ze skokiem co 0,5mm.</p>','\n                <p>Drewniane druty o kwadratowym przekroju</p>\n            ','druty-knitpro-cubics-60cm','','','','Druty KnitPro Cubics 60cm','','','',''),(269,1,1,'<h2>Druty KnitPro Ginger na żyłce 80cm</h2><p>Druty KnitP