            ','druty-addi-crasytrio-bamboo','','','','Druty Addi CraSyTrio Bamboo','','','',''),(282,1,1,'<h2>Druty skarpetkowe Mindful 15 cm KnitPro</h2><p>Druty skarpetkowe Mindful 15 cm zostały wykonane ze stali nierdzewnej, dzięki czemu są idealnie gładkie. Dość ostro zakończona igła ułatwia prowadzenie wymagających ściegów, jak również przerabiania drobnych włóczek. Każda igła posiada laserowe oznaczenie wielkości, aby szybko i sprawnie odszukać właściwy rozmiar. Dodatkowo na każdej igle umieszczono również słowo będące inspiracją do dalszego działania.</p><p>Druty skarpetkowe znane również pod nazwą druty pończosznicze stanowią idealne narzędzie do dziergania małych obwodów jak skarpetki, rękawiczki, rękawy, czapki, a także kominy.</p><p>Na uwagę zasługuje perfekcyjnie dopracowana końcówka igieł, którą z wielką łatwością wsuniemy w oczko. Co znacząco ułatwia robienie na drutach, nawet kiedy używamy skomplikowanych ściegów ażurowych czy warkoczowych.</p><p><strong>Komplet składa się z 5 szt. dwustronnie zaostrzonych drutów o długości c...</strong></p>','\n                <p>Druty pończosznicze o długości 15 cm wykonane ze stali nierdzewnej.</p>\n            ','druty-skarpetkowe-mindful-15-cm-knitpro','','','','Druty skarpetkowe Mindful 15 cm KnitPro','','','',''),(283,1,1,'<h2>Zestaw drutów pończoszniczych Mindful Grateful</h2><p>Zestaw drutów Mindful Grateful zawiera aż 7 rozmiarów drutów pończoszniczych o długości<strong> 15cm</strong>.  Zaostrzone , krótkie igły ułatwiają pracę w okrążeniach na niewielkich obwodach, jak czapka , rękawiczki , skarpetki czy rękawy. Dzięki niewielkiemu etui w których zapakowana jest całość, łatwo zmieścić je w torbie dziewiarskiej i zabrać w każde miejsce w którym chcesz tworzyć swój dziewiarski projekt</p><p>Każda igła posiada laserowo umieszczony rozmiar średnicy drutów, dzięki czemu szybko odnajdziemy właściwą do pracy igłę. Druty wykonane ze stali nierdzewnej ze średnio ostrym, obustronnym zakończeniem</p><p>Dodatkowo dołąc