ydełkowania.</span></p>','\n                <p>Drewniane trzony Oasis do wymiennych szydełek zostały wykonane z gładkiego drewna brzozowego w pięknych odcieniach szarego onyksu i róży.</p>\n            ','knitpro-oasis-raczka-do-szydelka','','','','KnitPro Oasis rączka do szydełka','','','',''),(317,1,1,'<h2>Zestaw szydełek wymiennych KnitPro Oasis Starter</h2><p>KnitPro Oasis Starter to idealny zestaw „dla początkujących” oraz dla każdego, kto chce wypróbować wymienne szydełka w kolorze różowego złota. Zestaw zawiera metalowe szydełka w 7 rozmiarach. W zestawie uchwyt z drewna w kolorze szarego onyksu oraz niezbędne akcesoria.</p><p>Zestaw szydełek wymiennych zapakowany w przepiękne i eleganckie etui zapinane na zamek.</p><h4>Zestaw szydełek Oasis Starter zawiera:</h4><ul><li>7 szydełek wymiennych: 2.0, 2.5, 3.0, 3.5, 4.0, 4.5, 5.0 mm</li><li>rączkę z drewna w kolorze szarego onyksu.</li><li>elegancką miarkę krawiecką w kolorze różowego złota</li><li>nożyczki w kolorze różowego złota</li><li>10 metalowych znaczników ściegów w kształcie agrafki</li></ul>','\n                <p>Zestaw metalowych szydełek wymiennych w kolorze różowego złota oraz akcesoria.</p>\n            ','zestaw-szydelek-wymiennych-knitpro-oasis-starter','','','','Zestaw szydełek wymiennych KnitPro Oasis Starter','','','',''),(318,1,1,'<h2>Zestaw szydełek wymiennych KnitPro Oasis Chunky</h2><p>Idealny zestaw „dla początkujących” oraz dla każdego, kto chce wypróbować wymienne szydełka w kolorze różowego złota. Zestaw szydełek wymiennych KnitPro Oasis Chunky zawiera metalowe szydełka w 7 rozmiarach. W zestawie uchwyt z drewna różanego oraz niezbędne akcesoria.</p><p>Zestaw szydełek wymiennych zapakowany w przepiękne i eleganckie etui zapinane na zamek.</p><h4>Zestaw szydełek Oasis Chunky zawiera:</h4><ul><li>7 szydełek wymiennych: 5.5, 6.0, 6.5, 7.0, 8.0, 9.0, 10.0 mm</li><li>rączkę z drewna różanego do wkręcania haków.</li><li>miarkę krawiecką</li><li>nożyczki w kolorze różowego złota</li><li>10 me