ć: 15 cm</li><li>11 dużych kieszeni na druty</li><li>14 mniejszych kieszeni na wymienne igły</li><li>Zapięcie na guziki, z regulacją</li><li>Materiał: autentyczna skóra najwyższej jakości</li></ul><p>Wskazówki pielęgnacyjne: produkty do pielęgnacji skóry naturalnej.</p><p>Skóra jest materiałem naturalnym, dlatego jej wygląd może różnić się w zależności od produktu.<br />\nRzeczywisty kolor produktu ...</p>','\n                <p>Duże, kompaktowe etui na druty z wymienną żyłką.</p>\n            ','etui-betina-xl-muud','','','','Etui Betina XL Muud','','','',''),(322,1,1,'<h2>EDYCJA LIMITOWANA Saturn Muud skórzana torba projektowa w nowej odsłonie</h2><p>Saturn to ręcznie robiona torba ze skóry, bez wątpienia o nietuzinkowym stylu. Idealnie nadaje się do przechowywania i przenoszenia wszystkich aktualnych Twoich projektów i niezbędnych akcesoriów, których potrzebujesz kiedy robisz na drutach czy szydełku. Torba Saturn Muud w kolorze brązowym jest bardzo starannie wykonana. Dzięki wielu detalom ułatwia zabranie ze sobą pracy gdziekolwiek tylko zechcesz, zapewniając wszystkim elementom porządek w czasie podróży. Natomiast w domu ta piękna torba zapewni dobrze przemyślane rozwiązanie do przechowywania. Już teraz w ofercie marki Muud pojawiła się EDYCJA LIMITOWANA torby Saturn Muud w 3 wersjach kolorystycznych: Whisky, Black oraz Rich Brown. Dodatkowo, torba zyskała pasek na ramię, dzięki czemu jej zastosowanie jest jeszcze bardziej wszechstronne.</p><h3>Saturn Muud living</h3><p>Przechowuj swoje piękne proj...</p>','\n                <p><span style=\"color:#339966;\"><strong>EDYCJA LIMITOWANA</strong></span></p><p>Klasyka od marki Muud w nowej odsłonie kolorystycznej Rich Brown oraz z dodatkowym paskiem na ramię.</p>\n            ','torba-saturn-muud-edycja-limitowana','','','','Torba Saturn Muud edycja limitowana','','','',''),(323,1,1,'<h2>PetiteKnit kosmetyczka z akcesoriami Night Sky</h2><p>PetiteKnit kosmetyczka z akcesoriami Night Sky to idealne rozwiązanie dla dzi