nieba</li><li>Materiał: 100% bawełna organiczna</li><li>Wyprodukowano w Indiach, w fabryce odpowiedzialnej społecznie...</li></ul>','\n                <p><strong>EDYCJA LIMITOWANA!</strong></p><p>Bawełniana torba dla dziewiarek z logo PetiteKnit w kolorze nocnego nieba.</p>\n            ','petiteknit-tote-bag-night-sky','','','','PetiteKnit Tote Bag Night Sky','','','',''),(325,1,1,'<h2>PetiteKnit torba projektowa Night Sky pikowana</h2><p>PetiteKnit torba projektowa Night Sky to idealne rozwiązanie dla dziewiarek, które chciałyby mieć pod ręką aktualną robótkę na drutach lub szydełku, a także niezbędne narzędzia dziewiarskie, np. nożyczki, miarkę dziewiarską lub druty. Mała torba projektowa została uszyta z miękkiej, organicznej, pikowanej bawełny. Dodatkowo torba posiada wewnętrzne kieszenie, dzięki czemu można łatwo uporządkować wszystkie dziewiarskie akcesoria. Dno torby jest w kształcie koła dodatkowo zamyka się poprzez ściągnięcie bawełnianego troczka.</p><p>Więcej na temat tego produktu dowiesz się <a href=\"https://www.petiteknit.com/en/products/knitters-project-bag-night-sky?variant=49436786655568\" target=\"_blank\" rel=\"noreferrer noopener\"><em><strong>TUTAJ.</strong></em></a></p><h3>Parametry torby projektowej:</h3><ul><li>Rozmiar: 22 x 27 cm</li><li>Kolor torby: granatowy</li><li>Materiał: 100% bawełna organiczna </li></ul>','\n                <p><strong>EDYCJA LIMITOWANA!</strong></p><p>Torba projektowa PetiteKnit z wysokiej jakości bawełny. Pomieści małą i dużą robótkę. W kolorze granatowym.</p>\n            ','petiteknit-torba-projektowa-night-sky','','','','PetiteKnit torba projektowa Night Sky','','','',''),(326,1,1,'<h2>PetiteKnit etui na druty i akcesoria Night Sky</h2><p>PetiteKnit etui na druty i akcesoria wykonane z ekologicznej bawełny. W etui są miejsca na druty ze stałą żyłką, igły pończosznicze, druty wymienne i dodatkowe żyłki. Ponadto znajdują się w niej kieszonki na najpotrzebniejsze akcesoria, takie jak nożyczki, druciki i znaczniki 