nia, a także małe gadżety dziewiarskie.</p>\n            ','etui-carla-muud','','','','Etui Carla Muud','','','',''),(328,1,1,'<h2>PetiteKnit duża kosmetyczka Striped See pikowana</h2><p>PetiteKnit duża kosmetyczka Striped See to idealne rozwiązanie dla dziewiarek, które chciałyby mieć pod ręką niezbędne narzędzia dziewiarskie, np. nożyczki, miarkę dziewiarską lub druty. Duża kosmetyczka/euti na dziewiarskie gadżety została uszyta z miękkiej, organicznej, pikowanej bawełny. Dodatkowo etui zamyka się na zamek błyskawiczny.</p><p>Więcej na temat tego produktu dowiesz się <a href=\"https://www.petiteknit.com/en/products/knitters-tool-clutch-striped-seersucker?variant=47837909057872\" target=\"_blank\" rel=\"noreferrer noopener\"><em><strong>TUTAJ.</strong></em></a></p><h3>Parametry etui:</h3><ul><li>Rozmiar: 5 x 11 x 17 cm</li><li>Kolor kosmetyczki: piaskowy / zakurzony błękit</li><li>Materiał: 100% bawełna organiczna <span lang=\"en-us\" xml:lang=\"en-us\">/ wypełnienie: poliester</span></li><li>Wyprodukowano w Indiach, w fabryce odpowiedzialnej społecznie, która zapewnia zdrowe i uczciwe warunki pra...</li></ul>','\n                <p><span style=\"color:#000000;\"><strong>EDYCJA LIMITOWANA!</strong></span></p><p>Bawełniana, pikowana duża kosmetyczka/etui w kolorze piasku i przydymionego błękitu.</p>\n            ','petiteknit-duza-kosmetyczka-striped-see','','','','PetiteKnit duża kosmetyczka Striped See','','','',''),(329,1,1,'<h2>Elegancka torba Dzana Muud</h2><p>Torba Dzana Muud to połączenie eleganckiej, stylowej torebki z funkcjonalnością torby projektowej. Torebka w stylu <em>handbag</em> wykonana jest ze skóry naturalnej. Wewnątrz torby znajdziesz dużą komorę oraz mniejsze kieszenie wewnętrzne, w których możesz przechowywać najcenniejsze rzeczy, takie jak telefon, portfel i klucze. Tę torbę charakteryzuje nietuzinkowy design uchwytów, które możesz ze sobą krzyżować, dzięki czemu idealnie nadają się do owinięcia wokół nadgarstka i noszenia ze sobą, gdziekolwiek się wybierasz.</p><p>Rzeczywisty kolor produktu może różnić się z uwagi na różne ustawienia monitorów.</p><h3>Wymiary i specyfikacja torby Dzana Muud:</h3><ul><li>Wysokość: 25 cm</li><li>Wysokość: 41 cm</li><li>Eleganckie uchwyty do noszenia</li><li>Bez dodatkowego paska na ramię</li><li>Materiał: skóra</li><li>Podszewka: polydrill o gładkiej powierzchni zapewniającej łatwą pielęgnację</li></ul>','\n                <p>Duża, pojemna torba skórzana, która łączy elegancję z funkcjonalnością.</p>\n            ','dzana-muud','','','','Dzana Muud','','','',''),(330,1,1,'<h2>Elegancka torba Demi Muud</h2><p>Torba Demi Muud to wyjątkowa propozycja torebki, którą nosi się na biodrach. Okrągły kształt, regulowany pasek oraz wysoka jakość i dbałość o każdy szczegół sprawiają, że torba Demi to funkcjonalny i stylowy dodatek do Twoich codziennych stylizacji. Regulowany pasek w talii możesz odpiąć w dowlonym momencie i zastąpić, krótkim paskiem, dzięki któremu torebkę na biodra przekształcisz w torebkę trzymaną w ręce. Dodatkowo wymieniając pasek na klasyczny zyskasz świetną alternatywę w stylu <em>crossbody</em>. Różne kieszenie i przegródki ułatwiają uporządkowanie rzeczy.</p><p>Rzeczywisty kolor produktu może różnić się z uwagi na różne ustawienia monitorów.</p><h3>Wymiary i specyfikacja torby Demi Muud:</h3><ul><li>Średnica: 20 cm</li><li>Szeokość: 7 cm</li><li>Elegancki uchwyt na nadgarstek</li><li>Pasek na ramię/biodra</li><li>Materiał: skóra</li><li>Podszewka: polydrill o gładkiej powierzchni zapewniają...</li></ul>','\n                <p>Torebka na biodra ze skóry naturalnej.</p>\n            ','demi-muud','','','','Demi Muud','','','',''),(331,1,1,'<h2>Pikowana torba Darcia Muud</h2><p>Torba Darcia Muud to wyjątkowa propozycja pikowanej torebki, którą wyróżnia nie tylko kunszt rzemieślniczy, lecz także oryginalny, trapezowy kształt. Torebka na ramię Darcia to funkcjonalny i stylowy dodatek do Twoich codziennych stylizacji. Wewnątrz torebki znajdziesz przeróżne kieszenie i przegródki, które ułatwiają uporządkowanie rzeczy. Darcia to torba wszechstronna, którą wykorzystasz nie tylko jako torbę projektową. Poza projektem dziewiarskim i akcesoriami przechowasz również ulubioną książkę, telefon, klucze czy inne niezbędne przedmioty. Nietuzinkowe uchwyty nadają torbie charakteru, a także poszerzają jej funckjonalność. W razie potrzeby możesz dopiąć pasek i nosić torbę na ramieniu lub w stylu <em>crossbody</em>.</p><p>Rzeczywisty kolor produktu może różnić się z uwagi na różne ustawienia monitorów.</p><h3>Wymiary i specyfikacja torby Darcia Muud:</h3><ul><li>Szerokość dołu: 44 cm</li></ul>','\n                <p>Pikowana torba na ramię wykonana ręcznie ze skóry naturalnej.</p>\n            ','darcia-muud','','','','Darcia Muud','','','',''),(332,1,1,'<h2>Elegancka torebka w stylu <em>crossbody </em>Dafne Muud</h2><p>Torebka Dafne Muud to połączenie eleganckiej, stylowej torebki-listonoszki w stylu <em>crossbody</em> i funkcjonalnego etui na telefon komórkowy lub portfel. Torebka wykonana jest ze skóry naturalnej, zapinana na zamek błyskawiczny. Z zewnątrz i wewnątrz torby znajdują się dwie kieszenie również zapinane na zamek, w których schowasz drobne przedmioty codziennego użytku, takie jak: telefon, portfel, klucze czy chusteczki. Dodatkowo torebka wyposażona została w odpinany, regulowany pasek.</p><p>Rzeczywisty kolor produktu może różnić się z uwagi na różne ustawienia monitorów.</p><h3>Wymiary i specyfikacja torby Dafne Muud:</h3><ul><li>Wysokość: 19 cm</li><li>Szerokość: 5 cm</li><li>Długość: 12 cm</li><li>Regulowany oraz odpinany pasek na ramię</li><li>Zapinana na zamek</li><li>Materiał: skóra</li><li>Podszewka: polydrill o gładkiej powierzchni zapewniającej łatwą pielęgnacj...</li></ul>','\n                <p>Elegancka torebka w stylu <em>crossbody </em>wykonana ze skóry naturalnej.</p>\n            ','dafne-muud','','','','Dafne Muud','','','',''),(333,1,1,'<h2>Pleciona torba Dosy Muud</h2><p>Torba Dosy Muud to wyjątkowa propo