 HEE XL Muud brąz','','','',''),(342,1,1,'<h2><span>Mała pikowana kosmetyczka PetiteKnit Midnight Blue Flower</span></h2><p>PetiteKnit mała kosmetyczka MIDNIGHT to idealne rozwiązanie dla dziewiarek, które chciałyby mieć pod ręką niezbędne narzędzia dziewiarskie, np. nożyczki, miarkę dziewiarską, druty albo ulubioną pomadkę. Mini torebka dziewiarska powstała z pikowanej bawełny wypełnionej poliestrem. Zdobią ją piękne, niebieskie kwiaty na jasnym tle.</p><p>Więcej na temat tego produktu dowiesz się <em><strong><a href=\"https://www.petiteknit.com/en/products/knitters-tool-purse-midnight-blue-flower?variant=47551708070224\" target=\"_blank\" rel=\"noreferrer noopener\">TUTAJ</a>.</strong></em></p><h3>Parametry kosmetyczki MIDNIGHT:</h3><ul><li>Rozmiar: 12 x 18 cm</li><li>Kolor torby: kość słoniowa / granat</li><li>Materiał: 100% bawełna organiczna, wypełnienie poliester, zamek YKK</li><li>Wyprodukowano w fabryce odp...</li></ul>','\n                <p>Edycja limitowana!</p><p>Bawełniana, pikowana kosmetyczka z niebieskim, florystycznym nadrukiem</p>\n            ','petiteknit-mala-kosmetyczka-midnight','','','','PetiteKnit mała kosmetyczka MIDNIGHT','','','',''),(343,1,1,'<h2>Mała torba projektowa Saturn Mini MUUD</h2><p>Saturn Mini  to ręcznie robiona torba ze skóry, bez wątpienia o nietuzinkowym stylu. Idealnie nadaje się do przechowywania i przenoszenia wszystkich małych projektów i niezbędnych mini akcesoriów, których potrzebujesz kiedy robisz na drutach czy szydełku. Torba Saturn Mini Muud jest mini wersją popularnej torby Saturn  i może to być jedna z najsłodszych torebek, jakie stworzyła marka Muud.</p><h3>Saturn Mini Muud living</h3><p><span>Możesz nosić tą torbę jak listonoszkę. Zaprojektowana z praktycznymi kieszeniami zewnętrznymi i wewnętrznymi więc zapewnia miejsce na większość niezbędnych przedmiotów codziennego użytku. Dzięki dwóm otworom na górze możesz zostawić włóczkę w woreczku podczas robienia na drutach, dzięki czemu włóczka nie będzie się spląta