druty wymienne</p>\n            ','etui-billie-muud','','','','Etui Billie Muud','','','',''),(351,1,1,'<h2>Kompaktowe, skórzane etui Betina Muud</h2><p>Skórzane etui Betina Muud zapewnia wygodne i ochronne miejsce do przechowywania drutów do łączenia. Ma kompaktowy rozmiar, dzięki czemu nie zajmie zbyt wiele miejsca w Twojej torbie projektowej.</p><p>Etui zamykane jest na guzik, dzięki czemu sprzęt dziewiarski pozostanie w etui, gdy umieścisz go w torbie. Przycisk można zamknąć w dwóch rozmiarach, co pozwala wybrać przycisk pasujący do treści.</p><h3>Wymiary i specyfikacja Betina :</h3><ul><li>Wysokość: 18 cm</li><li>Długość: 13 cm</li><li>Szerokość: 5 cm</li><li>11 dużych kieszeni na druty</li><li>14 mniejszych kieszeni na wymienne igły</li><li> Zapięcie na guziki, z regulacją</li><li>Materiał – Autentyczna skóra najwyższej jakości</li></ul><p>Wskazówki pielęgnacyjne: produkty do pielęgnacji skóry naturalnej</p><p>Skóra jest materiałem naturalnym, dlatego jej wygląd może różnić się w zależności od produktu.<br />\nRzeczywisty kolor produkt...</p>','\n                <p>Kompaktowe etui na druty z wymienną żyłką</p>\n            ','etui-betina-muud','','','','Etui Betina Muud','','','',''),(352,1,1,'<h2>Bawełniane etui na druty i akcesoria PetiteKnit</h2><p><span>Materiałowe etui </span>na druty i akcesoria od PetiteKnit wykonane z ekologicznej bawełny. W etui są miejsca na druty ze stałą żyłką, igły pończosznicze, dodatkowe końcówki igieł i dodatkowe żyłki. Ponadto znajdują się w niej kieszonki na najpotrzebniejsze akcesoria, takie jak nożyczki, druciki i znaczniki ściegów. Po złożeniu etui zajmuje bardzo mało miejsca, a dla stabilnego zamknięcia całość przewiązujemy doszytą bawełnianą tasiemką.</p><h3>Parametry etui:</h3><ul><li>Rozmiar pełny, po rozłożeniu: 21 x 22 cm</li><li>Kolor torby: kość słoniowa</li><li>Jakość: 100% bawełna organiczna</li><li>Wyprodukowano w fabryce odpowiedzialnej społecznie, która zapewnia zdrowe i uczciwe warunki pracy</li></ul><p>UWAGA