ry etui:</h3><ul><li>Rozmiar pełny, po rozłożeniu: 22 x 38 cm</li><li>Kolor torby: kość słoniowa</li><li>Jakość: 100% bawełna organiczna</li><li>Wyprodukowano w fabryce odpowiedzialnej społecznie, która zapewnia zdrowe i uczciwe warunki pracy</li></ul><p>UWAGA – Wypełnienie etui w postaci drutów ma jedynie charakter poglądowy i nie stanowi kompletu oferty etui PetiteKnit</p><p>Zalecenie odnośnie prania</p><p>T...</p>','\n                <p>Materiałowe, składane etui na druty ze stałą żyłką</p>\n            ','petiteknit-etui-na-druty-z-zylka','','','','PetiteKnit etui na druty z żyłką','','','',''),(367,1,1,'<h2>Bawełniane etui na druty wymienne PetiteKnit</h2><p><span>Materiałowe etui </span>na druty wymienne od PetiteKnit wykonane z ekologicznej bawełny. Wewnątrz etui znajdziemy 12 osobnych przegród do przechowywania drutów z żyłką, dzięki któremu nasze narzędzia będą zawsze uporządkowane. Po złożeniu etui zajmuje bardzo mało miejsca, a dla stabilnego zamknięcia całość przewiązujemy doszytą bawełnianą tasiemką.</p><h3>Parametry etui:</h3><ul><li>Rozmiar pełny, po rozłożeniu: 30 x 37 cm</li><li>Kolor torby: kość słoniowa</li><li>Jakość: 100% bawełna organiczna</li><li>Wyprodukowano w fabryce odpowiedzialnej społecznie, która zapewnia zdrowe i uczciwe warunki pracy</li></ul><p>UWAGA – Wypełnienie etui w postaci drutów ma jedynie charakter poglądowy i nie stanowi kompletu oferty etui PetiteKnit</p><p>Zalecenie odnośnie prania</p><p>Torbę można prać ręcznie lun w...</p>','\n                <p>Materiałowe, składane etui na druty z wymienną żyłką</p>\n            ','petiteknit-etui-na-druty-wymienne','','','','PetiteKnit etui na druty wymienne','','','',''),(368,1,1,'<h2>Materiałowa metka Metka PetiteKnit logo</h2><p>Bawełniana, materiałowa metka PetiteKnit Logo jest wyjątkowym dodatkiem do dzianin wykonanych ręcznie. Będzie niezwykłą ozdobą w swetrach czy kardiganach podkreślając jednocześnie ich wyjątkowy charakter.</p><h3>Parametry metki PetiteKnit</h3><ul><li>materiał – tkana taśma bawełniana</li><li>kolor – ecru, nadruk czarny</li><li>wymiary – 1,5 x 5 cm</li></ul><p>PetiteKnit to uznana na całym świecie dziewiarska marka, która wspiera kreatywne osoby swoimi projektami oraz wyjątkowymi akcesoriami.</p>','\n                <p>Bawełniana metka z nadrukiem logo PetiteKnit</p>\n            ','metka-petiteknit-logo','','','','Metka PetiteKnit logo','','','',''),(369,1,1,'<h2>Podszewka French Market Bag PetiteKnit</h2><p>Gotowa, bawełniana podszewka do projektu torby French Market Bag PetiteKnit. Podszewka jest już uformowana i obszyta na brzegach, wystarczy doszyć ją do wykonanej torby French Market Bag.</p><p>Projekt torby znajdziesz <strong><a href=\"https://miedzydrutami.pl/petiteknit-french-market-bag/\" target=\"_blank\" rel=\"noreferrer noopener\">TUTAJ</a></strong><span>, a skórzany pasek do kompletu </span><a href=\"https://miedzydrutami.pl/pasek-french-market-bag-petiteknit/\" target=\"_blank\" rel=\"noreferrer noopener\"><strong>TUTAJ</strong></a></p><p>Wyprodukowana z bawełny organicznej, w kolorze ecru. W komplecie również bawełniana metka z logo PetiteKnit do wszycia wewnątrz torby</p>','\n                <p>Bawełniana podszewka do projektu PetiteKnit French Market Bag</p>\n            ','podszewka-french-market-bag-petiteknit','','','','Podszewka French Market Bag PetiteKnit','','','',''),(370,1,1,'<h2>Skórzany pasek do projektu French Market Bag PetiteKnit</h2><p>Skórzany pasek do projektu PetiteKnit French Market Bag. Komplet zawiera dwa skórzane paski w naturalnym kolorze z wybitymi otworami do przyszycia.</p><p>Każdy z nich jest o długości 94cm i szerokości 2cm</p><p>Paski wykonane ze 100% skóry licowej.</p><p>Do kompletu również możesz dołączyć podszewkę do French Market Bag, znajdziesz ją <strong><a href=\"https://miedzydrutami.pl/podszewka-french-market-bag-petiteknit/\" target=\"_blank\" rel=\"noreferrer noopener\">TUTAJ</a></strong></p><p>A wzór na French Bag Market <strong><a href=\"https://miedzydrutami.pl/petiteknit-french-market-bag/\" target=\"_blank\" rel=\"noreferrer noopener\">TUTAJ</a></strong></p>','\n                <p>Skórzany pasek do projektu PetiteKnit French Market Bag</p>\n            ','pasek-french-market-bag-petiteknit','','','','Pasek French Market Bag PetiteKnit','','','',''),(371,1,1,'<h2>Praktyczna golarka do ubrań od PetiteKnit</h2><p>Golarka do dzianin PetiteKnit zapewnia dobrą kondycję dzianin jak również innej garderoby, które podatne są na mechacenie. Dzięki niej w łatwy i szybki sposób usuniemy wszelkie zmechacenia pojawiające się wraz z użytkowaniem ubrań, jednocześnie nie niszcząc ich struktury.</p><p>Golarka posiada <strong>bardzo dużą</strong> średnicę roboczą co znacznie skraca czas jaki musimy poświęcić na odświeżenie swojej garderoby. Ostrza zabezpieczone są perforowaną metalową obudową, dzięki czemu nie ma możliwości skaleczenia się podczas jej pracy. Golarka zasilana bateriami, dzięki czemu można zabierać ją ze sobą w podróż. Ergonomiczna obudowa w białym kolorze zapewnia stabilny chwyt.</p><p>Należy pamiętać, że golarka do dzianin PetiteKnit nie powinna być stosowana do odświeżania ubrań z moheru lub z jego dodatkiem, ponieważ usunie naturalny kłaczek przędzy moherowej i sprawi, że dzianina będzie gł...</p>','\n                <p>Golarka do dzianin z bardzo dużą powierzchnią roboczą</p>\n            ','golarka-do-dzianin-petiteknit','','','','Golarka do dzianin PetiteKnit','','','',''),(372,1,1,'<h2>Żyłka pomocnicza PetiteKnit do odkładania oczek</h2><p>Żyłka pomocnicza PetiteKnit jest bardzo przydatnym akcesorium w projektach tworzonych na drutach robionych metodą bezszwową, kiedy czasowo musimy odłożyć nieprzerabiane oczka. Jednocześnie stosując żyłkę pomocniczą nic nas nie ogranicza przy przymierzaniu projektu w trakcie pracy, ponieważ jest bardzo elastyczna. Dodatkowo jej grubość ogranicza ściąganie się oczek, jak w przypadku stosowania nitki pomocniczej, więc w łatwy sposób można je przełożyć ponownie na druty robocze.</p><p>Opakowanie zawiera 5 sztuk żyłek o dwóch długościach. Należy pamiętać jednak, że żyłki pomocnicze nie zastępują żyłek roboczych montowanych do igieł drutów.</p><h3>Parametry żyłki PetiteKnit :</h3><ul><li>Średnica: 2  mm</li><li>Długość: 3 sztuki po 1 m, 2 sztuki po 1,5 m</li><li>Kolor: kremowy / toffi</li><li>Pasują do oczek przerabianych drutami od 2 do 5mm</li></ul>','\n                <p>elastyczna żyłka do odkładania oczek komplet 5 szt</p>\n            ','zylka-pomocnicza-petiteknit','','','','Żyłka pomocnicza PetiteKnit','','','',''),(373,1,1,'<h2>Gumka elastyczna PetiteKnit</h2><p>Bardzo cienka, prawie bezbarwna gumka elastyczna PetiteKnit zapewni elastyczne wykończenia Twojej dzianinie. Wciągnij ją w brzegi dzianiny, przy szyi i w mankietach za pomocą agrafki lub dziewiarskiej igły.</p><p>Zwinięta na praktycznym dyspenserze z zaczepem, który blokuje samoistne odwijanie się gumki.</p><h3>Parametry gumki PetiteKnit :</h3><ul><li>Średnica: 1 mm</li><li>Długość: 20 m</li><li>Kolor: biały transparentny</li></ul>','\n                <p>Praktyczna, prawie bezbarwna gumka do brzegów dzianiny</p>\n            ','gumka-elastyczna-petiteknit','','','','Gumka elastyczna PetiteKnit','','','',''),(374,1,1,'<h2>Materiałowa metka PetiteKnit Size</h2><p>Bawełniana, materiałowa metka PetiteKnit Size jest wyjątkowym dodatkiem do dzianin wykonanych ręcznie. Będzie niezwykłą ozdobą w swetrach czy kardiganach podkreślając jednocześnie ich wyjątkowy charakter. Dodatkowo w łatwy sposób oznaczysz rozmiar wykonanej dzianiny.</p><h3>Parametry metki PetiteKnit</h3><ul><li>materiał – tkana taśma bawełniana</li><li>kolor – ecru, nadruk czarny</li><li>wymiary – 5 x 4 cm</li><li>nadruk rozmiarów – od XS do 5XL</li></ul><p>PetiteKnit to uznana na całym świecie dziewiarska marka, która wspiera kreatywne osoby swoimi projektami oraz wyjątkowymi akcesoriami.</p>','\n                <p>Bawełniana metka z nadrukiem rozmiarów od XS do 5XL</p>\n            ','metka-petiteknit-size','','','','Metka PetiteKnit Size','','','',''),(375,1,1,'<h2>Materiałowa metka PetiteKnit Made with Love</h2><p>Bawełniana, materiałowa metka PetiteKnit Made with Love jest wyjątkowym dodatkiem do dzianin wykonanych ręcznie. Będzie niezwykłą ozdobą w swetrach czy kardiganach podkreślając jednocześnie ich wyjątkowy charakter.</p><h3>Parametry metki PetiteKnit</h3><ul><li>materiał – tkana taśma bawełniana</li><li>kolor – ecru, nadruk czarny</li><li>wymiary – 5 x 4 cm</li></ul><p>PetiteKnit to uznana na całym świecie dziewiarska marka, która wspiera kreatywne osoby swoimi projektami oraz wyjątkowymi akcesoriami.</p>','\n                <p>Bawełniana metka z nadrukiem Made with Love</p>\n            ','metka-petiteknit-made-with-love','','','','Metka PetiteKnit Made with Love','','','',''),(376,1,1,'<h2>SOAK płyn do prania bielizny i delikatnych rzeczy</h2><p>Płyn SOAK 90ml do prania dzianin, bielizny i delikatnych rzeczy powstał na bazie naturalnych składników. Jest biodegradowalny, nie zawiera optycznych wybielaczy, fosforanów, syntetycznych dodatków zapachowych dzięki temu jest w 100% przyjazny środowisku. Nawet butelka w której dostarczany jest płyn SOAK została wyprodukowana z materiałów pochodzących z recyclingu.</p><p>SOAK to idealny płyn do prania i odświeżania  :</p><ul><li>koronkowej bielizny</li><li>dziecięcych ubrań</li><li>wyrobów z wełny lub jedwabiu,</li><li>wyrobów ze skóry czy futer</li><li>dziecięcych zabawek</li><li>naturalnych pędzli do makijażu</li><li>butów skórzanych lub sportowych</li><li>wszelkich produktów dla których proszki do prania są zbyt silnym detergentem</li></ul><h2>Soak zapachy :</h2><ul><li>Celebration – słodki ale delikatny, dominująca woń czerwonej herbaty.</li><li>Lacey – świeży, wiosenny z d...</li></ul>','\n                <p>Ekologiczny płyn do prania delikatnych rzeczy</p><p>Nie wymaga płukania !</p>\n            ','soak-90ml-plyn-do-prania-delikatnych-rzeczy','','','','SOAK 90ml płyn do prania delikatnych rzeczy','','','',''),(377,1,1,'<h2>SOAK delikatny płyn do prania</h2><p>SOAK płyn do prania 5ml to płyn do prania bielizny i delikatnych rzeczy który powstał na bazie naturalnych składników. Jest biodegradowalny, nie zawiera optycznych wybielaczy, fosforanów, syntetycznych dodatków zapachowych dzięki temu jest w 100% przyjazny środowisku.</p><p>Idealny do prania i odświeżania  :</p><ul><li>koronkowej bielizny</li><li>dziecięcych ubrań</li><li>wyrobów z wełny lub jedwabiu,</li><li>wyrobów ze skóry czy futer</li><li>dziecięcych zabawek</li><li>naturalnych pędzli do makijażu</li><li>butów skórzanych lub sportowych</li><li>wszelkich produktów dla których proszki do prania są zbyt silnym detergentem</li></ul><h2>Soak płyn do prania zapachy</h2><ul><li>Celebration – słodki ale delikatny, dominująca woń czerwonej herbaty.</li><li>Lacey – świeży, wiosenny z dodatkiem słodkiej bergamotki.</li><li>Yuzu – mieszanka orientalna, japońskie cytrusy z eukaliptusem</li><li>Figowy – o...</li></ul>','\n                <p>Ekologiczny płyn do prania delikatnych rzeczy</p><p>Nie wymaga płukania !</p>\n            ','soak-plyn-do-prania-5ml','','','','SOAK płyn do prania 5ml','','','',''),(378,1,1,'<h2>SOAK płyn do prania bielizny i delikatnych rzeczy</h2><p>Płyn do prania bielizny i delikatnych rzeczy SOAK, który powstał na bazie naturalnych składników. Jest biodegradowalny, nie zawiera optycznych wybielaczy, fosforanów, syntetycznych dodatków zapachowych dzięki temu jest w 100% przyjazny środowisku. Nawet butelka w której dostarczany jest płyn SOAK została wyprodukowana z materiałów pochodzących z recyclingu.</p><p>SOAK to idealny płyn do prania i odświeżania  :</p><ul><li>koronkowej bielizny</li><li>dziecięcych ubrań</li><li>wyrobów z wełny lub jedwabiu,</li><li>wyrobów ze skóry czy futer</li><li>dziecięcych zabawek</li><li>naturalnych pędzli do makijażu</li><li>butów skórzanych lub sportowych</li><li>wszelkich produktów dla których proszki do prania są zbyt silnym detergentem</li></ul><h2>Soak zapachy :</h2><ul><li>Celebration – słodki ale delikatny, dominująca woń czerwonej herbaty.</li><li>Lacey – świeży, wiosenny z dodatkie...</li></ul>','\n                <p>Ekologiczny płyn do prania delikatnych rzeczy</p><p>Nie wymaga płukania !</p>\n            ','soak-plyn-do-prania-bielizny-i-delikatnych-rzeczy','','','','SOAK płyn do prania bielizny i delikatnych rzeczy','','','',''),(379,1,1,'<h2>Markery Zooni KnitPro komplet 7 szt.</h2><p>Znaczniki dziewiarskie są nieodłącznym elementem robótek na drutach. Ułatwiają pracę, separują segmenty, oznaczają w dzianinie strategiczne miejsca.  Markery Zooni KnitPro są bardzo uniwersalne w zastosowaniu. Zaznaczysz nimi początek rzędu oraz rozdzielisz reglan w swetrze. Ale to nie są wszystkie możliwości. Dodatkowo znaczniki są bardzo estetyczne.</p><p>Komplet zawiera 7 szt. znaczników, w tym jeden większy, który wyróżnia się od pozostłych, tak aby można było zaznaczyć np. początek rzędu.</p><p>Znaczniki można wykorzystywać do oznaczania miejsc elementów dzianiny przy tworzeniu jej metodą bezszwową, jak również w trakcie robienia rzędów skróconych.</p>','\n                <p>Przepiękne znaczniki oczek, dzięki którym z łatwością policzysz każdy reglan i zaznaczysz potrzebne miejsca w robótce.</p>\n            ','markery-zooni-knitpro-7-szt','','','','Markery Zooni KnitPro 7 szt.','','','',''),(380,1,1,'<p>Markery agrafki PetiteKnit wykonane z metalu świetnie sprawdzą się jako znaczniki dziewiarskie. W trakcie dziergania oznaczysz nimi początek/koniec rzędu, miejsce zmiany koloru, zwiększenia lub zmniejszenia w dzianinie, a także ilość przerobionych rzędów – wystarczy zapiąć agrafkę na oczku. Doskonale sprawdzą się przy zszywaniu dzianiny, ponieważ możesz użyć ich aby złapać ze sobą oczka, które wymagają zszycia.</p><p>Dzięki zaokrągleniu na końcu każdej agrafki można używać ich na grubszych drutach.</p><p>Pudełko, w którym znajdują się znaczniki zostało dostosowane do potrzeb każdej dziewiarki – z tyłu pudełka został umieszczony magnes, dzięki któremu z łatwością pozbierasz porozrzucane znaczniki, dodatkowo magnes przytrzyma dla ciebie agrafki w jednym miejscu. Spróbuj przyczepić pudełko do lodówki by zawsze było pod ręką.</p><h3>Specyfikacja produktu markery agrafki PetiteKnit:</h3><ul><li style=\"list-style-type:none;\"><ul><li></li></ul></li></ul>','\n                <p>Markery-agrafki dziewiarskie zapakowane w piękne pudełko z magnesem.</p>\n            ','markery-agrafki-petiteknit-50-szt','','','','Markery agrafki PetiteKnit 50 szt.','','','',''),(381,1,1,'<h2>Elegancka miarka dziewiarska Dana Muud</h2><p>Miarka dziewiarska Dana marki Muud to narzędzie, które z pewnością przyda się każdej dziewiarce! Dzięki miernikowi dziewiarskiemu dokonasz pomiaru liczby oczek i rzędów na centymetr w dzianinie. Wykonywanie próbek przed rozpoczęciem dziergania projektu jest niezwykle ważne, ponieważ osiągnięcie odpowiedniej ilości oczek i rzędów da Ci pewność, że ostateczny projekt będzie odpowiadał zamierzonemu rozmiarowi. Dodatkowo na podstawie ilości oczek i rzędów możesz obliczyć każdy fragment dzianiny, którą będziesz dziergać, np. ile oczek nabrać na sweter dziergany od góry do dołu.</p><p>Rzeczywisty kolor produktu może różnić się z uwagi na różne ustawienia monitorów.</p><h3>Wymiary i specyfikacja Dana Muud:</h3><ul><li>Wymiary miernika wewnątrz: 10 x 10 cm</li><li>Długość zewnętrznej krawędzi: 14 cm</li><li>Wysokość zewnętrznej krawędzi: 16 cm</li><li>Materiał: skóra</li></ul><p>Skóra jest mater...</p>','\n                <p>Miernik dziewiarski idealny do pomiaru próbki dzianiny.</p>\n            ','skorzana-miarka-dziewiarska-dana-muud','','','','Skórzana miarka dziewiarska Dana Muud','','','',''),(382,1,1,'<div id=\"description\" class=\"description\"><div class=\"item item-12\"><h2>Miarka do drutów okrągła KnitPro</h2><p>W związku z faktem, że nie wszyskie druty posiadają nadrukowany rozmiar na igle, miarka do drutów okrągła KnitPro jest bardzo przydatnym akcesorium w robótkach ręcznych</p><p>Dwustronny miernik drutów w zakresie od 2mm do 12mm. Możliwość mierzenia drutów w mm lub w rozmiarze amerykańskim (US) wyrażonym cyfrowo. Posiadając taki miernik nie mamy wątpilowści co do rozmiaru używanych do robótki ręcznej drutów.</p><p>Miarka wykonana z odpornego na uszkodzenia  tworzywa sztucznego ABS, które nie podlega odbaw...</p></div></div>','\n                <p>dwustronna miarka do grubości drutów</p>\n            ','miarka-do-drutow-okragla-knitpro','','','','Miarka do drutów okrągła KnitPro','','','',''),(383,1,1,'<h2>Nożyczki KnitPro składane Rose Gold</h2><p>To niezbędne akcesorium pracy dziewiarskiej. Nożyczki dziewiarskie KnitPro Rose Gold są składaną wersją klasycznych małych nożyczek, które zmieszczą się w każdej dziewiarskiej torbie. Jednocześnie dzięki możliwości ich złożenia stają się bezpiecznym i bardzo poręcznym narzędziem do pracy.</p><p>Uchwyty wykończone w metalicznym różowym kolorze dodają im kobiecego uroku</p><p>Zapakowane w kolorowe, materiałowe etui zapinane na suwak</p>','\n                <p>Składane nożyczki zapakowane w kolorowe etui</p>\n            ','nozyczki-dziewiarskie-knitpro-skladane','','','','Nożyczki dziewiarskie KnitPro składane','','','',''),(384,1,1,'<h2>Guziki Pszczoła złote, lakierowane na różne kolory, na nóżce 12 mm 1 szt.</h2><p>Guziki Pszczoła to świetna opcja wykończenia rozpinanego swetra lub rozpinanej bluzeczki na drutach! Wykonane są z cynku, a także szkła. W naszej ofercie dostępne w rozmiarze 12 mm. Idealnie sprawdzą się jako dodatek do kardiganów, kamizelek, a także jako element ozdobny.</p><p>Guziki są płaskie, motyw pszczoły jest lekko wypukły na nóżce, lakierowane na różne kolory.</p><h3>Opis guzika Pszczoła:</h3><ul><li>Średnica: 12 mm</li><li>Materiał: stop metali, lakierowane</li><li>Ilość dziurek: 1 (guzik jest płaski, motyw pszczoły wypukły, na nóżce z jednym otworem)</li></ul><p>W naszym sklepie znajdziesz wiele pięknych guzików, które doskonale sprawdzą się w Twoich projektach dziewiarskich i nie tylko. Zapoznaj się z ofertą guzików w naszym sklepie <a href=\"https://miedzydrutami.pl/guziki/\" target=\"_blank\" rel=\"noreferrer noopener\"><em><strong>TUTAJ</strong></em></a>.&lt;...</p>','\n                <p>Lakierowane, złote guziki z motywem pszczoły i o średnicy 12 mm.</p>\n            ','guziki-pszczola-zlote-lakierowane-1-szt','','','','Guziki Pszczoła złote lakierowane 1 szt.','','','',''),(385,1,1,'<h2>Guziki Oczko z kolorowym futerkiem 1 szt. 16 mm</h2><p>Guziki Oczko z kolorowym materiałem imitującym futerko to świetna opcja wykończenia rozpinanego swetra na drutach! Wykonane są ze stopu metali oraz poliestru. Idealnie sprawdzą się jako dodatek do kardiganów, kamizelek, a także jako element ozdobny.</p><p>Guziki są płaskie na małej nóżce, na środku mają złote oczko.</p><h3>Opis guzika Oczko:</h3><ul><li>Średnica: 16 mm</li><li>Materiał: 70% stop metali, 30% poliester</li><li>Ilość dziurek: 1 (guziki są na nóżce, płaskie z materiałem imitującym futerko)</li></ul><p>W naszym sklepie znajdziesz wiele pięknych guzików, które doskonale sprawdzą się w Twoich projektach dziewiarskich i nie tylko. Zapoznaj się z ofertą guzików w naszym sklepie <a href=\"https://miedzydrutami.pl/guziki/\" target=\"_blank\" rel=\"noreferrer noopener\"><em><strong>TUTAJ</strong></em></a>.</p><p>Oferta dotyczy 1 szt. Z uwagi na różne ustawienia monitorów kolory mogą się nie...</p>','\n                <p>Fantazyjne i nietuzinkowe płaskie guziki ze złotym oczkiem i kolorowym futerkiem 16 mm.</p>\n            ','guziki-oczko-kolorowe-1-szt','','','','Guziki Oczko kolorowe 1 szt.','','','',''),(386,1,1,'<h2>Guziki kuliste metaliczne 1 szt. 10 mm</h2><p>Guziki kuliste metaliczne to świetna opcja wykończenia rozpinanego swetra na drutach! Wykonane są ze stopu metali. Idealnie sprawdzą się jako dodatek do kardiganów, kamizelek, a także jako element ozdobny.</p><p>Guziki są wypukłe, na nóżce.</p><h3>Opis guzika:</h3><ul><li>Średnica: 10 mm</li><li>Materiał: 100% stop metali</li><li>Ilość dziurek: 1 (guziki są na nóżce, półokrągłe, wypukłe)</li></ul><p>W naszym sklepie znajdziesz wiele pięknych guzików, które doskonale sprawdzą się w Twoich projektach dziewiarskich i nie tylko. Zapoznaj się z ofertą guzików w naszym sklepie <a href=\"https://miedzydrutami.pl/guziki/\" target=\"_blank\" rel=\"noreferrer noopener\"><em><strong>TUTAJ</strong></em></a>.</p><p>Oferta dotyczy 1 szt. Z uwagi na różne ustawienia monitorów kolory mogą się nieznacznie różnić.</p>','\n                <p>Półokrągłe, połyskujące i wypukłe guziki na nóżce, 10 mm.</p>\n            ','guziki-kuliste-metaliczne-1-szt','','','','Guziki kuliste metaliczne 1 szt.','','','',''),(387,1,1,'<h2>Guziki Klejnoty złote z kolorowym oczkiem ze szkła, na nóżce 11 mm 1 szt.</h2><p>Guziki Klejnoty to świetna opcja wykończenia rozpinanego swetra lub rozpinanej bluzeczki na drutach! Wykonane są z cynku, a także szkła. W naszej ofercie dostępne w rozmiarze 11 mm. Idealnie sprawdzą się jako dodatek do kardiganów, kamizelek, a także jako element ozdobny.</p><p>Guziki są wypukłe, na nóżce, ozdobione kolorowym oczkiem ze szkła.</p><h3>Opis guzika Klejnot:</h3><ul><li>Średnica: 11 mm</li><li>Materiał: 50% cynk, 50% szkło</li><li>Ilość dziurek: 1 (guzik jest wypukły, na nóżce z jednym otworem)</li></ul><p>W naszym sklepie znajdziesz wiele pięknych guzików, które doskonale sprawdzą się w Twoich projektach dziewiarskich i nie tylko. Zapoznaj się z ofertą guzików w naszym sklepie <a href=\"https://miedzydrutami.pl/guziki/\" target=\"_blank\" rel=\"noreferrer noopener\"><em><strong>TUTAJ</strong></em></a>.</p><p>Oferta dotyczy 1 szt. Z uwagi na różne ustawieni...</p>','\n                <p>Mieniący się, ozdobny guzik ze szkła i cynku, na nóżce, o średnicy 11 mm.</p>\n            ','guziki-klejnoty-zlote-1-szt','','','','Guziki Klejnoty złote 1 szt.','','','',''),(388,1,1,'<h2>Guziki Candy z kolorowego tworzywa 1 szt.</h2><p>Guziki Candy to świetna opcja wykończenia rozpinanego swetra na drutach! Wykonane są z poliestru. W naszej ofercie dostępne w rozmiarze 15 mm. Idealnie sprawdzą się jako dodatek do kardiganów, kamizelek, a także jako element ozdobny.</p><p>Guziki są wklęsłe, posiadają dwie dziurki do przyszycia.</p><h3>Opis guzika Candy:</h3><ul><li>Średnica: 15 mm</li><li>Materiał: 100% poliester</li><li>Ilość dziurek: 2 (guziki są gładkie, wklęsłe)</li></ul><p>W naszym sklepie znajdziesz wiele pięknych guzików, które doskonale sprawdzą się w Twoich projektach dziewiarskich i nie tylko. Zapoznaj się z ofertą guzików w naszym sklepie <a href=\"https://miedzydrutami.pl/guziki/\" target=\"_blank\" rel=\"noreferrer noopener\"><em><strong>TUTAJ</strong></em></a>.</p><p>Oferta dotyczy 1 szt. Z uwagi na różne ustawienia monitorów kolory mogą się nieznacznie różnić.</p>','\n                <p>Wklęsłe guziki 15 mm, które kolorem i kształtem przypominają cukierki.</p>\n            ','guziki-candy-kolorowe-1-szt','','','','Guziki Candy kolorowe 1 szt.','','','',''),(389,1,1,'<h2>Guziki Bling złote z kolorowym szkłem, na nóżce 18 mm 1 szt.</h2><p>Guziki Bling to świetna opcja wykończenia rozpinanego swetra na drutach! Wykonane są ze stopu metali, a także szkła. W naszej ofercie dostępne w rozmiarze 18 mm. Idealnie sprawdzą się jako dodatek do kardiganów, kamizelek, a także jako element ozdobny.</p><p>Guziki są wypukłe, na nóżce, ozdobione kolorowym szkłem.</p><h3>Opis guzika Bling:</h3><ul><li>Średnica: 18 mm</li><li>Materiał: 60% stop metali 40% szkło</li><li>Ilość dziurek: 1 (guzik jest wypukły, na nóżce z jednym otworem)</li></ul><p>W naszym sklepie znajdziesz wiele pięknych guzików, które doskonale sprawdzą się w Twoich projektach dziewiarskich i nie tylko. Zapoznaj się z ofertą guzików w naszym sklepie <a href=\"https://miedzydrutami.pl/guziki/\" target=\"_blank\" rel=\"noreferrer noopener\"><em><strong>TUTAJ</strong></em></a>.</p><p>Oferta dotyczy 1 szt. Z uwagi na różne ustawienia monitorów kolory mogą się nieznacznie...</p>','\n                <p>Mieniący się, ozdobny guzik ze szkła i metalu.</p>\n            ','guziki-bling-zlote-z-kolorowym-szklem-1-szt','','','','Guziki Bling złote z kolorowym szkłem 1 szt.','','','',''),(390,1,1,'<h2>Guziki ze skorupką jajka 20 mm 1 szt.</h2><p>Guziki ze skorupką jajka to świetna opcja wykończenia rozpinanego swetra na drutach! Wykonane są ze zmielonej skorupki jajka, a także poliestru. W naszej ofercie dostępne w rozmiarze 20 mm. Idealnie sprawdzą się jako dodatek do kardiganów, kamizelek, a także jako element ozdobny.</p><p>Guziki produkuje się z drobno zmielonej skorupki jajka, którą następnie łączy się z poliestrem. Całość wygląda naprawdę niesamowicie! Guziki mają ciekawy, elegancki wygląd o unikalnej teksturze. Jaśniejsze elementy łupiny jajka tworzą na powierzchni guzika delikatny melanż kolorystyczny. Dzięki połączeniu poliestru i naturalnej skorupki, guziki charakteryzują się wysoką odpornością na uszkodzenia, a jednocześnie są przyjazne dla środowiska.</p><p>Guziki z łupiny jajka są również praktyczne i łatwe w montażu, dzięki 2 dziurkom, które zapewniają trwałe i stabilne trzymanie. Montaż guzików jest łatwy i szybki,...</p>','\n                <p>Przepiękne guziki ze skorupką jajka o średnicy 20 mm.</p><hr /><p><span style=\"color:#339966;\"><strong>Żeby zobaczyć zdjęcie guzika wybierz średnicę a później kolor, który Cię interesuje.</strong></span></p>\n            ','guziki-ze-skorupka-jajka-1-szt','','','','Guziki ze skorupką jajka 1 szt.','','','',''),(391,1,1,'<h2>Guziki z recyklingowanych butelek 15, 18 i 20 mm 1 szt.</h2><p>Odkryj unikalne guziki wykonane z recyklingowanych butelek plastikowych w różnych kolorach. Te guziki z recyklingu o średnicy 18 mm są dostępne z 4 dziurkami. Powierzchnia guzików jest gładka, z rantem. Widać na nich drobinki w delikatnie kontrastowych kolorach. Idealne do projektów rękodzielniczych, zwłaszcza do kardiganów zrobionych na drutach. Wykonane we Francji, guziki te łączą w sobie elegancję z troską o środowisko. Wybierz spośród różnorodnych kolorów, aby dodać wyjątkowy akcent swoim swetrom zrobionym na drutach. Doskonałe dla miłośników rękodzieła, projektantów mody i wszystkich, którzy cenią sobie zrównoważoną modę. Wybierając nasze guziki, wspierasz ochronę środowiska, jednocześnie zyskując oryginalny i stylowy dodatek do swojej garderoby.</p><h3>Opis guzików z recyklingu:</h3><ul><li>Średnica: 15, 18 i 20 mm</li><li>Materiał: 75% poliester, 25% politereftala...</li></ul>','\n                <p>Gładkie guziki z rantem wykonane z plastiku pochodzącego z recyklingu butelek PET.</p><hr /><p><span style=\"color:#339966;\"><strong>Żeby zobaczyć zdjęcie guzika wybierz średnicę a później kolor, który Cię interesuje.</strong></span></p>\n            ','guziki-z-recyklingowanych-butelek-1-szt','','','','Guziki z recyklingowanych butelek 1 szt.','','','',''),(392,1,1,'<h2>Guziki perłowe barwione 10, 11, 15, 20 i 25 mm 1 szt.</h2><p>Przepiękne guziki perłowe barwione, gładkie z rantem. Te eleganckie guziki z barwionej perły dostępne są w dwóch rozmiarach 11 mm oraz 25 mm. To produkt w 100% naturalny, dlatego guziki mogą się od siebie nieznacznie różnić. Idealnie sprawdzą się jako dodatek do rozpinanych swetrów, kamizelek, a także jako element ozdobny. Guziki z barwionej perły wyróżniają się eleganckim wyglądem i subtelnym połyskiem, który dodaje klasy i stylu każdemu kardiganowi, który wydziergasz. Ich gładka powierzchnia i precyzyjnie wykonany rant sprawiają, że są doskonałym wyborem do swetrów na drutach, które wymagają eleganckiego wykończenia i nie tylko. Sprawdzą się również w Twoich projektach krawieckich. Możesz też odświeżyć swoje ubrania wymieniając stare guziki na nowe.</p><p>Zróżnicowane rozmiary umożliwiają dopasowanie guzików do różnych projektów, nie tylko na drutach. Guziki z barwionej ...</p>','\n                <p>Eleganckie guziki z barwionej perły, gładkie z rantem. Idealne do kardiganów i wielu innych projektów.</p><hr /><p><span style=\"color:#339966;\"><strong>Żeby zobaczyć zdjęcie guzika wybierz średnicę a później kolor, który Cię interesuje.</strong></span></p>\n            ','guziki-perlowe-barwione-1-szt','','','','Guziki perłowe barwione 1 szt.','','','',''),(393,1,1,'<h2>Guziki ryżowe 15 mm i 20 mm 1 szt.</h2><p>Guziki ryżowe to nietuzinkowa opcja wykończenia rękodzieła! Wykonane są z łuski ryżowej, a także poliestru. W naszej ofercie dostępne w wielu ciekawych kolorach i dwóch rozmiarach: 15 oraz 20 mm. Idealnie sprawdzą się jako dodatek do rozpinanych swetrów, kamizelek, a także jako element ozdobny.</p><p>Guziki produkuje się z łuski ryżowej, która jest naturalnym odpadem po zbiorze ryżu. Następnie łuski ryżowe łączy się z poliestrem. Całość wygląda naprawdę niesamowicie! Guziki mają ciekawy, lekko ziarnisty wygląd, widoczne są drobinki ryżu. Dodatkowo pod palcami można wyczuć delikatną fakturę ziaren. Jaśniejsze ziarna tworzą na powierzchni guzika delikatny melanż kolorystyczny.</p><p>Zróżnicowane rozmiary umożliwiają dopasowanie guzików do różnych projektów, nie tylko na drutach. Guziki z łuski ryżowej są również praktyczne i łatwe w montażu, dzięki 4 dziurkom, które zapewniają trwałe i stabiln...</p>','\n                <p>Wyjątkowe guziki wykonane z ryżu dostępne w dwóch rozmiarach 15 i 20 mm.</p><hr /><p><span style=\"color:#339966;\"><strong>Żeby zobaczyć zdjęcie guzika wybierz średnicę a później kolor, który Cię interesuje.</strong></span></p>\n            ','guziki-ryzowe-1-szt','','','','Guziki ryżowe 1 szt.','','','',''),(394,1,1,'<h2>Guziki cieniowane z karbonamidu 20 i 23 mm 1 szt.</h2><p>Odkryj unikalne guziki cieniowane wykonane z karbonamidu, czyli syntetycznego mocznika. Te wyjątkowe guziki o średnicy 20 mm są dostępne z 4 dziurkami w wielu kolorach. Powierzchnia guzików jest gładka, z rantem. Idealne do projektów rękodzielniczych, zwłaszcza do kardiganów zrobionych na drutach. Wykonane we Francji, guziki te łączą w sobie elegancję z innowacją. Wybierz spośród różnorodnych cieniowanych kolorów, aby dodać wyjątkowy akcent swoim swetrom zrobionym na drutach. Doskonałe dla miłośników rękodzieła, projektantów mody i wszystkich, którzy cenią sobie zrównoważoną modę. Wybierając nasze guziki, wspierasz ochronę środowiska, jednocześnie zyskując oryginalny i stylowy dodatek do swojej garderoby.</p><h3>Opis guzików z recyklingu:</h3><ul><li>Średnica: 20 i 23 mm</li><li>Materiał: 100% karbonamid (mocznik syntetyczny)</li><li>Ilość dziurek: 4</li></ul><p>W naszym sklep...</p>','\n                <p>Przepięknie cieniowane guziki z karbonamidu o średnicy 20 mm.</p><hr /><p><span style=\"color:#339966;\"><strong>Żeby zobaczyć zdjęcie guzika wybierz średnicę a później kolor, który Cię interesuje.</strong></span></p>\n            ','guziki-cieniowane-1-szt','','','','Guziki cieniowane 1 szt.','','','',''),(395,1,1,'<h2>Guziki z kamieniem 15 i 20 mm 1 szt.</h2><p>Guziki z kamieniem to świetna opcja wykończenia rozpinanego swetra na drutach! Wykonane są z kamienia, a także włókna szklanego. W naszej ofercie dostępne w rozmiarze 15 mm. Idealnie sprawdzą się jako dodatek do rozpinanych swetrów, kamizelek, a także jako element ozdobny.</p><p>Guziki produkuje się z kamienia i włókna szklanego. To doskonałe połączenie estetyki i funkcjonalności. Produkcja tych guzików zaczyna się od starannego wyboru kamienia. Kamień jest cięty na odpowiednie kawałki, a następnie łączony z włóknem szklanym. Włókno szklane, zmieszane z żywicą, tworzy materiał kompozytowy o wysokiej odporności na uszkodzenia i działanie wysokich temperatur. Proces formowania guzików polega na wlewaniu mieszanki kamienia i włókna szklanego do form, które następnie są utwardzane. Guziki są precyzyjnie wykańczane, aby uzyskać odpowiedni efekt. W przypadku tego modelu to delikatna tekstura i m...</p>','\n                <p>Trwałe i estetyczne guziki z kamieniem o średnicy 15 i 20 mm.</p><hr /><p><span style=\"color:#339966;\"><strong>Żeby zobaczyć zdjęcie guzika wybierz średnicę a później kolor, który Cię interesuje.</strong></span></p>\n            ','guziki-z-kamieniem-1-szt','','','','Guziki z kamieniem 1 szt.','','','',''),(396,1,1,'<h2>Guziki rogowe z rogu bawolego w odcieniach brązu</h2><p>Przepiękne guziki rogowe z charakterystyczną fakturą nieregularnych linii. Guziki dostępne są w dwóch rozmiarach. To produkt w 100% naturalny dlatego guziki mogą się od siebie nieznacznie różnić, np. mogą pojawić się drobne nieregularności, rysy lub wypukłości. Idealnie sprawdzą się jako dodatek do rozpinanych swetrów, kamizelek, a także jako element ozdobny. Warto zwrócić uwagę na nietuzinkową kolorystykę guzików: wewnątrz są w kolorze bardzo ciemnego brązu, natomiast krawędzie są jasnobrązowe.</p><h3>Opis guzika:</h3><ul><li>Średnica: 20 mm oraz 25 mm</li><li>Materiał: róg bawoli</li></ul><p>W naszym sklepie znajdziesz wiele przepięknych guzików w różnych kolorach i rozmiarach <a href=\"https://miedzydrutami.pl/guziki/\" target=\"_blank\" rel=\"noreferrer noopener\"><em><strong>TUTAJ</strong></em></a>.</p><p>Oferta dotyczy 1 szt.. Z uwagi na różne ustawienia monitorów kolory mogą się nieznacz...</p>','\n                <p>Nietuzinkowe guziki rogowe w odcieniach brązu z delikatną fakturą.</p>\n            ','guziki-rogowe-ciemny-braz-20-25-mm-1-szt','','','','Guziki rogowe ciemny brąz 20/25 mm 1 szt.','','','',''),(397,1,1,'<h2>Guzik Bling PetiteKnit 1 szt.</h2><p>Przepiękny guzik Bling PetiteKnit przeznaczony do <em><strong><a href=\"https://miedzydrutami.pl/petiteknit-wzory-april-cardigan/\" target=\"_blank\" rel=\"noreferrer noopener\">kardiganu April</a> </strong></em>lub<em> <a href=\"https://miedzydrutami.pl/petiteknit-wzory-sunday-collar/\" target=\"_blank\" rel=\"noreferrer noopener\"><strong>Sunday Collar </strong></a></em>sprawdzi się również w innych Twoich dziewiarskich projektach.</p><h3>Opis guzika:</h3><ul><li>Średnica: 20 mm</li><li>Materiał: metal / szkło</li></ul><p>Decydując się na zakup otrzymasz jeden, błyszczący guzik.</p><p>Więcej o guzikach dowiesz się na stronie producenta <em><strong><a href=\"https://www.petiteknit.com/en/collections/bling/products/blingknap-til-sunday-collar?variant=39639835082807\" target=\"_blank\" rel=\"noreferrer noopener\">TUTAJ</a></strong></em>.</p>','\n                <p>Mieniący się, ozdobny guzik ze szkła i metalu.</p>\n            ','guzik-bling-petiteknit-1-szt','','','','Guzik Bling PetiteKnit 1 szt.','','','',''),(398,1,1,'<h2>Metka Handcrafted with Pascuali filati naturali</h2><p id=\"tw-target-text\" dir=\"ltr\">Metka Handcrafted with Pascuali filati naturali to idealny dodatek do Twojego projektu na drutach. Metki Pascuali stanowią świetne wykończenie i można je łatwo przyszyć wewnątrz lub na zewnątrz dzianiny. Metki mają z jednej strony napis z nazwą włóczki, a także składem i ikonografikami informującymi o praniu wyrobów z włóczek Pascuali, a z drugiej logo z napisem „handcrafted with Pascuali filati naturali”.</p><h3>Parametry metki Pascuali:</h3><ul><li>materiał – tkana taśma bawełniana</li><li>kolor – ecru, nadruk czarny oraz kolor</li><li>wymiary – 4 x 3 cm</li></ul><p>Zobacz ofertę metek do dzianin w naszym sklepie <a href=\"https://miedzydrutami.pl/metki-do-ubran/\" target=\"_blank\" rel=\"noreferrer noopener\"><em><strong>TUTAJ</strong></em></a>.</p><h2>O marce Pascuali</h2><div class=\"flex flex-grow flex-col max-w-full\"><div class=\"...&lt;/div&gt;&lt;/body&gt;&lt;/html&gt;\"></div></div>','\n                <p>Bawełniana metka z nadrukiem Handcrafted with Pascuali filati naturali.</p>\n            ','metka-handcrafted-with-pascuali-filati-naturali','','','','Metka Handcrafted with Pascuali filati naturali','','','',''),(399,1,1,'<h2>Materiałowa składana metka Metka PetiteKnit logo</h2><p>Bawełniana, materiałowa, składana metka PetiteKnit logo jest wyjątkowym dodatkiem do dzianin wykonanych ręcznie. Będzie niezwykłą ozdobą w swetrach czy kardiganach podkreślając jednocześnie ich wyjątkowy charakter.</p><h3>Parametry składanej metki PetiteKnit:</h3><ul><li>Materiał: tkana taśma bawełniana</li><li>Kolor: ecru, czarny nadruk</li><li>Wymiary: 1,5 x 2,5 cm</li></ul><p>PetiteKnit to uznana na całym świecie dziewiarska marka, która wspiera kreatywne osoby swoimi projektami oraz wyjątkowymi akcesoriami.</p><p>W naszym sklepie znajdziesz nie tylko różnorodne metki <a href=\"https://miedzydrutami.pl/akcesoria/?product_cat=metki-do-ubran&amp;pa_marka=petiteknit\" target=\"_blank\" rel=\"noreferrer noopener\"><em><strong>TUTAJ</strong></em></a>, ale również inne akcesoria marki PetiteKnit <a href=\"https://miedzydrutami.pl/akcesoria/?product_cat=akcesoria-petiteknit&amp;pa_marka=petiteknit\"></a></p>','\n                <p>Bawełniana metka PetiteKnit z logo.</p>\n            ','skladana-metka-petiteknit-logo','','','','Składana metka PetiteKnit logo','','','',''),(400,1,1,'<h2>Materiałowa metka Metka PetiteKnit „P”</h2><p>Bawełniana, materiałowa metka PetiteKnit „P” jest wyjątkowym dodatkiem do dzianin wykonanych ręcznie. Będzie niezwykłą ozdobą w swetrach czy kardiganach podkreślając jednocześnie ich wyjątkowy charakter.</p><h3>Parametry metki PetiteKnit:</h3><ul><li>Materiał: tkana taśma bawełniana</li><li>Kolor: ecru, czarny nadruk</li><li>Wymiary: 1,5 x 2,5 cm</li></ul><p>PetiteKnit to uznana na całym świecie dziewiarska marka, która wspiera kreatywne osoby swoimi projektami oraz wyjątkowymi akcesoriami.</p><p>W naszym sklepie znajdziesz nie tylko różnorodne metki <a href=\"https://miedzydrutami.pl/akcesoria/?product_cat=metki-do-ubran&amp;pa_marka=petiteknit\" target=\"_blank\" rel=\"noreferrer noopener\"><em><strong>TUTAJ</strong></em></a>, ale również inne akcesoria marki PetiteKnit <a href=\"https://miedzydrutami.pl/akcesoria/?product_cat=akcesoria-petiteknit&amp;pa_marka=petiteknit\" target=\"_blank\" rel=\"noreferrer noopener\">...</a></p>','\n                <p>Bawełniana metka PetiteKnit z nadrukiem „P”.</p>\n            ','metka-petiteknit-p','','','','Metka PetiteKnit „P”','','','',''),(401,1,1,'<h2>Materiałowa metka Metka PetiteKnit logo</h2><p>Bawełniana, materiałowa metka PetiteKnit Logo jest wyjątkowym dodatkiem do dzianin wykonanych ręcznie. Będzie niezwykłą ozdobą w swetrach czy kardiganach podkreślając jednocześnie ich wyjątkowy charakter.</p><h3>Parametry metki PetiteKnit</h3><ul><li>materiał – tkana taśma bawełniana</li><li>kolor – ecru, nadruk czarny</li><li>wymiary – 1,5 x 5 cm</li></ul><p>PetiteKnit to uznana na całym świecie dziewiarska marka, która wspiera kreatywne osoby swoimi projektami oraz wyjątkowymi akcesoriami.</p>','\n                <p>Bawełniana metka z nadrukiem logo PetiteKnit</p>\n            ','metka-petiteknit-logo','','','','Metka PetiteKnit logo','','','',''),(402,1,1,'<h2>Materiałowa metka PetiteKnit Size</h2><p>Bawełniana, materiałowa metka PetiteKnit Size jest wyjątkowym dodatkiem do dzianin wykonanych ręcznie. Będzie niezwykłą ozdobą w swetrach czy kardiganach podkreślając jednocześnie ich wyjątkowy charakter. Dodatkowo w łatwy sposób oznaczysz rozmiar wykonanej dzianiny.</p><h3>Parametry metki PetiteKnit</h3><ul><li>materiał – tkana taśma bawełniana</li><li>kolor – ecru, nadruk czarny</li><li>wymiary – 5 x 4 cm</li><li>nadruk rozmiarów – od XS do 5XL</li></ul><p>PetiteKnit to uznana na całym świecie dziewiarska marka, która wspiera kreatywne osoby swoimi projektami oraz wyjątkowymi akcesoriami.</p>','\n                <p>Bawełniana metka z nadrukiem rozmiarów od XS do 5XL</p>\n            ','metka-petiteknit-size','','','','Metka PetiteKnit Size','','','',''),(403,1,1,'<h2>Materiałowa metka PetiteKnit Made with Love</h2><p>Bawełniana, materiałowa metka PetiteKnit Made with Love jest wyjątkowym dodatkiem do dzianin wykonanych ręcznie. Będzie niezwykłą ozdobą w swetrach czy kardiganach podkreślając jednocześnie ich wyjątkowy charakter.</p><h3>Parametry metki PetiteKnit</h3><ul><li>materiał – tkana taśma bawełniana</li><li>kolor – ecru, nadruk czarny</li><li>wymiary – 5 x 4 cm</li></ul><p>PetiteKnit to uznana na całym świecie dziewiarska marka, która wspiera kreatywne osoby swoimi projektami oraz wyjątkowymi akcesoriami.</p>','\n                <p>Bawełniana metka z nadrukiem Made with Love</p>\n            ','metka-petiteknit-made-with-love','','','','Metka PetiteKnit Made with Love','','','',''),(404,1,1,'<h2>Gleener Ultimate golarka do dzianin, tkanin, ubrań, a także szczotka do usuwania sierści zwierząt</h2><p>Gleener Ultimate golarka do dzianin zapewnia dobrą kondycję dzianin jak również innej garderoby, które podatne są na mechacenie. Dzięki niej w łatwy i szybki sposób usuniesz wszelkie zmechacenia pojawiające się wraz z użytkowaniem ubrań, jednocześnie nie niszcząc ich struktury. Dodatkowo, dzięki tej innowacyjnej golarce w szybki sposób pozbędziesz się zwierzęcej sierści z dzianin, tkanin, tapicerki czy pościeli.</p><p>Dzięki 3 różnym krawędziom Fabric Safe Edges™ wyeliminujesz mechacenie, usuniesz kłaczki i sierść zwierząt z praktycznie wszystkich tkanin. Każda krawędź została zaprojektowana tak, aby delikatnie ożywić inny rodzaj tkaniny, od dużej i grubej po średnią i delikatną. Zintegrowaną szczotką do usuwania kłaczków zbierzesz sierść zwierząt, usuniesz nią także łupież z ubrań. Przedłuż żywotność wszystkich swoich ulubionych...</p>','\n                <p>Innowacyjna golarka do dzianin, która nie wymaga baterii. Wszechstronne zastosowanie także do usuwania sierści zwierząt.</p>\n            ','gleener-ultimate-golarka-do-dzianin','','','','Gleener Ultimate golarka do dzianin','','','',''),(405,1,1,'<h2>Podeszwy Botties – zrób swoje własne buty</h2><p>Podeszwy Botties wykonano z elastycznego TPU – materiału przyjaznego dla skóry, w 100% nadającego się do recyklingu i wolnego od szkodliwych substancji. Dzięki tworzywu TPU podeszwy są niezwykle trwałe i wykorzystasz je w każdym sezonie tworząc nowe buty. Dodatkowo idealnie sprawdzą się jako buty do chodzenia na zewnątrz, jak i również w zaciszu domowym.</p><p>Marka Botties oferuje wiele instrukcji, dzięki którym możesz samodzielnie uszyć, wyszydełkować lub wydziergać buty na drutach. Wbrew pozorom nie jest to wcale skomplikowane i trudne. Dodatkowo, wcale nie użyjesz kleju, ani skomplikowanych narzędzi. Wszystko, czego potrzebujesz, to szydełko, druty lub maszyna do szycia.</p><p>Projekty marki Botties opierają się na prostych i popularnych ściegach, a szycie ogranicza się do minimum. Nie musisz być mistrzem szewstwa – wystarczy odrobina cierpliwości i chęć do nauki.</p><p>Podeszwy B...</p>','\n                <p>Zrób swoje własne buty na szydełku, drutach lub maszynie wykorzystując podeszwy marki Botties.</p>\n            ','podeszwy-botties','','','','Podeszwy Botties','','','',''),(406,1,1,'<h2>Zatyczki KnitPro komplet</h2><p>Stopery do drutów w postaci silikonowych nakładek, które nasuwamy na druty. Zakładając zatyczki KnitPro na druty uniemożliwiamy oczkom zsunięcie się, które skutkowałoby zniszczeniem naszej pracy. Przydatne w szczególności kiedy nie pracujemy jakiś czas z robótką, pakujemy ją do torby np. w podróży lub w każdej innej sytuacji która mogłaby spowodować ściągnięcie oczek z drutów.</p><p>Komplet zatyczek stanowią cztery zatyczki dedykowane różnym rozmiarom drutów:</p><ul><li>Mała do drutów o średnicy 2,5 – 5 mm.</li><li>Duża do drutów o średnicy 4,5 – 10 mm.</li></ul><p>Zatyczki pasują do drutów każdej marki i ich wszystkich modeli.</p><p>Jeżeli nie masz jeszcze drutów, zobacz naszą szeroką ofertę <a href=\"https://miedzydrutami.pl/druty-do-dziergania/\" target=\"_blank\" rel=\"noreferrer noopener\"><em><strong>TUTAJ.</strong></em></a></p>','\n                <p>Komplet czterech stoperów które zabezpieczają oczka przed zsunięciem z drutów.</p>\n            ','zatyczki-knitpro','','','','Zatyczki KnitPro','','','',''),(407,1,1,'<h2>Etykieta rozmiary drutów PetiteKnit komplet</h2><p>Etykiety do wprasowania na ciepło z najpopularniejszymi rozmiarami drutów w wersji milimetrowej i US <strong>od 2mm do 15mm</strong>. Można je przyprasować w materiałowe etui na druty, gdzie zechcesz. Ważne by były widoczne aby łatwiej znaleźć dokładnie taki rozmiar, jakiego szukasz. Etykieta rozmiary drutów PetiteKnit zawiera arkusz z nadrukiem i pusty arkusz plastiku do naprasowywania, który należy umieścić między etui a żelazkiem.</p><h3>Instrukcją użytkowania etykiet:</h3><ol><li>Wytnij żądany rozmiar naprasowywanej etykiety i umieść ją w wybranym miejscu na etui</li><li>Umieść czysty arkusz plastiku do naprasowywania na etykietce błyszczącą stroną do góry.</li><li>Włącz żelazko z wysoką temperaturą, bez pary. Przyłóż gorące żelazko do plastiku do naprasowywania i lekko dociskaj przez 20-25 sekund.<br />\nWażne jest, aby żelazko dotykało tylko w plastik do prasowania, w przeciwnym ...</li></ol>','\n                <p>Etykiety rozmiarów do naprasowania na materiałowym etui na druty</p>\n            ','etykieta-rozmiary-drutow-petiteknit','','','','Etykieta rozmiary drutów PetiteKnit','','','',''),(408,1,1,'<h2>Praktyczna golarka do ubrań od PetiteKnit</h2><p>Golarka do dzianin PetiteKnit zapewnia dobrą kondycję dzianin jak również innej garderoby, które podatne są na mechacenie. Dzięki niej w łatwy i szybki sposób usuniemy wszelkie zmechacenia pojawiające się wraz z użytkowaniem ubrań, jednocześnie nie niszcząc ich struktury.</p><p>Golarka posiada <strong>bardzo dużą</strong> średnicę roboczą co znacznie skraca czas jaki musimy poświęcić na odświeżenie swojej garderoby. Ostrza zabezpieczone są perforowaną metalową obudową, dzięki czemu nie ma możliwości skaleczenia się podczas jej pracy. Golarka zasilana bateriami, dzięki czemu można zabierać ją ze sobą w podróż. Ergonomiczna obudowa w białym kolorze zapewnia stabilny chwyt.</p><p>Należy pamiętać, że golarka do dzianin PetiteKnit nie powinna być stosowana do odświeżania ubrań z moheru lub z jego dodatkiem, ponieważ usunie naturalny kłaczek przędzy moherowej i sprawi, że dzianina będzie gł...</p>','\n                <p>Golarka do dzianin z bardzo dużą powierzchnią roboczą</p>\n            ','golarka-do-dzianin-petiteknit','','','','Golarka do dzianin PetiteKnit','','','',''),(409,1,1,'<h2>Ochronna osłona drutów KnitPro</h2><p>Zabezpiecz swoją robótkę kiedy wkładasz ją do torby projektowej lub po prostu chwilowo nie będziesz nad nią pracować. Wielozadaniowa osłona drutów KnitPro ochroni Twoje druty, w szczególności drewniane przed złamaniem jak i uniemożliwi zsunięciu się oczek z igieł. Dodatkowo kiedy przechowujesz swoją pracę w torbie ograniczasz możliwość zahaczania końcówki igły o zrobioną już część dzianiny.</p><h3>Parametry osłony KnitPro:</h3><ul><li>długość – 15cm</li><li>pasuje do drutów z żyłką z różnego materiały</li><li>średnica drutów – od 2 do 5 mm</li><li>materiał – aluminium wykończone gumowym blokerem</li><li>komplet – 3 szt w różnych neonowych kolorach</li></ul><p> </p>','\n                <p>Ochronna osłona igieł drutów na żyłce</p>\n            ','oslona-drutow-knitpro','','','','Osłona drutów KnitPro','','','',''),(410,1,1,'<h2>Zwijarka drewniana do motków KnitPro</h2><p>Elegancka, drewniana zwijarka KnitPro sprawi że przewijanie precli w motki będzie wielką przyjemnością. Jej konstrukcja oparta na dwóch różnych średnicach koła sprawia, że podczas przewijania możemy kręcić zwijarką wolno, a motki zwijają się szybko ?</p><p>Ta praktyczna, ręczna nawijarka do włóczek KnitPro wykonana jest z lakierowanego drewna bukowego z kolorowymi elementami ozdobnymi. Dzięki niej w szybki sposób zwiniesz włóczkę z precla do postaci motka, bez plątania się nitki. Aby zwijanie przebiegało płynnie dołącz, należy używać zwijarki wraz z <strong><em><a href=\"https://miedzydrutami.pl/parasolka-drewniana-motowidlo-knitpro/\" target=\"_blank\" rel=\"noreferrer noopener\">motowidłem</a></em></strong> (parasolka dziewiarska)</p><p>Mocowana do blatu śrubą dociskową, która zapewnia mobilność urządzeniu. Kiedy nie potrzebujemy używać zwijarki, wystarczy odkręcić ją od blatu i schować do opakowania</p>...','\n                <p>Drewniana zwijarka do motków</p>\n            ','zwijarka-drewniana-knitpro','','','','Zwijarka drewniana KnitPro','','','',''),(411,1,1,'<h2>Nawijarka ręczna KnitPro</h2><p>Prosta a zarazem bardzo praktyczna nawijarka do włóczek ręczna KnitPro. Dzięki niej w szybki sposób zwiniesz włóczkę z precla do postaci motka, bez plątania się nitki.</p><p>Wykonana z tworzywa sztucznego, lekka, mała zwijarka do włóczek KnitPro ma wychylony kątowo trzpień, który daje równe zwinięte motki. A metalowe ramię z uchem ułatwia właściwe naprężenie prowadzonej nitki.</p><p>Aby bezproblemowo przewijać motki użyj do kompletu motowidła, na którym umieścisz wełnę zwiniętą w precel.</p><p> </p><p>Użyta na zdjęciu włóczka nie stanowi kompletu, a jest jedynie elementem aranżacji zdjęcia</p>','\n                <p>Lekka, kompaktowa nawijarka do włóczki</p>\n            ','nawijarka-do-wloczek-reczna-knitpro','','','','Nawijarka do włóczek ręczna KnitPro','','','',''),(412,1,1,'<h2>Zatyczki Addi ToGo komplet</h2><p>Stopery do drutów w postaci serduszek ze sprężynką w które wsuwamy końcówki drutów. Zakładając zatyczki Addi ToGo na druty uniemożliwiamy oczkom zsunięcie się, które skutkowałoby zniszczeniem naszej pracy. Przydatne w szczególności kiedy nie pracujemy jakiś czas z robótką, pakujemy ją do torby np. w podróży lub w każdej innej sytuacji która mogłaby spowodować ściągnięcie oczek z drutów</p><p>Komplet zatyczek stanowią dwa serduszka dedykowane różnym rozmiarom drutów:</p><ul><li>Mała do drutów o średnicy 1,5 – 5 mm.</li><li>Duża do drutów o średnicy 5,5 – 10 mm.</li></ul><p>Zatyczki pasują do drutów każdej marki i ich wszystkich modeli.</p><p>Jeżeli nie masz jeszcze drutów, zobacz naszą szeroką ofertę <a href=\"https://miedzydrutami.pl/druty-do-dziergania/\" target=\"_blank\" rel=\"noreferrer noopener\"><em><strong>TU</strong></em></a></p>','\n                <p>Komplet stoperów które zabezpieczają oczka przed zsunięciem z drutów.</p>\n            ','zatyczki-addi-togo','','','','Zatyczki Addi ToGo','','','',''),(413,1,1,'<h2>PetiteKnit Cross Sweater Junior wzór na druty</h2><p>PetiteKnit Cross Sweater Junior to oryginalne wydanie PetiteKnit, na podstawie którego wykonać można żakardowy sweter z motywem krzyża w rozmiarze dziecięcym. Warto dodać, że wzór powstał we współpracy z Czerwonym Krzyżem. Ponadto, z każdej sprzedaży kwota 20 DKK (ok. 11,60 zł) jest przekazywana na rzecz Czerwonego Krzyża. Projektantka wykonała sweter z włóczki <a href=\"https://miedzydrutami.pl/peer-gynt-sandnes-garn/\" target=\"_blank\" rel=\"noreferrer noopener\"><em><strong>Peer Gynt</strong></em></a> marki Sandnes Garn. Dla osób wrażliwych na wełnę norweską polecamy wyjątkową mieszankę włókien owcy i lamy <a href=\"https://miedzydrutami.pl/pascuali-wloczka-sayama/\" target=\"_blank\" rel=\"noreferrer noopener\"><em><strong>Sayama</strong></em></a> marki Pascuali lub <a href=\"https://miedzydrutami.pl/double-sunday-sandnes-garn/\" target=\"_blank\" rel=\"noreferrer noopener\"><em><strong>Double Sunday</strong></em></a> marki S...</p>','\n                <p>Wzór powstał we współpracy z Czerwonym Krzyżem. Z każdej sprzedaży kwota 20 DKK (ok. 11,60 zł) jest przekazywana na rzecz Czerwonego Krzyża.</p><p>wydanie – język angielski</p>\n            ','petiteknit-cross-sweater-junior-wzor-dziewiarski','','','','PetiteKnit Cross Sweater Junior wzór dziewiarski','','','',''),(414,1,1,'<h2>PetiteKnit Cross Sweater wzór na druty</h2><p>PetiteKnit Cross Sweater to oryginalne wydanie PetiteKnit, na podstawie którego wykonać można żakardowy sweter z motywem krzyża. Warto dodać, że wzór powstał we współpracy z Czerwonym Krzyżem. Ponadto, z każdej sprzedaży kwota 20 DKK (ok. 11,60 zł) jest przekazywana na rzecz Czerwonego Krzyża. Projektantka wykonała sweter z włóczki <a href=\"https://miedzydrutami.pl/peer-gynt-sandnes-garn/\" target=\"_blank\" rel=\"noreferrer noopener\"><em><strong>Peer Gynt</strong></em></a> marki Sandnes Garn. Dla osób wrażliwych na wełnę norweską polecamy wyjątkową mieszankę włókien owcy i lamy <a href=\"https://miedzydrutami.pl/pascuali-wloczka-sayama/\" target=\"_blank\" rel=\"noreferrer noopener\"><em><strong>Sayama</strong></em></a> marki Pascuali lub <a href=\"https://miedzydrutami.pl/double-sunday-sandnes-garn/\" target=\"_blank\" rel=\"noreferrer noopener\"><em><strong>Double Sunday</strong></em></a> marki Sandnes Garn.</p><p>Cross Sweater wydz...</p>','\n                <p>Wzór powstał we współpracy z Czerwonym Krzyżem. Z każdej sprzedaży kwota 20 DKK (ok. 11,60 zł) jest przekazywana na rzecz Czerwonego Krzyża.</p><p>wydanie – język angielski</p>\n            ','petiteknit-cross-sweater-wzor-dziewiarski','','','','PetiteKnit Cross Sweater wzór dziewiarski','','','',''),(415,1,1,'<h2>PetiteKnit Chestnut Sweater wzór na druty</h2><p>PetiteKnit Chestnut Sweater to oryginalne wydanie PetiteKnit, na podstawie którego wykonać można klasyczny, ciepły sweter z golfem z włóczki <a href=\"https://miedzydrutami.pl/peer-gynt-sandnes-garn/\" target=\"_blank\" rel=\"noreferrer noopener\"><em><strong>Peer Gynt</strong></em></a> marki Sandnes Garn.</p><p>Chestnut Sweater wydziergasz od góry do dołu. Najpierw wykonaj tył swetra pracując w tę i z powrotem. Jednocześnie będziesz kształtować skos ramion za pomocą rzędów skróconych. Następnie każde ramię wykonuj oddzielnie, dziergając w tę i z powrotem na drutach z żyłką. Następnie połącz ramiona. Przód i tył należy połączyć pod pachami, a korpus wydziergać na okrągło na drutach z żyłką. Oczka na rękawy należy podnieść i dziergać wzdłuż otworów na ręce. Golf wykonaj na końcu z oczek, które  należy podnieść i dziergać wzdłuż krawędzi szyi.</p><p>PetiteKnit Chestnut Sweater to wzór wydrukowany w języ...</p>','\n                <p>Ciepły i miękki sweter z wełny norweskiej.</p><p>wydanie – język angielski</p>\n            ','petiteknit-chestnut-sweater-wzor-dziewiarski','','','','PetiteKnit Chestnut Sweater wzór dziewiarski','','','',''),(416,1,1,'<h2>PetiteKnit Weekend Sweater wzór na druty</h2><p>PetiteKnit Weekend Sweater to oryginalne wydanie PetiteKnit, na podstawie którego wykonać można klasyczny, ciepły sweter ze stójką. Projektantka użyła do wykonania tego swetra m.in. włóczkę marki Hillesvåg Ullvarefabrikk, której nie ma w ofercie naszego sklepu. Do tego projektu świetnie sprawdzi się każda wełna, która w 50 g będzie miała ok. 100 m. Dlatego z powodzeniem możesz użyć włóczki <a href=\"https://miedzydrutami.pl/pascuali-wloczka-sayama/\" target=\"_blank\" rel=\"noreferrer noopener\"><em><strong>Sayama</strong></em></a> marki Pascuali, <a href=\"https://miedzydrutami.pl/peer-gynt-sandnes-garn/\" target=\"_blank\" rel=\"noreferrer noopener\"><em><strong>Peer Gynt</strong></em></a> lub <a href=\"https://miedzydrutami.pl/double-sunday-sandnes-garn/\" target=\"_blank\" rel=\"noreferrer noopener\"><em><strong>Double Sunday</strong></em></a> marki Sandnes Garn. Sweter dzierga się w dwie nitki dlatego połącz wełnę z cienkim mohere...</p>','\n                <p>Ciepły i miękki sweter z wełny.</p><p>wydanie – język angielski</p>\n            ','petiteknit-weekend-sweater-wzor-dziewiarski','','','','PetiteKnit Weekend Sweater wzór dziewiarski','','','',''),(417,1,1,'<h2>PetiteKnit Little Esther Jacket wzór na druty</h2><p>PetiteKnit Little Esther Jacket to oryginalne wydanie PetiteKnit, na podstawie którego wykonać można dziecięcy, ciepły i rozpinany sweter w strukturalny wzór. Możesz go wykonać z wełny <a href=\"https://miedzydrutami.pl/isager-jensen/\" target=\"_blank\" rel=\"noreferrer noopener\"><em><strong>Jensen</strong></em></a> trzymanej razem z <a href=\"https://miedzydrutami.pl/tvinni-isager/\" target=\"_blank\" rel=\"noreferrer noopener\"><em><strong>Tvinni</strong></em></a> marki Isager.</p><p>Little Esther Jacket przerabia się od góry do dołu, zgodnie z teksturalnym wzorem, dlatego efekt końcowy jest niezwykle stylowy i unikalny. Pierwszy krok to dzierganie tylnego karczku w tę i z powrotem z jednoczesnym dodawaniem oczek. Następnie przerabia się ramiona wzdłuż górnej części tylnego karczku, co umożliwia precyzyjne uformowanie górnej części swetra. <span></span></p>','\n                <p>Wzór dziewiarski, według którego samodzielnie wykonasz na drutach strukturalny, rozpinany sweter dla dziecka.</p><p>wydanie – język angielski</p>\n            ','petiteknit-little-esther-jacket-wzor-dziewiarski','','','','PetiteKnit Little Esther Jacket wzór dziewiarski','','','',''),(418,1,1,'<h2>PetiteKnit Holger Shirt wzór</h2><p>PetiteKnit Holger Shirt to oryginalne wydanie PetiteKnit, na podstawie którego wykonać można dziecięcy, ciepły sweter w kolorowe paski. Możesz go wykonać z włóczki <a href=\"https://miedzydrutami.pl/sunday-sandnes-garn/\" target=\"_blank\" rel=\"noreferrer noopener\"><em><strong>Sunday</strong></em></a> lub <a href=\"https://miedzydrutami.pl/wloczka-tynn-peer-gynt/\" target=\"_blank\" rel=\"noreferrer noopener\"><em><strong>Tynn Peer Gynt</strong></em></a> od Sandnes Garn.</p><p>Holger Shirt dzierga się od góry do dołu. Korpus należy wykonać ściegiem pończoszniczym w paski, natomiast rękawy i brzeg szyi dzierga się w różnych, jednolitych kolorach. Najpierw  należy wydziergać karczek z tyłu, w tę i z powrotem. Następnie pochylenie ramion kształtuje się za pomocą skróconych rzędów. Dodatkowo, w tym samym czasie dzierga się paski. Następnie każde ramię przerabia się w tę i z powrotem na drutach z żyłką, a następnie ramiona łączy się,...</p>','\n                <p>Wzór na druty, według którego wykonasz wielokolorowy, fantazyjny sweter dla dziecka.</p><p>wydanie – język angielski</p>\n            ','petiteknit-holger-shirt-wzor-dziewiarski','','','','PetiteKnit Holger Shirt wzór dziewiarski','','','',''),(419,1,1,'<h2>PetiteKnit Christmas Stocking wzór dziewiarski</h2><p>Christmas Stocking to oryginalne wydanie PetiteKnit, na podstawie którego można wykonać skarpetę na słodycze lub drobne, świąteczne upominki. Ten projekt wykonasz z włóczki <a href=\"https://miedzydrutami.pl/fritidsgarn-sandnes-garn/\" target=\"_blank\" rel=\"noreferrer noopener\"><em><strong>Fritidsgarn</strong></em></a> marki Sandnes Garn.</p><p>Skarpetę świąteczną dzierga się od góry do dołu, w okrążeniach. Całość wykonuje się ściegiem pończoszniczym a piętę kształtuje rzędami skróconymi. Następnie skarpetę filcuje się. Całość wykańcza się haftem, np. można wyhaftować imię oraz skórzanym paskiem.</p><p>Christmas Stocking to wzór wydrukowany w języku angielskim.</p><p>Zamawiając ten wzór otrzymasz fizyczną dostawę z broszurą w formacie A5.</p><p>Więcej o wzorze dowiesz się na stronie wydawcy.</p><h3 class=\"_04xlpA direction-ltr align-justify para-style-body\"><span class=\"S1PPyQ\">Opis projektu C...</span></h3>','\n                <p>Wzór do samodzielnego wykonania na drutach skarpety na słodycze lub drobne, świąteczne upominki.</p><p>wydanie – język angielski</p>\n            ','petiteknit-christmas-stocking-wzor-dziewiarski','','','','PetiteKnit Christmas Stocking wzór dziewiarski','','','',''),(420,1,1,'<h2>PetiteKnit Nora Neck wzór dziewiarski</h2><p>Nora Neck to oryginalne wydanie PetiteKnit, na podstawie którego można wykonać efektowny komin z golfem oraz frędzlami w stylu boho. Otulacz powstaje z włóczek marki Isager: <a href=\"https://miedzydrutami.pl/eco-soft-isager/\" target=\"_blank\" rel=\"noreferrer noopener\"><em><strong>Soft</strong></em></a> połączonej z <a href=\"https://miedzydrutami.pl/isager-silk-mohair/\" target=\"_blank\" rel=\"noreferrer noopener\"><em><strong>Silk Mohair</strong></em></a>. PetiteKnit podaje także, że zamiast włóczki Soft można użyć <a href=\"https://miedzydrutami.pl/poppy-sandnes-garn/\" target=\"_blank\" rel=\"noreferrer noopener\"><em><strong>Poppy</strong></em></a> lub <a href=\"https://miedzydrutami.pl/kos-sandnes-garn/\" target=\"_blank\" rel=\"noreferrer noopener\"><em><strong>KOS</strong></em></a> marki Sandnes Garn.</p><p>Otulacz z golfem wykonuje się od góry do dołu. Najpierw należy wykonać tylną część z dodawaniem oczek na ramiona i dodatkowo wykończyć ca...</p>','\n                <p>Ciepły i przyjemny w dotyku otulacz z golfem i frędzlami w stylu boho.</p><p>wydanie – język angielski</p>\n            ','petiteknit-nora-neck-wzor-na-druty','','','','PetiteKnit Nora Neck wzór na druty','','','',''),(421,1,1,'<h2>PetiteKnit Esther Vest wzór</h2><p>PetiteKnit Esther Vest to oryginalne wydanie PetiteKnit, na podstawie którego wykonać można efektowną, ciepłą kamizelkę w strukturalny wzór. Kamizelka jest zapinana na guziki i powstaje powstaje z dwóch nici. Wydziergasz ją z włóczki <a href=\"https://miedzydrutami.pl/isager-jensen/\" target=\"_blank\" rel=\"noreferrer noopener\"><strong><em>Jensen</em></strong></a> w połączeniu ze <a href=\"https://miedzydrutami.pl/isager-spinni/\" target=\"_blank\" rel=\"noreferrer noopener\"><em><strong><span>Spin</span></strong></em></a><span><em><strong>ni</strong></em> lub <a href=\"https://miedzydrutami.pl/alpaca-1-isager/\" target=\"_blank\" rel=\"noreferrer noopener\"><em><strong>Alpaca 1</strong></em></a> marki Isager.</span></p><p>Kamizelkę Esther dzierga się od góry do dołu według teksturalnego...</p>','\n                <p>Wzór na druty według, którego samodzielnie wykonasz na drutach rozpinaną kamizelkę ze strukturalnym wzorem.</p><p>wydanie – język angielski</p>\n            ','petiteknit-esther-vest-wzor-na-druty','','','','PetiteKnit Esther Vest wzór na druty','','','',''),(422,1,1,'<h2>PetiteKnit Zipper Jacket wzór na druty</h2><p>PetiteKnit Zipper Jacket to oryginalne wydanie PetiteKnit, na podstawie którego można wykonać na drutach zapinany na zamek sweter. Projektantka wzoru wykonała kardigan m.in. z włóczki Håndværksgarn. Nie posiadamy w ofercie naszego sklepu tej włóczki ale z powodzeniem wydziergasz ten model z włóczki <a href=\"https://miedzydrutami.pl/pascuali-wloczka-sayama/\" target=\"_blank\" rel=\"noreferrer noopener\"><em><strong>Sayama</strong></em></a> marki Pascuali lub <a href=\"https://miedzydrutami.pl/peer-gynt-sandnes-garn/\" target=\"_blank\" rel=\"noreferrer noopener\"><em><strong>Peer Gynt</strong></em></a> marki Sandnes Garn w połączeniu z mohe