/h2><p>PetiteKnit Amy Sweater to oryginalne wydanie PetiteKnit, na podstawie którego wykonasz na drutach prosty sweter z golfem. Sweter wykonasz z włóczki <a href=\"https://miedzydrutami.pl/peer-gynt-sandnes-garn/\" target=\"_blank\" rel=\"noreferrer noopener\"><em><strong>Peer Gynt</strong></em></a> marki Sandnes Garn lub <a href=\"https://miedzydrutami.pl/pascuali-wloczka-sayama/\" target=\"_blank\" rel=\"noreferrer noopener\"><em><strong>Sayama</strong></em></a> od Pascuali.</p><p>Sweter Amy dzierga się od góry do dołu ściegiem pończoszniczym. Pierwszą część karczku dzierga się na płasko, tam i z powrotem, aby nadać kształt dekoltowi. Następnie robótkę łączy się na okrągło. Następnie dodawane są oczka w reglanie. Rękawy i dół korpusu wykańcza się szerokimi ściągaczami z rolowanym brzegiem. Na końcu wykonuje się golf, który również wykańcza się ozdobnym rolowaniem.</p><p>PetiteKnit Amy Sweater to wzór wydrukowany w języku an...</p>','\n                <p>Po zamówieniu tego wzoru wyślemy do Ciebie <strong>WYDRUKOWANĄ BROSZURĘ w JĘZYKU ANGIELSKIM.</strong></p><p>To znaczy, że dostaniesz od nas przesyłkę z oryginalnym, drukowanym wzorem PetiteKnit w języku angielskim, więc wybierz formę dostawy i opłać przesyłkę.</p><p><span style=\"color:#339966;\"><strong>TŁUMACZENIE WZORU NA JĘZYK POLSKI pobierz klikając w link, który otrzymasz w ostatniej wiadomości e-mail, potwierdzającej finalizację zamówienia.</strong></span></p><hr /><p>Zanim zdecydujesz się na zakup, załóż konto w naszym sklepie <a href=\"https://miedzydrutami.pl/moje-konto/\" target=\"_blank\" rel=\"noreferrer noopener\"><em><strong>TUTAJ</strong></em></a>, aby mieć wygodny dostęp do kupionego wzoru z polskim tłumaczeniem. Po zakupie tłumaczenie automatycznie pojawi się na Twoim koncie, co pozwoli Ci na pobranie go w każdej chwili. Już nie musisz martwić się o zagubione maile – wszystko znajdziesz w jednym miejscu!</p>\n            ','petiteknit-amy-sweater-wzor-na-druty','','','','PetiteKnit Amy Sweater wz