opener\">Babyull Lanett</a></strong></em>, która jest flagową włóczką dla dzieci, <em><strong><a></a></strong></em></p>','\n                <p>Projekty ubrań dla maluszków z włóczki Babyull Lanett, Sunday, Double Sunday.</p><p>wydanie – język angielski</p>\n            ','myk-start-2213-sandnes-garn','','','','Myk Start 2213 Sandnes Garn','','','',''),(509,1,1,'<h2>Magazyn Tynn Peer Gynt 2212</h2><p>Kolekcja zawarta w magazynie Tynn Peer Gynt 2212 wydana przez producenta <strong><em><a href=\"https://www.sandnes-garn.com/2212-kolleksjon\" target=\"_blank\" rel=\"noreferrer noopener\">Sandnes Garn</a></em></strong> to zimowe dzianiny o prostym, klasycznym kroju dla dorosłych i dzieci. W tym magazynie dominują swetry. Robione na drutach od góry do dołu, gdzie każdy może zdecydować o długości rękawów i tułowia.</p><p>Całą kolekcję łączy włóczka wełniana <strong><em><a href=\"https://miedzydrutami.pl/wloczka-tynn-peer-gynt/\" target=\"_blank\" rel=\"noreferrer noopener\">Tynn Peer Gynt</a></em></strong> przerabiana solo lub w połączeniu z inna nitką, np. <strong><em><a href=\"https://miedzydrutami.pl/wloczka-tynn-silk-mohair/\" target=\"_blank\" rel=\"noreferrer noopener\">Tynn Silk Mohair</a></em></strong> lub Alpakka Folgetrad. W zaproponowanej kolorystyce dominują odważne kolory włóczek jak bakłażan, petrol i turkus. Tłem dla przesyconej barwą ...</p>','\n                <p>Projekty klasycznych swetrów wykonanych z włóczki Tynn Peer Gynt.</p><p>wydanie – język angielski</p><hr /><p><span style=\"color:#339966;\"><strong>Według najnowszych standardów marki Sandnes Garn czasopismo można kupić tylko z włóczką od Sandnes Garn. To oznacza, że jeśli chcesz kupić gazetę ze wzorami musisz dodać do zamówienia włóczki Sandnes Garn – w innym przypadku zamówienie zostanie anulowane.</strong></span></p><p>Ofertę włóczek marki Sandnes Garn w naszym sklepie znajdziesz <a href=\"https://miedzydrutami.pl/wloczki/?product_cat=wloczki&amp;pa_marka=sandnes-garn\" target=\"_blank\" rel=\"noreferrer noopener\"><em><strong>TUTAJ</strong></em></a>.</p>\n            ','tynn-peer-gynt-2212-sandnes-garn','','','','Tynn Peer Gynt 2212 Sandnes Garn','','','',''),(510,1,1,'<h2>Magazyn Mykt Til Barn 2203</h2><p>Kolekcja w magazynie Mykt Til Barn 2203 wydana przez producenta <strong><em><a href=\"https://www.sandnes-garn.com/2203-kolleksjon\" target=\"_blank\" rel=\"noreferrer noopener\">Sandnes Garn</a></em></strong> zawiera zimowe dzianiny dla dzieci. W propozycji dominują miękkie włóczki z alpaką oraz dodatek moheru do włóczek wełnianych. Całość to ciepłe dzianiny na chłodne dni od klasycznych swetrów, przez kamizelki i rozpinane kardigany po dziewczęcą subtelność falbanek przy szyi.</p><p>Kliknij w link „Sandnes Garn” aby sprawdzić rozmiary i ilość włóczki potrzebnej do poszczególnego projektu.</p><p>Magazyn skierowany dla osób robiących na różnych poziomach, od początkujących po zaawansowanych. Dzianiny robione na drutach od góry do dołu, gdzie każdy może zdecydować o długości rękawów i tułowia.</p><p>Wzory zaprojektowane w oparciu o włóczki <strong><em><a href=\"https://miedzydrutami.pl/kos-sandnes-garn/\"></a></em></strong></p>','\n                <p>Projekty dziecięcej garderoby, zarówno z cienkiej, jak i grubej przędzy.</p><p>wydanie – język angielski</p>\n            ','mykt-til-barn-2203-sandnes-garn','','','','Mykt Til Barn 2203 Sandnes Garn','','','',''),(511,1,1,'<h2>Magazyn Tiril 18 Sandnes Garn</h2><p>Magazyn Tiril 18 <strong><em><a href=\"https://www.sandnes-garn.com/tiril18-kolleksjon\" target=\"_blank\" rel=\"noreferrer noopener\">Sandnes Garn</a></em></strong>  powstał przy współpracy z norweską biatlonistką Tiril Eckhoff. Zawiera projekty letnich dzianin robionych na drutach –  krótkie spodenki, T-shirt i bluzkę typu long sleeve. Obie bluzki z od góry klasycznym raglanem. To proste w wykonaniu, klasyczne dzianiny, które może zrobić nawet początkująca osoba</p><p>Wzory rozpisane są na włóczkę  <strong><em><a href=\"https://miedzydrutami.pl/line-wloczka-bawelniana-z-lnem/\" target=\"_blank\" rel=\"noreferrer noopener\">Line </a></em></strong> , która jest letnią opcją w mieszance bawełny, lnu i wiskozy. Dzięki temu odzież jest wygodna i przyjemna w noszeniu zarówno wiosną, jak i latem.</p><p>Projekty uwzględniają wszystkie rozmiary od XS do  3XL</p><p>Wydanie zawiera opisy w języku angielskim jak i niemieckim oraz piękne zd...</p>','\n                <p>Projekty letniego zestawu – krótkie spodenki, bluzka i T-shirt.</p><p>wydanie – język angielski</p>\n            ','tiril-18-sandnes-garn','','','','Tiril 18 Sandnes Garn','','','',''),(512,1,1,'<h2>Książka Urban Knit Classics Leeni Hoimela</h2><p>Książka Urban Knit Classics Leeni Hoimela wydawnictwa Cozy Publishing to kolekcja nowoczesnych skandynawskich wzorów dzianin do robienia na drutach. Synonimem miejskiej, klasycznej dziany jest tutaj ponadczasowość. Każdy projekt z tej książki połączysz z innymi ubraniami. W książce znajdziesz projekty dzianin o długiej żywotności. Będą to lekkie, plecione swetry, grubsze swetry <em>a’la</em> kurtka w ciemnych kolorach i doskonale prezentujące się dodatki. W książce zajmuje się aż 20 wzorów dziewiarskich na druty, które powstały w wyniku inpiracji fińskiej projektatnki Leeni barwami Skandynawii.</p><h4>O autorce:</h4><p><span lang=\"en-us\" xml:lang=\"en-us\">Leeni Hoimela to jedna z </span><span lang=\"en-us\" xml:lang=\"en-us\">najbardziej znanych fińskich projektantek dzianin</span><span lang=\"en-us\" xml:lang=\"en-us\">. Jej pierwsza książka</span><span lang=\"en-us\" xml:lang=\"en-us\"> Urban Knit</span><span lang=\"en-us\" xml:lang=\"en-us\">, sprzedawana jest w ponad 30 krajach, s...</span></p>','\n                <p>Prostota i styl w projektach Leeni Hoimela po raz kolejny! Fińska projektanta wydaje drugą książkę z pięknymi wzorami na klasyczne, skandynawskie dzianiny.</p><p><span style=\"color:#ff6600;\"><strong>Oficjalna premiera 12.12.2024 r. ale u nas możesz zamówić tę książkę w PRZEDSPRZEDAŻY. </strong></span></p><p><span style=\"color:#ff6600;\"><strong>PLANOWANY TERMIN WYSYŁANIA KSIĄŻKI TO 20.12.2024 R.</strong></span></p><p> </p>\n            ','urban-knit-classics-leeni-hoimela','','','','Urban Knit Classics Leeni Hoimela','','','',''),(513,1,1,'<h2>Mouche and Friends: Seamless Toys to Knit and Love Cinthia Vallet</h2><p>Książka Mouche and Friends: Seamless Toys to Knit and Love Cinthia Vallet to 12 wzorów na maskotki na drutach. Dodatkowo, w tej książce znajdziesz instrukcje jak wykonać dodatki dla maskotek, jak np. sweter na drutach lub spodenki.</p><p>Autorka wzorów, ożywia swoje postacie za pomocą krótkich opowieści. Tworząc urokliwe połączenie książki z projektami dziewiarskimi i zbioru bajek dla dzieci. Proces tworzenia zabawek według Cinthii jest niezwykły i całkowicie bezszwowy, co zapewnia płynność pracy. Zwierzątka wydziergasz z naturalnych włókien w technice „na okrągło”. Zaczynając od nosa i stopniowo przechodząc w dół do stóp – zabawka powstaje, rozwijając się w trakcie pracy, zamiast być składana z części. To fascynujące, jak te małe stworzenia dosłownie ożywają pod palcami podczas dziergania.</p><p>Książka jest idealna dla osób o różnym poziomie zaawansowania w r...</p>','\n                <p>Przepięknie wydana książka ze wzorami na maskotki na drutach. Wspaniałe projekty i artystyczne zdjęcia.</p><p>wydanie – język angielski</p>\n            ','mouche-and-friends-seamless-toys-to-knit-and-love','','','','Mouche and Friends: Seamless Toys to Knit and Love','','','',''),(514,1,1,'<h2>Książka 52 Weeks of Accessories Laine Publishing</h2><p>52 Weeks of Accessories wydawnictwa Laine Publishing to barwna i wszechstronna książka, w której znajdziesz wzory na 52 inspirujące akcesoria – głównie dziewiarskie, ale również kilka szydełkowych – stworzone przez 48 projektantów z całego świata. To idealna propozycja dla miłośników robienia na drutach czapek, szali, skarpetek i rękawiczek, ale znajdziemy tu także inne ciekawe projekty, takie jak kominy, kaptury, opaski na głowę i torby.</p><p>Wzory zawarte w książce są odpowiednie dla osób o różnym poziomie zaawansowania i oferują bogaty wybór technik, w tym warkocze, wzory kolorystyczne oraz prostsze ściegi. Dzięki niewielkim rozmiarom akcesoria wydziergasz szybko i ekonomicznie. To doskonały sposób na wypróbowanie nowych technik!</p><p>Zdjęcia wszystkich projektów, które znajdują się w tej książce znajdziesz <a href=\"https://lainepublishing.com/blogs/pattern-previews/patter...\"></a></p>','\n                <p>Zbiór 52. wzorów na akcesoria dziewiarskie projektantów z całego świata.</p><p>wydanie – język angielski</p>\n            ','52-weeks-of-accessories-laine-publishing','','','','52 Weeks of Accessories Laine Publishing','','','',''),(515,1,1,'<h2>Książka Memory Lane: Embellished Knits to Cherish Claudia Quintanilla</h2><p>Książka Memory Lane: Embellished Knits to Cherish Claudia Quintanilla wydawnictwa Laine Publishing zawiera 19 wspaniałych wzorów na bardzo kobiece dzianiny, zdobione haftem oraz koralikami. Są to projekty zarówno na druty, jak i szydełko. To kobiece i eleganckie dzianiny wykonane z włóczek takich jak np. <a href=\"https://miedzydrutami.pl/mohair-bliss-pascuali/\" target=\"_blank\" rel=\"noreferrer noopener\"><em><strong>Mohair Bliss</strong></em></a> marki Pascuali, <a href=\"https://miedzydrutami.pl/ito-sensai/\" target=\"_blank\" rel=\"noreferrer noopener\"><em><strong>Sensai</strong></em></a> oraz <a href=\"https://miedzydrutami.pl/kinu-ito/\" target=\"_blank\" rel=\"noreferrer noopener\"><em><strong>Kinu</strong></em></a> marki ITO czy włóczki marki Isager.</p><p>Pięknie wydana książka na wysokiej jakości papierze z artystycznymi zdjęciami.</p><h4>O autorce:</h4><p>Claudia Quintanilla od zawsze uwielbia...</p>','\n                <p>Nowoczesne i kobiece dzianiny w romantycznym stylu ozdobione haftem lub koralikami.</p><p>wydanie – język angielski</p>\n            ','memory-lane-embellished-knits-to-cherish','','','','Memory Lane: Embellished Knits to Cherish','','','',''),(516,1,1,'<h2>Kalendarz dziewiarski Knitter’s Year 2025 Laine Publishing</h2><p>Kalendarz dziewiarski Knitter’s Year 2025 to coś więcej niż zwykły tygodniowy planer. To pięknie zaprojektowany, praktyczny kalendarz, który został stworzony z myślą o miłośnikach dziewiarstwa i kreatywnych twórcach. Ten elegancki notatnik dziewiarski oferuje mnóstwo miejsca na osobiste notatki. Dodatkowo możesz tworzyć w nim szkice projektów, mapy myśli i wiele innych! Pozwól sobie na swobodne rozwijanie pomysłów na nowe projekty na drutach i na szydełku.</p><p>Planer zawiera informacje o ponad 100 wydarzeniach związanych z dziewiarstwem z całego świata. To idealne narzędzie, które pomoże ci uporządkować codzienne obowiązki. Dodatkowo utrzymasz kontakt z globalną społecznością rękodzielniczą – niezależnie od tego, czy jesteś zapaloną pasjonatką dziergania (lub pasjonatem), czy zawodowo zajmujesz się tworzeniem dzianin.</p><p>Zacznij marzyć i planować, nawiąż znajomoś...</p>','\n                <p>Kalendarz dziewiarski to <em>must have </em>każdej dziewiarki.</p><p>wydanie – język angielski</p><p> </p>\n            ','kalendarz-dziewiarski-knitters-year-2025','','','','Kalendarz dziewiarski Knitter’s Year 2025','','','',''),(517,1,1,'<h2>Książka KNITS TO WEAR KutovaKika Veronika Lindberg</h2><p>Książka KNITS TO WEAR KutovaKika wydawnictwa Laine Publishing zawiera 17 wspaniałych wzorów dzianin o prostym, skandynawskim stylu. Projekty są nowoczesne, ale jednocześnie kobiece i eleganckie, gdzie dzianiny zaprojektowano z myślą o wygodzie noszenia. Książka zawiera także tutoriale dotyczące specjalnych technik i przydatne wskazówki dotyczące robienia na drutach.<span class=\"Apple-converted-space\"> Wydanie jest przyjazne dla osób zaawansowanych jak i dla początkujących.</span></p><p>Pięknie wydana książka na wysokiej jakości papierze z artystycznymi zdjęciami.</p><h4>O autorce:</h4><p>Veronika Lindberg, w skrócie Kika, nauczyła się robić na drutach w wieku pięciu lat. Jej pierwszym dziełem był różowy kucyk z większą liczbą dziur niż nienaruszonych szwów. Od tego czasu fascynuje ją magia przędzy, która w jej własnych rękach zamienia się w tkaninę. Założyła konto na Instagra...</p>','\n                <p>Nowoczesne i kobiece dzianiny w skandynawskim, prostym stylu.</p><p>wydanie – język angielski</p>\n            ','knits-to-wear-effortless-patterns-kutovakika-veronika-lindberg','','','','Knits To Wear: Effortless Patterns KutovaKika Veronika Lindberg','','','',''),(518,1,1,'<h2>Książka KNIT THIS KutovaKika Veronika Lindberg</h2><p>Książka KNIT THIS KutovaKika wydawnictwa Cozy Publishing zawiera  21 wspaniałych wzorów dzianin o prostym, skandynawskim stylu. Projekty są nowoczesne, ale jednocześnie kobiece i eleganckie, gdzie dzianiny zaprojektowano z myślą o wygodzie noszenia. Książka zawiera także tutoriale dotyczące specjalnych technik i przydatne wskazówki dotyczące robienia na drutach.<span class=\"Apple-converted-space\"> Wydanie jest przyjazne dla osób zaawansowanych jak i dla początkujących.</span></p><p>Pięknie wydana książka na wysokiej jakości papierze z artystycznymi zdjęciami.</p><h4>O autorce:</h4><p>Veronika Lindberg, w skrócie Kika, nauczyła się robić na drutach w wieku pięciu lat. Jej pierwszym dziełem był różowy kucyk z większą liczbą dziur niż nienaruszonych szwów. Od tego czasu fascynuje ją magia przędzy, która w jej własnych rękach zamienia się w tkaninę. Założyła konto na Instagramie @Kut...</p>','\n                <p>Nowoczesne i kobiece dzianiny w skandynawskim prostym stylu.</p><p>wydanie – język angielski</p>\n            ','knit-this-kutovakika-veronika-lindberg','','','','Knit This KutovaKika Veronika Lindberg','','','',''),(519,1,1,'<h2>Książka Helgi Isager oraz Helgi Jóny Thórunnarsdóttir Handcraft</h2><p>Handcraft Isager to książka dziewiarska, która powstała w wyniku współpracy Helgi Isager i Helgi Jóny Thórunnarsdóttir. To pozycja, w której znajdziesz dwa podstawowe wzory: jeden na rękawiczki z palcami i drugi na mitenki, a także różnorodne techniki dziewiarskie i różne rodzaje wykończeń. Ilustracje autorstwa japońskiej artystki Toshiko Koikegami pięknie przedstawiają zastosowane w książce techniki.</p><p>We wstępie autorki napisały:<br />\n„Pomysł na <em>Handcraft</em> narodził się z naszej wspólnej pasji do technik i detali. Od kilku lat razem prowadzimy warsztaty dziewiarskie i podchodzimy do tego rzemiosła z równie drobiazgową troską. Projekt często można ulepszyć, aby oczka układały się idealnie, albo może trzeba dodać kilka dodatkowych oczek, aby stworzyć idealne wykończenie. Być może tylko my zauważymy różnicę, ale głęboką satysfakcję, jaką daje stworzenie ...</p>','\n                <p>Przepiękne wydanie książki, która powstała we współpracy dwóch duńskich projektantek Helgi Isager i Helgi Jóny Thórunnarsdóttir. W książce tej znajdziesz wzory na rękawiczki oraz mitenki, a także wiele wiedzy na temat technik dziewiarskich.</p><p>wydanie – język angielski</p>\n            ','handcraft-isager','','','','Handcraft Isager','','','',''),(520,1,1,'<h2>Książka Marinny Isager Knitting Life 3 Tokyo Tversted</h2><p>Knitting Life 3 Isager to kolejna część z serii dziewiarsko-podróżniczej. Seria Książek The Knitting Life to opowieści podróżnicze duńskiej projektantki Marianne Isager. Marianne we wstępie do książki dzieli się historią swojej fascynacji Japonią. Wszystko zaczęło się od wyjątkowego prezentu – dwóch japońskich rycin, które otrzymała od swojego wuja Nielsa. To wydarzenie zapoczątkowało jej zainteresowanie japońską sztuką i kulturą. W późniejszych latach, kiedy japońscy projektanci mody zyskali uznanie na Zachodzie, jej ciekawość wobec tego kraju jeszcze bardziej się pogłębiła. W 2001 roku poznała swojego męża Nelsa, który mieszkał i pracował w Tokio. Był to początek piętnastoletniej podróży między Danią a Japonią oraz niezliczonych inspirujących doświadczeń.</p><p>Podobnie jak w poprzednich częściach tej serii dziewiarsko-podróżniczej, zaprezentowano kolekcję projektów, któ...</p>','\n                <p>Projekty Marianne Isager inspirowane podróżą do Japonii.</p><p>wydanie – język angielski</p>\n            ','knitting-life-3-isager','','','','Knitting Life 3 Isager','','','',''),(521,1,1,'<h2>Książka Sari Nordlund Softly Timeless Knits</h2><p>Książka Softly Timeless Knits Sari Nordlund wydawnictwa Cozy Publishing zawiera 22 ponadczasowe projekty dzianin do robienia na drutach łączące codzienny komfort z wszechstronnością.</p><p>Pięknie wydana książka na wysokiej jakości papierze z artystycznymi zdjęciami</p><h4>O autorce :</h4><p>Sari Nordlund to jedna z najpopularniejszych fińskich projektantek dzianin, której kreacje zdobiły magazyny dziewiarskie na całym świecie. Współpracowała także jako projektant z czołowymi producentami włóczek. Sari posiada wyjątkową umiejętność łączenia codziennego piękna swojego otoczenia – fińskiej przyrody, secesyjnej architektury, sztuki i kultury popularnej w Helsinkach – w obfite źródło dziewiarskich inspiracji.</p><p> </p><p><span class=\"jCAhz ChMk0b\"><span class=\"ryNqvb\">Publikacja: 11.2023</span></span><br />\n<span class=\"jCAhz ChMk0b\"><span class=\"ryNqvb\">Liczba stron: 220</span></span>&lt;...</p>','\n                <p>Książka z ponadczasowymi projektami dzianin</p><p>wydanie język angielski</p>\n            ','softly-sari-nordlund','','','','Softly Sari Nordlund','','','',''),(522,1,1,'<h2>Książka WestKnits Painting Shawls</h2><p>Wydanie Painting Shawls WestKnits zawiera 13 wzorów dziewiarskich z kolekcji malowanych dzianin. Wszystkie wzory posiadają zamysł głównego koloru z kontrastowymi akcentami, a ich artystyczne mieszanie daje finalnie zachwycający, niebywały efekt. Są niczym jak dzieła sztuki !</p><p>Wzory szali przedstawione w książce są mieszanką nowych i powstałych wcześniej projektów szali Westknits.</p><p>Książka jest pięknie sfotografowana i zawiera wiele ujęć każdego projektu, które świetnie wizualizują efekt końcowy i poszczególne niuanse.</p><p>Oprócz 13 wzorów w książce znajdziesz również informacje  dotyczące zastępowania włóczek, robieniu próbek, blokowania i dostosowywania rozmiaru szali.</p><p>Każda książka zawiera kod do pobrania w formacie cyfrowym, dzięki czemu można uzyskać dostęp do plików PDF wszystkich wzorów.</p><p>Wyrusz w podróż do wełnianego świata Westknits i wykorzystaj artystyczne wzo...</p>','\n                <p>Książka zawiera 13 wzorów na malowane szale autorstwa Stephena Westa</p><p><strong>Wydanie w języku ANGIELSKIM</strong></p>\n            ','westknits-painting-shawls','','','','WestKnits Painting Shawls','','','',''),(523,1,1,'<h1>Zestaw do robienia na drutach Milano Sweater Pascuali</h1><p>Milano Sweater to wzór na druty z włóczką, według którego wykonasz modowy sweter w paski, który nada szyku i elegancji lub sportowego <em>look’u</em> każdej Twojej stylizacji. To bardzo uniwersalny projekt, który wykonasz na drutach z włóczki marki Pascuali: <a href=\"https://miedzydrutami.pl/pascuali-wloczka-sayama/\" target=\"_blank\" rel=\"noreferrer noopener\"><em><strong>Sayama</strong></em></a>.</p><p>Każdy etap dziergania bluzki swetra Milano będzie dla Ciebie niezwykłą przyjemnością. Rozpoczynasz sweter Milano od zrobienia paska ściegiem francuskim na górnej części pleców. Następnie, zaczynając od tego kolorowego paska, kontynuujesz przerabianie tyłu za pomocą rzędów skróconych. Następnie dwie przednie sekcje dziergasz pojedynczo, kontynuując  rzędy skrócone. Dodatkowe oczka podbierasz z krawędzi kolorowego paska, a następnie wszystkie oczka umieszczasz na żyłce. Podczas pracy w rz...</p>','\n                <p>Zestaw wzór z włóczką do samodzielnego wykonania przepięknego swetra w paski, który sprawdzi się w każdej Twojej stylizacji. Sweter wydziergasz na drutach z włóczki Sayama marki Pascuali.</p><ul><li>zestaw zawiera wzór dziewiarski w języku angielskim (wersja elektroniczna PDF) i wybraną włóczkę.</li><li>Zestawy kompletowane są w terminie 2 – 10 dni, zależy od dostępności wybranego koloru włóczki.</li></ul><p><span style=\"color:#339966;\"><strong>Ten wzór kupujesz w wersji cyfrowej, w formacie pdf. Wzór należy pobrać, z linku przesłanego w wiadomości e-mail, którą otrzymasz po wysyłce zamówienia, lub z zakładki „pliki do pobrania” któryą znajdziesz w swoim koncie sklepu</strong></span></p><hr /><p><span style=\"color:#ff9900;\"><strong><span style=\"text-decoration:underline;\">WAŻNA INFORMACJA:</span> </strong></span><strong>kolor Sayama</strong><span style=\"color:#ff9900;\"><strong> to kolor główny swetra a kolor </strong></span><strong>Sayama 2</strong><span style=\"color:#ff9900;\"><strong> to kolor na paski.</strong></span></p>\n            ','milano-sweater-wzor-na-druty-z-wloczka','','','','Milano Sweater wzór na druty z włóczką','','','',''),(524,1,1,'<h2>Demeter Beanie wzór na druty z włóczką do samodzielnego wykonania czapki</h2><p>Demeter Beanie to wzór na druty z włóczką, według którego wykonasz miękką i ciepłą czapkę w stylu <em>beanie</em>. Wzór autorstwa Aliny oraz Eweliny Wójcik to efektowny projekt, który przyciąga wzrok nie tylko kolorem i jakościową przędzą, lecz także modnym w tym sezonie fasonem w stylu <em>beanie</em> oraz ciekawym wzorem kłosów na rondzie czapki. Projekt wykonasz z włóczki <a href=\"https://miedzydrutami.pl/pascuali-wloczka-cashmere-charis/\" target=\"_blank\" rel=\"noreferrer noopener\"><em><strong>Cashmere Charis</strong></em></a> od Pascuali.</p><p>Demeter Beanie to nie tylko efektowne i modowe nakrycie głowy, lecz także bardzo prosty do wykonania projekt. Czapkę wydziergasz na okrągło. Pracę zaczyna się od dołu czapki i najpierw należy wydziergać ozdobny ściągacz, następnie przerabia się – motywem kłosów – rondo czapki. Na końcu odejmuje się oczka by zamknąć całość...</p>','\n                <p>Zestaw do samodzielnego wykonania czapki z motywem kłosów.</p><ul><li>zestaw zawiera wzór dziewiarski w języku polskim (wersja elektroniczna PDF) i wybraną włóczkę.</li><li>Zestawy kompletowane są w terminie 2 – 10 dni, zależy od dostępności wybranego koloru włóczki.</li></ul><p><span style=\"color:#339966;\"><strong>Ten wzór kupujesz w wersji cyfrowej, w formacie PDF. Wzór </strong><strong>pobierz klikając w link, który otrzymasz w ostatniej wiadomości e-mail, potwierdzającej finalizację zamówienia.</strong></span></p><hr /><p>Zanim zdecydujesz się na zakup, załóż konto w naszym sklepie <a href=\"https://miedzydrutami.pl/moje-konto/\" target=\"_blank\" rel=\"noreferrer noopener\"><em><strong>TUTAJ</strong></em></a>, aby mieć wygodny dostęp do kupionego wzoru elektronicznego. Po zakupie, wzór automatycznie pojawi się na Twoim koncie, co pozwoli Ci na pobranie go w każdej chwili. Już nie musisz martwić się o zagubione maile – wszystko znajdziesz w jednym miejscu!</p>\n            ','demeter-beanie-zestaw-wzor-na-druty-z-wloczka','','','','Demeter Beanie zestaw wzór na druty z włóczką','','','',''),(525,1,1,'<h2>Domino Vest wzór na druty z włóczką</h2><p>Domino Vest to wzór na druty z włóczką, według którego wykonasz miękką i ciepłą kamizelkę. Wzór autorstwa Aliny oraz Eweliny Wójcik to efektowny projekt, który przyciąga wzrok nie tylko kolorem i jakościową przędzą, lecz także dopasowanym fasonem oraz ciekawym wzorem strukturalnym. Projekt wykonasz z włóczki <a href=\"https://miedzydrutami.pl/pascuali-wloczka-sayama/\" target=\"_blank\" rel=\"noreferrer noopener\"><b><i>Sayama</i></b></a> od Pascuali.</p><p>Każdy etap dziergania kamizelki Domino Vest to nie tylko przyjemność, lecz także różnorodność zastosowanych technik dziewiarskich. Całość przerabia się od góry do dołu. Tył należy przerabiać ściegiem dżersejowym a przód strukturalnym wzorem według schematu. Najpierw dzierga się górną część karczku. Następne ramiona, gdzie podbiera się oczka wzdłuż ukośnych boków tyłu, nadając im kształt, który pięknie dopasowuje się do sylwetki. Następnie należy połączyć...</p>','\n                <p>Zestaw do samodzielnego wykonania ponadczasowej, eleganckiej i kobiecej kamizelki.</p><ul><li>zestaw zawiera wzór dziewiarski w języku polskim (wersja elektroniczna PDF) i wybraną włóczkę.</li><li>Zestawy kompletowane są w terminie 2 – 10 dni, zależy od dostępności wybranego koloru włóczki.</li></ul><p><span style=\"color:#339966;\"><strong>Ten wzór kupujesz w wersji cyfrowej, w formacie PDF. Wzór </strong><strong> pobierz klikając w link, który otrzymasz w ostatniej wiadomości e-mail, potwierdzającej finalizację zamówienia.</strong></span></p><hr /><p>Zanim zdecydujesz się na zakup, załóż konto w naszym sklepie <a href=\"https://miedzydrutami.pl/moje-konto/\" target=\"_blank\" rel=\"noreferrer noopener\"><em><strong>TUTAJ</strong></em></a>, aby mieć wygodny dostęp do kupionego wzoru elektronicznego. Po zakupie, wzór automatycznie pojawi się na Twoim koncie, co pozwoli Ci na pobranie go w każdej chwili. Już nie musisz martwić się o zagubione maile – wszystko znajdziesz w jednym miejscu!</p>\n            ','domino-vest-wzor-na-druty-z-wloczka','','','','Domino Vest wzór na druty z włóczką','','','',''),(526,1,1,'<h2>Świąteczny sweter 24-04 zestaw wzór z włóczką</h2><p>Świąteczny sweter 24-04 to wzór na druty według, którego wykonasz przepiękny sweter żakardowy z motywem świątecznym. Niezwykłe ornamenty, choinki oraz renifery z czerwonymi nosami powstają z włóczki <a href=\"https://miedzydrutami.pl/wloczka-tynn-peer-gynt/\" target=\"_blank\" rel=\"noreferrer noopener\"><em><strong>Tynn Peer Gynt</strong></em></a> marki Sandnes Garn.</p><h3>Skład zestawu:</h3><ul><li style=\"list-style-type:none;\"><ul><li>1 szt. wzoru Świąteczny sweter 24-04 Sandnes Garn – wersja drukowana, format B6 (dodatkowo broszura zawiera kod QR do pobrania wersji PDF), język angielski;</li><li>odpowiednią ilość włóczki <a href=\"https://miedzydrutami.pl/wloczka-tynn-peer-gynt/\" target=\"_blank\" rel=\"noreferrer noopener\"><em><strong>Tynn Peer Gynt</strong></em></a> w kolorach zgodnie z projektem;</li></ul></li></ul><h3 class=\"_04xlpA direction-ltr align-justify 