i wybraną włóczkę.</li><li>Zestawy kompletowane są w terminie 2 – 10 dni, zależy od dostępności wybranego koloru włóczki.</li></ul>\n            ','scarlett-cardigan-2409-12-wzor-na-druty-z-wloczka','','','','Scarlett Cardigan 2409-12 wzór na druty z włóczką','','','',''),(543,1,1,'<h2>Penny Cardigan 2409-03 zestaw wzór z włóczką do robienia na drutach</h2><p>Wzór do robienia na drutach Penny Cardigan 2409-03 Sandnes Garn to rozpinany sweter, który wydziergasz z cienkiej wełny norweskiej <a href=\"https://miedzydrutami.pl/wloczka-tynn-peer-gynt/\" target=\"_blank\" rel=\"noreferrer noopener\"><em><strong>Tynn Peer Gynt</strong></em></a> połączonej z moherem <a href=\"https://miedzydrutami.pl/wloczka-tynn-silk-mohair/\" target=\"_blank\" rel=\"noreferrer noopener\"><em><strong>Tynn Silk Mohair</strong></em></a> marki Sandnes Garn.</p><p>Sweter dzierga się od góry do dołu, w tę i z powrotem. Najpierw wykonuje się karczek, oczka dodaje się w reglanie. Rękawy dzierga się na okrągło.</p><h3>Skład zestawu:</h3><ul><li style=\"list-style-type:none;\"><ul><li>1 szt. wzoru Penny Cardigan 2409-03 Sandnes Garn – wersja drukowana, format B6 (dodatkowo broszura zawiera kod QR do pobrania wersji PDF), język angielski;</li><li>odpowiednią ilość włóczki <a href=\"h...\"></a></li></ul></li></ul>','\n                <p>Zestaw do wykonania na drutach kardiganu zapinanego na guziki o kroju oversize.</p><ul><li>zestaw zawiera wzór dziewiarski w języku angielskim (wersja drukowana) i wybraną włóczkę.</li><li>Zestawy kompletowane są w terminie 2 – 10 dni, zależy od dostępności wybranego koloru włóczki.</li></ul>\n            ','penny-cardigan-2409-03-wzor-na-druty-z-wloczka','','','','Penny Cardigan 2409-03 wzór na druty z włóczką','','','',''),(544,1,1,'<h2>Heather Sweater Cable Edition 2409-13 zestaw wzór z włóczką do robienia na drutach</h2><p>Wzór do robienia na drutach Heather Sweater Cable Edition 2409-13 Sandnes Garn to strukturalny sweter, który wydziergasz z cienkiej wełny norwes