style=\"color:#339966;\">WAŻNA INFROMACJA!</span></strong></p><p><strong><span style=\"color:#339966;\">Kolor włóczki Ballerina Chunky jest pierwszy w kolejności, potem jest kolor Borstet Alpakka a na końcu wybiera się rozmiar swetra.</span></strong></p>\n            ','noa-sweater-2409-06-wzor-na-druty-z-wloczka','','','','Noa Sweater 2409-06 wzór na druty z włóczką','','','',''),(547,1,1,'<h2>Lumen Cardigan 2409-04 zestaw wzór z włóczką do robienia na drutach</h2><p>Wzór do robienia na drutach Lumen Cardigan 2409-04 Sandnes Garn to gładki kardigan, wiązany na boku z szeroką plisą, który wydziergasz z cienkiej wełny norweskiej <a href=\"https://miedzydrutami.pl/wloczka-tynn-peer-gynt/\" target=\"_blank\" rel=\"noreferrer noopener\"><em><strong>Tynn Peer Gynt</strong></em></a> połączonej z moherem <a href=\"https://miedzydrutami.pl/wloczka-tynn-silk-mohair/\" target=\"_blank\" rel=\"noreferrer noopener\"><em><strong>Tynn Silk Mohair</strong></em></a> marki Sandnes Garn.</p><p>Kardigan dzierga się na drutach od góry do dołu. Najpierw wykonuje się karczek z tyłu dziergając w tę i z powrotem. Jednocześnie kształtuje się skośne ramiona. Następnie nabiera się oczka na przód i kształtuje dekolt w kształcie litery V. Na końcu wykańcza się plisę oraz dodaje dzianinowy pas, którym możemy zawiązać kardigan.</p><h3>Skład zestawu:</h3><ul><li></li></ul>','\n                <p>Piękny kardigan z dekoltem V i szeroką plisą zawiązywany na boku.</p><ul><li>zestaw zawiera wzór dziewiarski w języku angielskim (wersja drukowana) i wybraną włóczkę.</li><li>Zestawy kompletowane są w terminie 2 – 10 dni, zależy od dostępności wybranego koloru włóczki.</li></ul>\n            ','lumen-cardigan-2409-04-wzor-na-druty-z-wloczka','','','','Lumen Cardigan 2409-04 wzór na druty z włóczką','','','',''),(548,1,1,'<h2>Spencer Sweater Ballerina Edition 2409-07 zestaw wzór z włóczką do robienia na drutach</h2><p>Wzór do robienia na drutach Spencer Sweater 2409-07 Sandnes Garn to gładki sweter, który wydziergasz z niesamowicie puchatej włóczki <strong><em><a href=\"https://miedzydrutami.pl/ballerina-chunky-sandnes-garn/\" target=\"_blank\" rel=\"noreferrer noopener\">Ballerina Chunky</a> </em></strong>marki Sandnes Garn.</p><p>Sweter dzierga się na drutach od góry do dołu. Najpierw wykonuje się karczek z tyłu dziergając w tę i z powrotem. Jednocześnie kształtuje się skośne ramiona. Następnie nabiera się oczka na przód, kształtuje dekolt i dodaje oczka metodą reglanu. Następnie robótkę dzieli się na rękawy, przód oraz tył i dzierga w okrążeniu. Wykończeniem swetra jest podwójna plisa przy dekolcie</p><h3>Skład zestawu:</h3><ul><li style=\"list-style-type:none;\"><ul><li>1 szt. wzoru Spencer Sweater 2409-07 Sandnes Garn – wersja drukowana, format B6 (dodatkowo broszura...</li></ul></li></ul>','\n                <p>Klasyczny sweter wykonany z puszystego moheru Ballerina Chunky.</p><ul><li>zestaw zawiera wzór dziewiarski w języku angielskim (wersja drukowana) i wybraną włóczkę.</li><li>Zestawy kompletowane są w terminie 2 – 10 dni, zależy od dostępności wybranego koloru włóczki.</li></ul>\n            ','spencer-sweater-ballerina-edition-2409-07-wzor-na-druty-z-wloczka','','','','Spencer Sweater Ballerina Edition 2409-07 wzór na druty z włóczką','','','',''),(549,1,1,'<h2>Molly Sweater 2409-01 zestaw wzór z włóczką do robienia na drutach</h2><p>Wzór do robienia na drutach Molly Sweater 2409-01 Sandnes Garn to gładki sweter, który wydziergasz z cienkiej alpaki <a href=\"https://miedzydrutami.pl/alpakka-folgetrad-sandnes-garn/\" target=\"_blank\" rel=\"noreferrer noopener\"><em><strong>Alpakka Folgetrad</strong></em></a> połączonej z moherem <a href=\"https://miedzydrutami.pl/wloczka-tynn-silk-mohair/\" target=\"_blank\" rel=\"noreferrer noopener\"><em><strong>Tynn Silk Mohair</strong></em></a> marki Sandnes Garn.</p><p>Sweter dzierga się na drutach od góry do dołu. Najpierw wykonuje się karczek z tyłu dziergając w tę i z powrotem. Jednocześnie kształtuje się skośne ramiona. Następnie nabiera się oczka na przód i kształtuje dekolt. Następnie robótkę dzieli się na rękawy, przód oraz tył i dzierga w okrążeniu. Wykończeniem swetra jest podwójna plisa przy dekolcie.</p><h3>Skład zestawu:</h3><ul><li style=\"list-style-type:none;\"><ul><li>1...</li></ul></li></ul>','\n                <p>Klasyczny sweter z szerokimi rękawami wykonany z cieniutkiej alpaki połączonej z moherem.</p><ul><li>zestaw zawiera wzór dziewiarski w języku angielskim (wersja drukowana) i wybraną włóczkę.</li><li>Zestawy kompletowane są w terminie 2 – 10 dni, zależy od dostępności wybranego koloru włóczki.</li></ul>\n            ','molly-sweater-2409-01-wzor-na-druty-z-wloczka','','','','Molly Sweater 2409-01 wzór na druty z włóczką','','','',''),(550,1,1,'<h2>Ponczo Dotted Cape zestaw do robienia na drutach</h2><p>Narzutka na ramiona Dotted Cape z kolekcji wzorów marki Pascuali to ponadczasowy projekt, który wykonasz na drutach z włóczki <a href=\"https://miedzydrutami.pl/pascuali-wloczka-sayama/\" target=\"_blank\" rel=\"noreferrer noopener\"><b><i>Sayama</i></b></a> marki Pascuali.</p><p><span class=\"Y2IQFc\" lang=\"pl\" xml:lang=\"pl\">Dotted Cape z pięknym teksturowanym wzorem <em>piqué</em> dzierga się na płasko od góry do dołu. Najpierw należy wykonać kołnierz, następnie wykonuje się pozostałą część narzutki i ściegiem mchu wykańcza się dzianinę. Aby stworzyć otwory na ręce, zamyka się oczka. Są one przyszywane do obszycia na końcu.</span></p><p>Opis wzoru zawiera interaktywne linki do filmów pokazujących użyte techniki dziewiarskie.</p><h3>Skład zestawu Dotted Cape:</h3><ul><li style=\"list-style-type:none;\"><ul><li style=\"list-style-type:none;\"><ul><li>1 szt. wzoru Dotted Cape (<strong>wersja elektroniczna w forma...</strong></li></ul></li></ul></li></ul>','\n                <p>Niezwykle ciepłe i eleganckie ponczo z delikatnym wzorem <em>piqué.</em></p><ul><li>zestaw zawiera wzór dziewiarski w języku angielskim (wersja elektroniczna PDF) i wybraną włóczkę.</li><li>Zestawy kompletowane są w terminie 2 – 10 dni, zależy od dostępności wybranego koloru włóczki.</li></ul><p><strong>Ten wzór kupujesz w wersji cyfrowej, w formacie pdf. Wzór należy pobrać, z linku przesłanego w wiadomości e-mail, którą otrzymasz po wysyłce zamówienia.</strong></p>\n            ','ponczo-dotted-cape-wzor-na-druty-z-wloczka','','','','Ponczo DOTTED CAPE wzór na druty z włóczką','','','',''),(551,1,1,'<h2>Zestaw włóczek na sweter</h2><p>Komplet zawiera włóczkę moherową z jedwabiem <em><strong><a href=\"https://miedzydrutami.pl/wloczka-tynn-silk-mohair/\" target=\"_blank\" rel=\"noreferrer noopener\">Tynn Silk Mohair</a></strong></em> marki <em><strong><a href=\"https://www.sandnes-garn.com/yarn\">Sandnes Garn</a></strong></em> i wełnę merino <a href=\"https://miedzydrutami.pl/harmony-lana-gatto-cienka-welna-merino/\" target=\"_blank\" rel=\"noreferrer noopener\"><em><strong>Harmony</strong></em></a> marki Lana Gatto w pasujących do siebie kolorach, przy czym zaznaczam że nie są one identyczne. Zestaw włóczek na sweter powstał z myślą ułatwienia doboru współgrających do siebie kolorów. Obie nitki łączymy i przerabiamy jednocześnie. Mieszanie moheru, jedwabiu i wełny tworzy delikatną, puszystą dzianinę. Takie połączenie gwarantuje <span>lekkość</span><span></span></p>','\n                <p>Zestaw włóczek do stworzenia delikatnego i lekkiego sweterka.</p><p>Zestaw zawiera 4 motki moheru z jedwabiem oraz 1 motek cieniutkiej wełny merino.</p>\n            ','tynn-silk-mohair-zestaw-wloczek-na-sweter','','','','Tynn Silk Mohair Zestaw włóczek na sweter','','','',''),(553,1,1,'<h2>Delikatny moherowy szal z jedwabiem Sensai ITO</h2><p>Sensai ITO moherowy szal z jedwabiem to delikatny jak mgła i lekki jak piórko szal, który został wykonany w Japonii z przędzy <a href=\"https://miedzydrutami.pl/ito-sensai/\" target=\"_blank\" rel=\"noreferrer noopener\"><em><strong>Sensai ITO</strong></em></a>. To wyjątkowy dodatek do każdej stylizacji, którym otulisz się w chłodniejsze dni lub urozmaicisz każdą stylizację. W naszym sklepie znajdziesz trzy warianty kolorystyczne szala.</p><p>Jeśli chcesz wykonać podobny szal na drutach to <a href=\"https://miedzydrutami.pl/ito-sensai/\" target=\"_blank\" rel=\"noreferrer noopener\"><em><strong>TUTAJ</strong></em></a> znajdziesz moherową przędzę z jedwabiem Sensai ITO – na szal potrzebujesz ok. 5 motków. Wykonaj go na drutach w rozmiarze od 3,5 do 4,0 mm. Jeśli zdecydujesz się wykonać szal na grubszych drutach pamiętaj, że oczka wyjdą większe.</p><p>Więcej na temat tego produktu przeczytasz na stronie producenta ...</p>','\n                <p>Delikatny, lekki i otulający szal z moheru i jedwabiu.</p>\n            ','sensai-ito-moherowy-szal-z-jedwabiem','','','','Sensai ITO moherowy szal z jedwabiem','','','','');
